"use strict";(self.webpackChunkgloria_tilog_root=self.webpackChunkgloria_tilog_root||[]).push([[1044],{8106:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"/2023/05/24/side-project/docusaurus/docusaurus-comment","metadata":{"permalink":"/gloria-tilog/2023/05/24/side-project/docusaurus/docusaurus-comment","source":"@site/blog/side-project/docusaurus/2023-05-24-docusaurus-comment.mdx","title":"[docusaurus] Configure Comment with Utterances","description":"\uac1c\uc778 \uac1c\ubc1c \ube14\ub85c\uadf8\uc5d0 Utterances \uc801\uc6a9\uc744 \ud558\uae30 \uc704\ud55c \uacfc\uc815\uc744 \uac04\ub7b5\ud788 \uc815\ub9ac\ud574\ub450\uc5c8\ub2e4.","date":"2023-05-24T09:18:00.000Z","formattedDate":"May 24, 2023","tags":[{"label":"devlog","permalink":"/gloria-tilog/tags/devlog"},{"label":"docusaurus","permalink":"/gloria-tilog/tags/docusaurus"},{"label":"utterances","permalink":"/gloria-tilog/tags/utterances"}],"readingTime":3.68,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[docusaurus] Configure Comment with Utterances","tags":["devlog","docusaurus","utterances"],"date":"2023-05-24T09:18"},"nextItem":{"title":"[docusaurus] Configure Search","permalink":"/gloria-tilog/2023/05/23/side-project/docusaurus/docusaurus-search"}},"content":"\uac1c\uc778 \uac1c\ubc1c \ube14\ub85c\uadf8\uc5d0 `Utterances` \uc801\uc6a9\uc744 \ud558\uae30 \uc704\ud55c \uacfc\uc815\uc744 \uac04\ub7b5\ud788 \uc815\ub9ac\ud574\ub450\uc5c8\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n\ucf54\uba58\ud2b8 \uae30\ub2a5\uc744 \ucd94\uac00\ud558\uae30 \uc704\ud574 [Utterances](https://utteranc.es/)\ub97c \uc801\uc6a9\ud558\uc600\ub2e4.\\nDisqus\ub3c4 \uc788\uc9c0\ub9cc, Github\uc758 Repo\uc758 issue\ub85c \uad00\ub9ac\uac00 \ub41c\ub2e4\ub294 \ubd80\ubd84\uc774 \ub9e4\ub825\uc801\uc774\uace0 \uac00\ubcbc\uc6b4 \ub290\ub08c\uc774 \ub4e4\uc5b4 \ud574\ub2f9 \ud50c\ub7ab\ud3fc\uc744 \uc120\ud0dd\ud558\uac8c \ub418\uc5c8\ub2e4.\\n\\n## utterances \uc124\uc815\\n\\n### Comment\uac00 \ub4f1\ub85d\ub420 Repo\ub97c \uc815\ud558\uae30\\n\\n\ube14\ub85c\uadf8 \uc18c\uc2a4\uac00 \uad00\ub9ac\ub418\ub294 repo\ub97c \uc0ac\uc6a9\ud558\uc5ec\ub3c4 \ub418\uc9c0\ub9cc, \ub098\ub294 \ube14\ub85c\uadf8\uc5d0 \ucd94\uac00\ud560 \uae30\ub2a5\uc774\ub098 \uc218\uc815\ud560 \ubd80\ubd84\uc774 \uc788\uc73c\uba74 \uae43\uc774\uc288\ub85c \ub4f1\ub85d\ud558\uc5ec \uae30\ub85d\ud558\uace0 \uc788\uc5b4\uc11c \ubcc4\ub3c4\uc758 \ub808\ud3ec\ub97c \uc0dd\uc131\ud558\uc600\ub2e4.\\n\uadf8\ub9ac\uace0 Comment\ub97c \uad00\ub9ac\ud558\uae30 \uc704\ud55c \ub808\ud3ec\ub294 utterances \uc571\uc774 \uc811\uadfc\ud560 \uc218 \uc788\ub294 \uad8c\ud55c\uc774 \uc788\uc5b4\uc57c \ud558\uace0, public repo \uc5ec\uc57c \ud55c\ub2e4.\\n\\n### utterances App Install\\n\\n[utterances GitHub App](https://github.com/apps/utterances)\uc744 \uc0dd\uc131\ud55c Repo\uc5d0 \uc124\uce58\ud574\uc900\ub2e4.\\n\\ncomment\ub97c \uad00\ub9ac\ud558\uace0\uc790 \ud558\ub294 \ub808\ud3ec\uc5d0\ub9cc \uc124\uce58\ud574\uc8fc\uc5c8\ub2e4.\\n![install](./utterances-install.jpeg)\\n\\n### Check & Copy Utterance Configuration\\n\\nutterances App\uc744 \uc124\uce58\ud558\uace0\ub098\uba74 https://utteranc.es/?installation_id=37845297&setup_action=install \ub9c1\ud06c\uac00 \ub178\ucd9c\uc774 \ub418\ub294\ub370,\\n\ud574\ub2f9 \ud654\uba74\uc744 \ud1b5\ud558\uc5ec Comment\uac00 \ub178\ucd9c\ub418\ub3c4\ub85d \ud558\uae30 \uc704\ud55c \uc124\uc815\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n\ub2e4\uc74c \uc608\uc2dc\uc640 \uac19\uc774 \uc124\uce58\ud558\uace0\uc790 \ud558\ub294 \ub808\ud3ec \uc774\ub984, \uc774\uc288 \ud0c0\uc774\ud2c0\uc744 \ubb34\uc5c7\uc73c\ub85c \uc124\uc815\ud558\ub3c4\ub85d \ud560 \uac83\uc778\uc9c0 \ub4f1\uc744 \uc124\uc815\ud55c \ub4a4 \uc81c\uc77c \ud558\ub2e8\uc758 `Enable Utterance` \ubd80\ubd84\uc5d0 \uc791\uc131\ub41c \ub0b4\uc6a9\uc744 \ud655\uc778\ud574\ub454\ub2e4.\\n![config](./utterances-config.jpeg)\\n\\n## Add Comment Component\\n\\nutterances\uc758 script \uc124\uc815 \ubd80\ubd84\uc744 \ucc38\uace0\ud558\uc5ec \ub2e4\uc74c\uacfc \uac19\uc774 Comment Component\ub97c \uc791\uc131\ud558\uc600\ub2e4.\\n\\n```javascript title=\\"src/components/Comment/index.tsx\\"\\nimport React, { useEffect, useRef } from \'react\';\\n\\nimport { useColorMode } from \'@docusaurus/theme-common\';\\n\\nconst utteranceDomain = \'https://utteranc.es\';\\n\\nexport function Comment() {\\n  const { colorMode } = useColorMode();\\n\\n  const boxRef = useRef < HTMLDivElement > null;\\n\\n  useEffect(() => {\\n    if (!boxRef.current) {\\n      return;\\n    }\\n\\n    const utteranceFrameElement =\\n      boxRef.current.querySelector < HTMLIFrameElement > \'.utterances-frame\';\\n    const theme = `github-${colorMode}`;\\n\\n    if (utteranceFrameElement) {\\n      utteranceFrameElement.contentWindow.postMessage(\\n        {\\n          type: \'set-theme\',\\n          theme,\\n        },\\n        utteranceDomain,\\n      );\\n    } else {\\n      const script = document.createElement(\'script\');\\n      script.src = `${utteranceDomain}/client.js`;\\n      script.setAttribute(\'repo\', \'gloriaJun/gloria-tilog-comment\');\\n      script.setAttribute(\'issue-term\', \'title\');\\n      script.setAttribute(\'theme\', theme);\\n      script.crossOrigin = \'anonymous\';\\n      script.async = true;\\n\\n      boxRef.current.appendChild(script);\\n    }\\n  }, [colorMode]);\\n\\n  return <div ref={boxRef} />;\\n}\\n```\\n\\n### Override BlogPostItem & DocItem\\n\\nDocument\uc640 Blog \ud615\ud0dc\uc758 \uae00\uc5d0 \ubaa8\ub450 \ub313\uae00 \uae30\ub2a5\uc744 \ucd94\uac00\ud574\uc8fc\uae30 \uc704\ud574, **DocItem**\uacfc **BlogPostItem** \ucef4\ud3ec\ub10c\ud2b8\ub97c swizzle \uae30\ub2a5\uc744 \uc774\uc6a9\ud558\uc5ec \uaebc\ub0b4\uc8fc\uc5c8\ub2e4.\\n\\n```bash npm2yarn\\nnpm swizzle @docusaurus/theme-classic BlogPostItem --wrap\\nnpm swizzle @docusaurus/theme-classic DocItem --wrap\\n```\\n\\n\ucc38\uace0\ub85c \ub098\ub294 @nx-plus\ub97c \uc774\uc6a9\ud558\uc5ec nx \ud658\uacbd\uc5d0 docusaurus\ub97c \uad6c\uc131\ud558\uc600\ub294\ub370, \uc774 \uacbd\uc6b0 swizzle \uc2e4\ud589 \uc2dc \uc798 \uc548\ub418\uc5b4 \ub2e4\uc74c\uacfc \uac19\uc774 \uc2e4\ud589\ud558\uc600\ub2e4.\\n\\n```bash\\nnpx docusaurus swizzle @docusaurus/theme-classic BlogPostItem --wrap\\nnpx docusaurus swizzle @docusaurus/theme-classic DocItem --wrap\\n```\\n\\n\uadf8 \ub4a4\uc5d0 **DocItem**\uacfc **BlogPostItem** \ucef4\ud3ec\ub10c\ud2b8\ub97c \uc5f4\uc5b4\uc11c \uc55e\uc5d0\uc11c \uc791\uc131\ud55c Comment \ucef4\ud3ec\ub10c\ud2b8\ub97c \ud558\ub2e8\uc5d0 \ucd94\uac00\ud574\uc900\ub2e4.\\n\\n```javascript title=\\"src/theme/BlogPostItem/index.tsx\\"\\nimport React from \'react\';\\n\\nimport { useBlogPost } from \'@docusaurus/theme-common/internal\';\\nimport { Comment } from \'@site/src/components/Comment\';\\nimport BlogPostItem from \'@theme-original/BlogPostItem\';\\n\\nexport default function BlogPostItemWrapper(props) {\\n  // highlight-next-line\\n  const { isBlogPostPage } = useBlogPost();\\n\\n  return (\\n    <>\\n      <BlogPostItem {...props} />\\n      // highlight-next-line\\n      {isBlogPostPage && <Comment />}\\n    </>\\n  );\\n}\\n```\\n\\n```javascript title=\\"src/theme/DocItem/index.tsx\\"\\nimport React from \'react\';\\n\\nimport { Comment } from \'@site/src/components/Comment\';\\nimport DocItem from \'@theme-original/DocItem\';\\n\\nexport default function BlogPostItemWrapper(props) {\\n  return (\\n    <>\\n      <BlogPostItem {...props} />\\n      // highlight-next-line\\n      <Comment />\\n    </>\\n  );\\n}\\n```"},{"id":"/2023/05/23/side-project/docusaurus/docusaurus-search","metadata":{"permalink":"/gloria-tilog/2023/05/23/side-project/docusaurus/docusaurus-search","source":"@site/blog/side-project/docusaurus/2023-05-23-docusaurus-search.mdx","title":"[docusaurus] Configure Search","description":"\uc791\uc131\ud55c \uac1c\ubc1c \ube14\ub85c\uadf8\ub97c \uad6c\uae00 \uac80\uc0c9\uc5d0 \ub178\ucd9c\ud558\uae30 \uc704\ud55c \uacfc\uc815\uc774\ub2e4.","date":"2023-05-23T09:18:00.000Z","formattedDate":"May 23, 2023","tags":[{"label":"devlog","permalink":"/gloria-tilog/tags/devlog"},{"label":"docusaurus","permalink":"/gloria-tilog/tags/docusaurus"},{"label":"search","permalink":"/gloria-tilog/tags/search"}],"readingTime":2.26,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[docusaurus] Configure Search","tags":["devlog","docusaurus","search"],"date":"2023-05-23T09:18"},"prevItem":{"title":"[docusaurus] Configure Comment with Utterances","permalink":"/gloria-tilog/2023/05/24/side-project/docusaurus/docusaurus-comment"},"nextItem":{"title":"[NX] Tips","permalink":"/gloria-tilog/2023/05/19/frontend/2023/nx-tips"}},"content":"\uc791\uc131\ud55c \uac1c\ubc1c \ube14\ub85c\uadf8\ub97c \uad6c\uae00 \uac80\uc0c9\uc5d0 \ub178\ucd9c\ud558\uae30 \uc704\ud55c \uacfc\uc815\uc774\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n\uae30\ubcf8\uc801\uc73c\ub85c docusaurus \uacf5\uc2dd\ubb38\uc11c\uc5d0\uc11c\ub294 \uac80\uc0c9 \uae30\ub2a5 \uad6c\ud604 \uad00\ub828\ud558\uc5ec [Algolia](https://docusaurus.io/ko/docs/next/search)\ub97c \uac00\uc774\ub4dc\ud558\uace0 \uc788\ub2e4.\\n\ud558\uc9c0\ub9cc, \ub098\ub294 Google \uac80\uc0c9\uc5d0\uc11c \ub0b4 \ube14\ub85c\uadf8\ub97c \ub178\ucd9c\uc2dc\ud0a4\uace0, [Google Search Console](https://search.google.com/search-console/welcome?hl=ko)\uc744 \ud65c\uc6a9\ud574\ubcf4\uace0 \uc2f6\uc5b4 \uc774 \ubd80\ubd84\uc5d0 \ub300\ud55c \uc124\uc815\uc744 \ud655\uc778\ud574\ubcf4\uc558\ub2e4.\\n\\n## trailingSlash \uc124\uc815 \uac12 \ud655\uc778\\n\\n[`trailingSlash`](https://docusaurus.io/ko/docs/next/api/docusaurus-config#trailingSlash) \uc124\uc815\uc774 **false**\ub85c \uc124\uc815\ud55c\ub2e4.\\n\\n```bash title=\\"docusaurus.config.js\\"\\n  // ...\\n  favicon: \'img/favicon.ico\',\\n  organizationName: \'gloriajun\', // Usually your GitHub org/user name.\\n  projectName: \'gloria-tilog\', // Usually your repo name.\\n  // highlight-next-line\\n  trailingSlash: false,\\n  // ...\\n```\\n\\n\ud574\ub2f9 \uc124\uc815\uc744 `false`\ub85c \ud574\uc8fc\uc5b4\uc57c \uac01 \uc791\uc131\ud55c \ubb38\uc11c\uc5d0 \ub300\ud558\uc5ec \uc0dd\uc131\ud55c url\uc758 \ubb38\uc11c\uc5d0 \ub300\ud55c html \ud30c\uc77c\uc774 \uc774\ub984\uc774 `<\ubb38\uc11c\uba85>.html`\ub85c \uc0dd\uc131\uc774 \ub418\uace0,\\n\uad6c\uae00 \uac80\uc0c9 \uc5d4\uc9c4\uc5d0\uc11c\ub294 \uc774\uc640 \uac19\uc774 \uc124\uc815\ub418\uc5b4\uc57c \uc815\uc0c1\uc801\uc73c\ub85c \ud655\uc778\uc774 \ub41c\ub2e4\uace0 \ud55c\ub2e4.\\n\\n## Google Search Console \ub4f1\ub85d\\n\\n[Google Search Console](https://search.google.com/search-console/welcome?hl=ko)\uc758 \ub2e4\uc74c\uacfc \uac19\uc740 \ud654\uba74\uc5d0\uc11c blog url\uc744 \ub4f1\ub85d\ud55c\ub2e4.\\n![console](./google-search-console-regist.jpeg)\\n\\n\uadf8 \ub2e4\uc74c\uc5d0\ub294 \ub2e4\uc74c\uacfc \uac19\uc740 \ucc3d\uc5d0\uc11c \\"html \ud0dc\uadf8\\"\ub97c \uc120\ud0dd\ud558\uace0, meta tag \uc815\ubcf4\ub97c \ubcf5\uc0ac\ud55c\ub2e4.\\n![meta](./google-search-meta.jpeg)\\n\\n\ud574\ub2f9 \uc815\ubcf4\ub97c `docusaurus.config.js` \ud30c\uc77c\uc5d0 \uc801\uc6a9\ud55c\ub2e4.\\n\\n```bash title=\\"docusaurus.config.js\\"\\n  // ...\\n themeConfig:\\n    /** @type {import(\'@docusaurus/preset-classic\').ThemeConfig} */\\n    ({\\n      // highlight-start\\n      metadata: [\\n        {\\n          name: \'google-site-verification\',\\n          content: \'*******\',\\n        },\\n      ],\\n      // highlight-end\\n  // ...\\n```\\n\\n\ud574\ub2f9 \uc815\ubcf4\ub97c \uc124\uc815 \ud6c4, blog\ub97c \ubc30\ud3ec\ud55c \ub4a4\uc5d0 \ud574\ub2f9 \ucc3d\uc744 \ub2eb\uc544\uc8fc\uba74, \uad6c\uae00\uc5d0\uc11c \uc778\uc99d\uc744 \uc2dc\ub3c4 \ud6c4 \uc815\uc0c1 \ucc98\ub9ac\uac00 \ub418\uba74 \ub2e4\uc74c\uacfc \uac19\uc740 \ud31d\uc5c5\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4\\n![confirm](./google-search-confirm.jpeg)\\n\\n### Sitemap \ub4f1\ub85d\\n\\n[Google Search Console > Sitemap](https://search.google.com/search-console)\uc5d0 \uc9c4\uc785\ud558\uc5ec, blog\uc758 `sitemap.xml` \ud30c\uc77c\uc744 \uc124\uc815\ud574\uc900\ub2e4.\\n![sitemap](./google-search-sitemap.jpeg)\\n\\n\uadf8 \ub4a4\uc5d0 \uc57d \uc77c\uc8fc\uc77c \uc815\ub3c4 \ud6c4\uc5d0 \uad6c\uae00 \uac80\uc0c9\uc5d0 `site:<blog url>`\uacfc \uac19\uc774 \uac80\uc0c9\ud558\uba74 \ub4f1\ub85d\ud55c site\uc5d0 \ub300\ud574 \uad6c\uae00 \uac80\uc0c9\uc5d0 \ub178\ucd9c\ub418\ub294 \uac83\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4."},{"id":"/2023/05/19/frontend/2023/nx-tips","metadata":{"permalink":"/gloria-tilog/2023/05/19/frontend/2023/nx-tips","source":"@site/blog/frontend/2023/2023-05-19-nx-tips.mdx","title":"[NX] Tips","description":"NX\ub97c \uc0ac\uc6a9\ud558\uba74\uc11c \uae30\ub85d\ud558\uace0\uc790 \ud558\ub294 \ub098\ub9cc\uc758 Tips","date":"2023-05-19T18:38:00.000Z","formattedDate":"May 19, 2023","tags":[{"label":"nx","permalink":"/gloria-tilog/tags/nx"},{"label":"monorepo","permalink":"/gloria-tilog/tags/monorepo"}],"readingTime":1.405,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[NX] Tips","tags":["nx","monorepo"],"date":"2023-05-19T18:38"},"prevItem":{"title":"[docusaurus] Configure Search","permalink":"/gloria-tilog/2023/05/23/side-project/docusaurus/docusaurus-search"},"nextItem":{"title":"[docusaurus] Configure Code Block","permalink":"/gloria-tilog/2023/05/19/side-project/docusaurus/docusaurus-code-block"}},"content":"[NX](https://nx.dev/getting-started/intro)\ub97c \uc0ac\uc6a9\ud558\uba74\uc11c \uae30\ub85d\ud558\uace0\uc790 \ud558\ub294 \ub098\ub9cc\uc758 Tips\\n\\n\x3c!--truncate--\x3e\\n\\n## \ud2b9\uc815 apps\uc5d0\ub9cc \uc815\uc758\ud55c command \uc2e4\ud589\ud558\uae30\\n\\n\uac01 apps\uc5d0\uc11c \uc0ac\uc6a9\ub418\ub294 \ubaa8\ub4e0 command\ub97c root\uc758 package.json\uc5d0 \uc815\uc758\ud558\uae30\uc5d0\ub294 \uc2a4\ud06c\ub9bd\ud2b8\uac00 \ub108~~~\ubb34 \ub9ce\uace0 \uad00\ub9ac\ub3c4 \uc5b4\ub835\ub2e4.\\n\uae30\ubcf8\uc801\uc73c\ub85c \ubaa8\ub4e0 apps\uc5d0\uc11c \ub3d9\uc77c\ud558\uac8c \uc0ac\uc6a9\ud558\ub294 script\ub9cc root\uc5d0 \uc815\uc758\ud558\uace0, \ub098\uba38\uc9c0 \uac01 app\uc5d0\ub9cc \uc885\uc18d\uc801\uc778 \ubd80\ubd84\ub4e4\uc758 \uc2a4\ud06c\ub9bd\ud2b8\ub97c \uc2e4\ud589\ud558\uace0\uc790 \ud558\ub294 \uacbd\uc6b0\ub77c\uba74..\\n\\nroot\uc758 package.json\uc5d0\ub294 \ub2e4\uc74c\uacfc \uac19\uc774 script\ub97c \ucd94\uac00\ud574\uc8fc\uc5c8\ub2e4.\\n\uc194\uc9c1\ud788 \\"run\\"\uc774\ub77c\uace0 \uba85\uc2dc\ud558\uace0 \uc2f6\uc5c8\ub294\ub370 `yarn run` \ub610\ub294 `npm run`\uacfc \uac19\uc774 \ubc94\uc6a9\uc801\uc73c\ub85c \uc0ac\uc6a9\ub418\ub294 *run*\uc774\ub77c\ub294 \ud0a4\uc6cc\ub4dc\uc640 \ucda9\ub3cc\uc774 \ub0a0 \uac83 \uac19\uc544\uc11c...\\n\\n```json title=\\"package.json\\"\\n//...(SKIP)...\\n  \\"scripts\\": {\\n    //...(SKIP)...\\n    \\"cmd\\": \\"nx run\\",\\n    //...(SKIP)...\\n  },\\n//...(SKIP)...\\n```\\n\\n\uadf8\ub9ac\uace0 app\uc5d0 \uc885\uc18d\uc801\uc778 command\ub294 `apps/<app_dir>/project.json`\uc5d0 \ub2e4\uc74c\uacfc \uac19\uc774 \uc815\uc758\ud574\uc900\ub2e4.\\n\\n```json title=\\"project.json\\"\\n//...(SKIP)...\\n    \\"test\\": {\\n      \\"executor\\": \\"nx:run-commands\\",\\n      \\"options\\": {\\n        \\"commands\\": [\\n          {\\n            \\"command\\": \\"yarn run test\\"\\n          }\\n        ]\\n      }\\n    }\\n//...(SKIP)...\\n```\\n\\n\ub9c8\uc9c0\ub9c9\uc73c\ub85c \uc544\ub798\uc640 \uac19\uc774 \ud574\ub2f9 \uba85\ub839\uc5b4\ub97c \uc2e4\ud589\ud574\uc8fc\uba74 \ub41c\ub2e4.\\n\\n```bash\\nyarn run cmd doc:test\\n```"},{"id":"/2023/05/19/side-project/docusaurus/docusaurus-code-block","metadata":{"permalink":"/gloria-tilog/2023/05/19/side-project/docusaurus/docusaurus-code-block","source":"@site/blog/side-project/docusaurus/2023-05-19-docusaurus-code-block.mdx","title":"[docusaurus] Configure Code Block","description":"docusaurus\uc758 \uae30\ub2a5\uc744 \uc774\uc6a9\ud558\uc5ec \uc880 \ub354 \uc608\uc058\uac8c \ub610\ub294 \uac00\ub3c5\uc131 \uc788\uac8c \uc791\uc131\ud55c \uc608\uc2dc \ucf54\ub4dc\uac00 \ubcf4\uc5ec\uc9c8 \uc218 \uc788\ub3c4\ub85d \uc124\uc815\ud574\ubcf4\uc558\ub2e4.","date":"2023-05-19T11:18:00.000Z","formattedDate":"May 19, 2023","tags":[{"label":"devlog","permalink":"/gloria-tilog/tags/devlog"},{"label":"docusaurus","permalink":"/gloria-tilog/tags/docusaurus"}],"readingTime":6.45,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[docusaurus] Configure Code Block","tags":["devlog","docusaurus"],"date":"2023-05-19T11:18"},"prevItem":{"title":"[NX] Tips","permalink":"/gloria-tilog/2023/05/19/frontend/2023/nx-tips"},"nextItem":{"title":"Can not display inspector via iOS Simulator","permalink":"/gloria-tilog/2023/05/16/trouble-shootings/2023/ios-web-inspector"}},"content":"docusaurus\uc758 \uae30\ub2a5\uc744 \uc774\uc6a9\ud558\uc5ec \uc880 \ub354 \uc608\uc058\uac8c \ub610\ub294 \uac00\ub3c5\uc131 \uc788\uac8c \uc791\uc131\ud55c \uc608\uc2dc \ucf54\ub4dc\uac00 \ubcf4\uc5ec\uc9c8 \uc218 \uc788\ub3c4\ub85d \uc124\uc815\ud574\ubcf4\uc558\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n\uc791\uc131\ud55c \ucf54\ub4dc\uc5d0 \ub300\ud574 \uae30\uc874\uc5d0 \ub2e4\uc74c\uacfc \uac19\uc774 \uae30\ubcf8 \uc124\uc815\uc73c\ub85c \uc0ac\uc6a9\ud558\uace0 \uc788\ub358 \ubd80\ubd84\uc5d0 \uc791\uc131\ub41c \ucf54\ub4dc\uc5d0 \ub300\ud558\uc5ec \uc870\uae08 \ub354 \uac00\ub3c5\uc131\uc774 \uc88b\uace0 \uc774\ubed0\ubcf4\uc774\ub3c4\ub85d \ud558\uae30 \uc704\ud574\uc11c \uc124\uc815\uc744 \ubcc0\uacbd\ud558\uc600\ub2e4.\\n\\n## theme\\n\\n\uae30\ubcf8\uc801\uc73c\ub85c docusaurus\uc5d0\uc11c \uae30\ubcf8\uc801\uc73c\ub85c \uc124\uc815\ub41c \ud14c\ub9c8\ub294 **Palenight**\uc778\ub370, \uc774 \ubd80\ubd84\uc744 \ub0b4\uac00 \uc990\uaca8 \uc560\uc6a9\ud558\ub294(?) [dracula](https://docusaurus.io/docs/markdown-features/code-blocks#theming) \ud14c\ub9c8\ub97c dark \ubaa8\ub4dc \uc720\ubb34\uc5d0 \uc0c1\uad00\uc5c6\uc774 \uc0ac\uc6a9\ud558\ub3c4\ub85d \ubcc0\uacbd\ud558\uc600\ub2e4.\\n\\n```diff title=\\"docusaurus.config.js\\"\\nthemeConfig:\\n  prism: {\\n-    theme: lightCodeTheme,\\n-    darkTheme: darkCodeTheme,\\n+   theme: require(\'prism-react-renderer/themes/dracula\'),\\n  },\\n}),\\n```\\n\\n- \ubcc0\uacbd \uc804\\n  ![theme-basic-before](./theme-basic-before.jpeg)\\n- \ubcc0\uacbd \ud6c4\\n  ![theme-basic-after](./theme-basic-after.jpeg)\\n\\n## Custom magic comments\\n\\n\uae30\ubcf8\uc801\uc73c\ub85c [`line highlight`](https://docusaurus.io/docs/markdown-features/code-blocks#line-highlighting) \uae30\ub2a5\uc774 \uc9c0\uc6d0\uc774 \ub418\uace0 \uc788\uc9c0\ub9cc,\\n\uc544\ub798\uc640 \uac19\uc774 \uc791\uc131\ub41c \ucf54\ub4dc\uc5d0 \ub300\ud55c \uc5d0\ub7ec \ud45c\uc2dc\ub97c \ud558\uc774\ub77c\uc774\ud2b8 \ud558\uace0 \uc2f6\uc744 \ub54c \uc0ac\uc6a9\ud558\uae30 \uc704\ud55c \uc124\uc815\uc744 \ucd94\uac00\ud574\uc8fc\uc5c8\ub2e4.\\n\\n```js title=\\"docusaurus.config.js\\"\\nthemeConfig: {\\n  prism: {\\n    //...(SKIP)...\\n      magicComments: [\\n        // Remember to extend the default highlight class name as well!\\n        {\\n          className: \'theme-code-block-highlighted-line\',\\n          line: \'highlight-next-line\',\\n          block: {start: \'highlight-start\', end: \'highlight-end\'},\\n        },\\n        // highlight-start\\n        {\\n          className: \'code-block-error-line\',\\n          line: \'error-next-line\',\\n        },\\n        // highlight-end\\n      ],\\n },\\n},\\n```\\n\\n```css title=\\"src/css/custom.css\\"\\n.code-block-error-line {\\n  background-color: #ff000020;\\n  display: block;\\n  margin: 0 calc(-1 * var(--ifm-pre-padding));\\n  padding: 0 var(--ifm-pre-padding);\\n  border-left: 3px solid #ff000080;\\n}\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uc124\uc815\uc744 \ud574\uc900 \ub4a4\uc5d0 \ub2e4\uc74c \uc608\uc2dc\uc640 \uac19\uc774 \uc791\uc131\uc744 \ud558\uba74....\\n\\n````md title=\\"example\\"\\nIn JavaScript, trying to access properties on `null` will error.\\n\\n```js\\nconst name = null;\\n// error-next-line\\nconsole.log(name.toUpperCase());\\n// Uncaught TypeError: Cannot read properties of null (reading \'toUpperCase\')\\n```\\n````\\n\\n\ub2e4\uc74c\uacfc \uac19\uc774 _console.log_ \ub77c\uc778\uc5d0 \ud558\uc774\ub77c\uc774\ud2b8 \ub418\uc5b4 \ud45c\uc2dc\ub418\ub294 \uac83\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n```js\\nconst name = null;\\n// error-next-line\\nconsole.log(name.toUpperCase());\\n// Uncaught TypeError: Cannot read properties of null (reading \'toUpperCase\')\\n```\\n\\n## Additional Plugins\\n\\n### Interactive code editor\\n\\n\uc608\uc81c \ucf54\ub4dc\ub97c \uc791\uc131\ud558\uace0, \uc774\uc5d0 \ub300\ud55c \uc2e4\ud589 \uacb0\uacfc\ub97c \ucca8\ubd80\ud574\uc57c\ud558\ub294 \uacbd\uc6b0, \uae30\uc874\uc5d0\ub294 [CodePen](https://codepen.io/)\uc5d0\uc11c \ucd94\uac00\ub85c \uc791\uc131\ud55c \ubd80\ubd84\uc744 \uc0bd\uc785\ud558\uace0\ub294 \ud588\uc5c8\ub2e4.\\n\ud558\uc9c0\ub9cc, docusaurus\uc5d0\uc11c\ub294 [`@docusaurus/theme-live-codeblock`](https://docusaurus.io/docs/api/themes/@docusaurus/theme-live-codeblock)\uc744 \uc81c\uacf5\ud558\uc5ec \ud574\ub2f9 \ud50c\ub7ec\uadf8\uc778\uc744 \ucd94\uac00\ub85c \uc124\uc815\ud574\uc8fc\uc5c8\ub2e4.\\n\\nnx\ub97c \uc774\uc6a9\ud55c \ubaa8\ub178\ub808\ud3ec \uad6c\uc870\uac00 \uc544\ub2c8\ub77c\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 \ucee4\ub9e8\ub4dc\ub97c \uc2e4\ud589\ud558\uba74 \ub41c\ub2e4...\\n\\n```bash npm2yarn\\nnpm run swizzle @docusaurus/theme-live-codeblock ReactLiveScope --eject\\n```\\n\\n\uadfc\ub370 [swizzle](https://docusaurus.io/docs/swizzling) \uae30\ub2a5\uc740 docusaurus\uc5d0\uc11c custom\uc744 \uc704\ud574 \uc81c\uacf5\ud558\ub294 \uae30\ub2a5\uc774\ub77c \ub0b4\uac00 \uc9c0\uae08 \uad6c\uc131\ud55c \uac83\uacfc \uac19\uc774\\nNX\ub85c \ubaa8\ub178\ub808\ud3ec \uad6c\uc870\ub85c \ub418\uc5b4\uc788\uc5b4\uc11c \ud574\ub2f9 \ucee4\ub9e8\ub4dc\ub85c \uc2e4\ud589 \uc2dc \uc624\ub958\uac00 \ubc1c\uc0dd\ud558\uc5ec docusaurus\uac00 \uc124\uce58\ub41c \ud3f4\ub354 \ud558\uc704\uc5d0\uc11c npx\ub97c \uc774\uc6a9\ud558\uc5ec \ub2e4\uc74c\uacfc \uac19\uc774 \uc2e4\ud589\ud558\uc600\ub2e4.\\n\\n```bash\\nnpx docusaurus swizzle \\"@docusaurus/theme-live-codeblock\\" \\"ReactLiveScope\\" --eject\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uc2e4\ud589\ud558\uba74 \uc660\uc9c0 \ud558\uc9c0 \uc54a\uc73c\uba74 \uc548\ub420 \uc9d3\uc744 \ud558\ub294 \uac83 \uac19\uc740 \uba54\uc2dc\uc9c0\uac00 \ub098\uc624\uace0....\ucfe8\ud558\uac8c \\"YES\\"\ub97c \uc751\ub2f5\ud574\uc8fc\uba74 `ReactLiveScope\\" \ucef4\ud3ec\ub10c\ud2b8\uac00 \ucd94\uac00\ub418\uc5c8\ub2e4\uace0 \uc54c\ub824\uc900\ub2e4.\\n\\n```bash\\n[WARNING] \\"package.json\\" file not found at CWD: \\"/Users/gloria/Documents/mio/gloria-tilog/apps/doc\\".\\n[INFO] This is non-critical, but could lead to undesired behavior downstream. Docusaurus assumes that \\"package.json\\" exists at CWD, because it\'s where the package manager looks up the script at. A common reason is because you have changed directory in the script. Instead of writing `\\"start\\": \\"cd website && docusaurus start\\"`, consider using the `[siteDir]` argument: `\\"start\\": \\"docusaurus start website\\"`.\\n\\n[WARNING]\\nSwizzle action eject is unsafe to perform on ReactLiveScope.\\nIt is more likely to be affected by breaking changes in the future\\nIf you want to swizzle it, use the `--danger` flag, or confirm that you understand the risks.\\n\\n\u2714 Do you really want to swizzle this unsafe internal component? \u203a YES: I know what I am doing!\\n[SUCCESS]\\nEjected ReactLiveScope from @docusaurus/theme-live-codeblock to\\n- \\"/Users/gloria/Documents/mio/gloria-tilog/apps/doc/src/theme/ReactLiveScope/index.js\\"\\n```\\n\\n\ud50c\ub7ec\uadf8\uc778\uc744 \uc124\uce58\ud55c \ud6c4\uc5d0 \ub2e4\uc74c\uacfc \uac19\uc774 \uc124\uc815\uc744 \ucd94\uac00\ud574\uc900\ub2e4.\\n\\n```js title=\\"docusaurus.config.js\\"\\nmodule.exports = {\\n  // ...(SKIP)...\\n  themes: [\'@docusaurus/theme-live-codeblock\'],\\n  // ...(SKIP)...\\n  themeConfig: {\\n    // ...(SKIP)...\\n    liveCodeBlock: {\\n      /**\\n       * The position of the live playground, above or under the editor\\n       * Possible values: \\"top\\" | \\"bottom\\"\\n       */\\n      playgroundPosition: \'bottom\',\\n    },\\n  },\\n};\\n```\\n\\n\uc124\uc815 \ud6c4, \ub2e4\uc74c\uacfc \uac19\uc740 \ucf54\ub4dc\ub97c \uc608\uc2dc\ub85c \uc791\uc131\ud558\uba74 web ide\ub97c \ud1b5\ud558\uc5ec \uac04\ub2e8\ud55c \ub3d9\uc791\uc5d0 \ub300\ud574\uc11c\ub294 \ucf54\ub4dc\ub97c \uc218\uc815 \ubc0f \uc2e4\ud589 \uacb0\uacfc\ub97c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n(\ucc38\uace0\ub85c, ReactLiveScope\uc5d0 \uc608\uc81c\uc5d0\uc11c \uc0ac\uc6a9\ud558\uace0\uc790 \ud558\ub294 \ucef4\ud3ec\ub10c\ud2b8\ub97c \ucd94\uac00\ud558\uace0\uc790 \ud55c\ub2e4\uba74 https://docusaurus.io/docs/markdown-features/code-blocks#imports \ub97c \ucc38\uace0\ud558\uba74 \ub41c\ub2e4.)\\n\\n````md\\n```jsx live\\nfunction Clock(props) {\\n  const [date, setDate] = useState(new Date());\\n  useEffect(() => {\\n    const timerID = setInterval(() => tick(), 1000);\\n\\n    return function cleanup() {\\n      clearInterval(timerID);\\n    };\\n  });\\n\\n  function tick() {\\n    setDate(new Date());\\n  }\\n\\n  return (\\n    <div>\\n      <h2>It is {date.toLocaleTimeString()}.</h2>\\n      <button onClick={() => alert(\'hello\')}>Click Me</button>\\n    </div>\\n  );\\n}\\n```\\n````\\n\\n\uc704\uc758 \ucf54\ub4dc\uc5d0 \ub300\ud558\uc5ec \uc791\uc131\ub41c \ube14\ub85c\uadf8\uc5d0\uc11c\ub294 \ub2e4\uc74c\uacfc \uac19\uc774 live \uae30\ub2a5\uc774 \ud3ec\ud568\ub418\uc5b4 \ubcf4\uc5ec\uc9c4\ub2e4.\\n\\n```jsx live\\nfunction Clock(props) {\\n  const [date, setDate] = useState(new Date());\\n  useEffect(() => {\\n    const timerID = setInterval(() => tick(), 1000);\\n\\n    return function cleanup() {\\n      clearInterval(timerID);\\n    };\\n  });\\n\\n  function tick() {\\n    setDate(new Date());\\n  }\\n\\n  return (\\n    <div>\\n      <h2>It is {date.toLocaleTimeString()}.</h2>\\n      <button onClick={() => alert(\'hello\')}>Click Me</button>\\n    </div>\\n  );\\n}\\n```\\n\\n### Docusaurus npm2yarn remark plugin\\n\\n\ud328\ud0a4\uc9c0 \uc124\uce58\uc5d0 \ub300\ud55c \ub0b4\uc6a9\uc744 \uc791\uc131\ud560 \ub54c\uc5d0 yarn\uc640 npm \ub4f1...\uac01\uac01 \ub2e4 \uc791\uc131\ud574\uc8fc\uc9c0 \uc54a\uc544\ub3c4 \ub418\ub3c4\ub85d [@docusaurus/remark-plugin-npm2yarn](https://www.npmjs.com/package/@docusaurus/remark-plugin-npm2yarn) \ud50c\ub7ec\uadf8\uc778\uc744 \ucd94\uac00\ud574\uc8fc\uc5c8\ub2e4.\\n\\n```bash npm2yarn\\nnpm install @docusaurus/remark-plugin-npm2yarn\\n```\\n\\n\ud50c\ub7ec\uadf8\uc778\uc744 \uc124\uce58\ud55c \ud6c4\uc5d0 \ub2e4\uc74c\uacfc \uac19\uc774 \uc124\uc815\uc744 \ucd94\uac00\ud574\uc900\ub2e4.\\n\\n```js title=\\"docusaurus.config.js\\"\\nmodule.exports = {\\n  // ...(SKIP)...\\n  presets: [\\n    [\\n      \'@docusaurus/preset-classic\',\\n      {\\n        docs: {\\n          remarkPlugins: [\\n            [require(\'@docusaurus/remark-plugin-npm2yarn\'), { sync: true }],\\n          ],\\n        },\\n        blog: {\\n          remarkPlugins: [\\n            [\\n              require(\'@docusaurus/remark-plugin-npm2yarn\'),\\n              { converters: [\'pnpm\'] },\\n            ],\\n          ],\\n          // ...(SKIP)...\\n        },\\n      },\\n    ],\\n  ],\\n};\\n```\\n\\n\uadf8\ub9ac\uace0 \ub2e4\uc74c\uacfc \uac19\uc774 `npm2yarn` \ud0a4\uc6cc\ub4dc\ub97c \ucd94\uac00\ud558\uc5ec \uc791\uc131\ud574\uc8fc\uba74 \ub41c\ub2e4.\\n\\n````md\\n```bash npm2yarn\\nnpm install @docusaurus/remark-plugin-npm2yarn\\n```\\n````"},{"id":"/2023/05/16/trouble-shootings/2023/ios-web-inspector","metadata":{"permalink":"/gloria-tilog/2023/05/16/trouble-shootings/2023/ios-web-inspector","source":"@site/blog/trouble-shootings/2023/2023-05-16-ios-web-inspector.mdx","title":"Can not display inspector via iOS Simulator","description":"iOS \ud658\uacbd\uc5d0\uc11c Native App\uc5d0\uc11c \ub3d9\uc791\ud558\ub294 WebView\uac00 web inspector\uc5d0\uc11c \ubcf4\uc774\uc9c0 \uc54a\ub294 \ud604\uc0c1","date":"2023-05-16T18:38:00.000Z","formattedDate":"May 16, 2023","tags":[{"label":"trouble-shooting","permalink":"/gloria-tilog/tags/trouble-shooting"},{"label":"ios","permalink":"/gloria-tilog/tags/ios"},{"label":"web-inspector","permalink":"/gloria-tilog/tags/web-inspector"}],"readingTime":1.35,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"Can not display inspector via iOS Simulator","tags":["trouble-shooting","ios","web-inspector"],"date":"2023-05-16T18:38"},"prevItem":{"title":"[docusaurus] Configure Code Block","permalink":"/gloria-tilog/2023/05/19/side-project/docusaurus/docusaurus-code-block"},"nextItem":{"title":"How to delete or check iOS simulator","permalink":"/gloria-tilog/2023/05/16/etc/native/ios-simulator"}},"content":"iOS \ud658\uacbd\uc5d0\uc11c Native App\uc5d0\uc11c \ub3d9\uc791\ud558\ub294 WebView\uac00 web inspector\uc5d0\uc11c \ubcf4\uc774\uc9c0 \uc54a\ub294 \ud604\uc0c1\\n\\n\x3c!--truncate--\x3e\\n\\n## What happened ...\ud83d\ude31\\n\\niOS \uc2dc\ubbac\ub808\uc774\ud130\ub97c \uc774\uc6a9\ud558\uc5ec Native App\uc5d0\uc11c \ub3d9\uc791\ud558\ub294 Webview\ub97c Safari\uc5d0\uc11c web inspector\ub97c \uc774\uc6a9\ud558\uc5ec \ud655\uc778\uc744 \ud558\ub824\uace0 \ud558\ub294\ub370,\\n\ud574\ub2f9 web \uc8fc\uc18c\uac00 \ub3c4\ud1b5 \ud655\uc778\uc774 \ub418\uc9c0 \uc54a\uc558\ub2e4...\\n\\n## Why happened ...\ud83e\udd72\\n\\n\ud574\ub2f9 \ubb38\uc81c\ub97c \ud574\uacb0\ud558\uae30 \uc704\ud574 \uac80\uc0c9\ud558\ub2e4\uac00 \ubc1c\uacac\ud55c \ub2e4\uc74c\uc758 \uae00\uc744 \ud1b5\ud574 \uc6d0\uc778\uc744 \uc54c\uac8c \ub418\uc5c8\ub2e4.\\n\\n- https://stackoverflow.com/questions/75975485/safari-web-inspector-stopped-working-on-latest-ios-for-webkit-apps\\n\\niOS 16.4 \ubc84\uc804 \uc774\uc0c1\uc5d0\uc11c [`isInspectable`](https://developer.apple.com/documentation/webkit/wkwebview/4111163-isinspectable) \uc18d\uc131\uc774 \ucd94\uac00\ub418\uc5c8\uc74c.\\n\ud574\ub2f9 \uc18d\uc131\uc758 \uae30\ubcf8 \uac12\uc740 `false` \uc774\ubbc0\ub85c **WKWebView**\ub97c \uc774\uc6a9\ud558\uc5ec native App\uc5d0\uc11c \uc5f4\ub9b0 webview\ub97c safari\ub97c \ud1b5\ud558\uc5ec \ub514\ubc84\uae45\ud558\uae30 \uc704\ud574\uc11c\ub294 \ud574\ub2f9 \uc18d\uc131\uc744 `true`\ub85c \uc124\uc815\ud574\uc8fc\uc5b4\uc57c\ud55c\ub2e4.\\n\\n\ub0b4 \uacbd\uc6b0\ub294 native app\uc744 \uc218\uc815\ud560 \uc218 \uc5c6\uc5b4\uc11c, iOS \uc2dc\ubbac\ub808\uc774\ud130 \ubc84\uc804\uc744 16.3 \uc774\ud558\ub85c \uc124\uce58\ud574\uc11c \ubb38\uc81c\ub97c \ud574\uacb0\ud558\uc600\ub2e4.\\n\ub300\uc2e0, native\uc5d0\uc11c \uc218\uc815\ud574\uc8fc\uae30 \uc804\uc5d0\ub294 \ucd5c\uc2e0\uc758 iOS\uc5d0\uc11c \ud14c\uc2a4\ud2b8\uac00 \ud544\uc694\ud560 \ub54c....\ub09c\uac10\ud558\uaca0\uc9c0\ub9cc...."},{"id":"/2023/05/16/etc/native/ios-simulator","metadata":{"permalink":"/gloria-tilog/2023/05/16/etc/native/ios-simulator","source":"@site/blog/etc/native/2023-05-16-ios-simulator.mdx","title":"How to delete or check iOS simulator","description":"iOS Simulator \uc0ac\uc6a9 \ud301 \uc815\ub9ac","date":"2023-05-16T16:13:00.000Z","formattedDate":"May 16, 2023","tags":[{"label":"ios","permalink":"/gloria-tilog/tags/ios"},{"label":"simulator","permalink":"/gloria-tilog/tags/simulator"}],"readingTime":0.735,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"How to delete or check iOS simulator","tags":["ios","simulator"],"date":"2023-05-16T16:13"},"prevItem":{"title":"Can not display inspector via iOS Simulator","permalink":"/gloria-tilog/2023/05/16/trouble-shootings/2023/ios-web-inspector"},"nextItem":{"title":"[docusaurus] Configure docusaurus","permalink":"/gloria-tilog/2023/05/14/side-project/docusaurus/docusaurus"}},"content":"iOS Simulator \uc0ac\uc6a9 \ud301 \uc815\ub9ac\\n\\n\x3c!--truncate--\x3e\\n\\n## Check the installed list\\n\\n```bash\\nxcrun simctl list devices\\n```\\n\\n## Delete the installed simulator\\n\\n### \uc720\ud6a8\ud558\uc9c0 \uc54a\uc740 \uc2dc\ubbac\ub808\uc774\ud130 \ub514\ubc14\uc774\uc2a4 \uc0ad\uc81c\ud558\uae30\\n\\n```bash\\nxcrun simctl delete unavailable\\n```\\n\\n### \ud2b9\uc815 \uc2dc\ubbac\ub808\uc774\ud130 \ub514\ubc14\uc774\uc2a4 \uc0ad\uc81c\ud558\uae30\\n\\n```bash\\nxcrun simctl delete \ub514\ubc14\uc774\uc2a4\ucf54\ub4dc\\n```\\n\\n\uc608\uc2dc)\\n\\n```bash\\n# check the installed list\\n\u276f xcrun simctl list devices\\n== Devices ==\\n-- iOS 16.4 --\\n    iPhone 14 Pro (3DF66D25-6A7A-4AE9-BA57-968BE69B7B05) (Shutdown)\\n    iPhone 14 Pro Max (45554A3F-0F2C-427C-9DE7-12F8EFF2C0A6) (Shutdown)\\n    iPad Air (5th generation) (60EB117D-7F5B-4A52-8E81-C06B01857370) (Shutdown)\\n\\n# delete\\n\u276f xcrun simctl delete 60EB117D-7F5B-4A52-8E81-C06B01857370\\n\\n# check again\\n\u276f xcrun simctl list devices\\n== Devices ==\\n-- iOS 16.4 --\\n    iPhone 14 Pro (3DF66D25-6A7A-4AE9-BA57-968BE69B7B05) (Shutdown)\\n    iPhone 14 Pro Max (45554A3F-0F2C-427C-9DE7-12F8EFF2C0A6) (Shutdown)\\n```"},{"id":"/2023/05/14/side-project/docusaurus/docusaurus","metadata":{"permalink":"/gloria-tilog/2023/05/14/side-project/docusaurus/docusaurus","source":"@site/blog/side-project/docusaurus/2023-05-14-docusaurus.mdx","title":"[docusaurus] Configure docusaurus","description":"\uc774\ubc88\uc5d0\ub294 \ub0b4 \ube14\ub85c\uadf8\ub97c \uc704\ud574 docusaurus\uc758 \uc124\uc815\uc744 \ucee4\uc2a4\ud140\ud558\uae30 \uc704\ud55c \uacfc\uc815\uc774\ub2e4.","date":"2023-05-14T18:38:00.000Z","formattedDate":"May 14, 2023","tags":[{"label":"devlog","permalink":"/gloria-tilog/tags/devlog"},{"label":"docusaurus","permalink":"/gloria-tilog/tags/docusaurus"}],"readingTime":4.13,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[docusaurus] Configure docusaurus","tags":["devlog","docusaurus"],"date":"2023-05-14T18:38"},"prevItem":{"title":"How to delete or check iOS simulator","permalink":"/gloria-tilog/2023/05/16/etc/native/ios-simulator"},"nextItem":{"title":"[docusaurus] Configure lint","permalink":"/gloria-tilog/2023/05/01/side-project/docusaurus/lint"}},"content":"\uc774\ubc88\uc5d0\ub294 \ub0b4 \ube14\ub85c\uadf8\ub97c \uc704\ud574 [docusaurus](https://docusaurus.io/ko/)\uc758 \uc124\uc815\uc744 \ucee4\uc2a4\ud140\ud558\uae30 \uc704\ud55c \uacfc\uc815\uc774\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n> **docusaurus**\ub294 \ud398\uc774\uc2a4\ubd81 \uc624\ud508\uc18c\uc2a4 \ucee4\ubba4\ub2c8\ud2f0\uc5d0\uc11c \uad00\ub9ac\ud558\ub294 \ubb38\uc11c \uc6f9\uc0ac\uc774\ud2b8 \uc0dd\uc131 \ub3c4\uad6c\uc774\ub2e4.\\n\\n## docusaurus \uae30\ubcf8\uc801\uc778 \ud3f4\ub354 \uad6c\uc870\\n\\n\uba3c\uc800 \uae30\ubcf8\uc801\uc778 \ud3f4\ub354 \uad6c\uc870 \ubc0f \uac01 \ud3f4\ub354\uc758 \uc131\uaca9\uc740 \ub2e4\uc74c\uacfc \uac19\ub2e4.\\n\\n```bash\\napps/doc/\\n\u251c\u2500\u2500 babel.config.js\\n\u251c\u2500\u2500 blog\\n\u251c\u2500\u2500 docs\\n\u251c\u2500\u2500 docusaurus.config.js\\n\u251c\u2500\u2500 project.json\\n\u251c\u2500\u2500 sidebars.js\\n\u251c\u2500\u2500 src\\n\u251c\u2500\u2500 static\\n\u2514\u2500\u2500 tsconfig.json\\n```\\n\\n- blog\\n  - \ub9c8\ud06c\ub2e4\uc6b4\uc73c\ub85c \uc791\uc131\ub41c \ube14\ub85c\uadf8 \ud615\ud0dc\uc758 \uae00\uc774 \uc704\uce58\ud558\ub294 \uacf3\uc774\ub2e4\\n- docs\\n  - \ub9c8\ud06c\ub2e4\uc6b4\uc73c\ub85c \uc791\uc131\ub41c \uac00\uc774\ub4dc \ubb38\uc11c \ud615\ud0dc\uc758 \uae00\uc774 \uc704\uce58\ud558\ub294 \uacf3\uc774\ub2e4.\\n- src\\n  - \ud398\uc774\uc9c0 \ub610\ub294 \ub9ac\uc561\ud2b8 \ucef4\ud3ec\ub10c\ud2b8\ub85c \uc791\uc131\ub41c \ubd80\ubd84\uc744 \ucee4\uc2a4\ud130\ub9c8\uc774\uc9d5\ud560 \uc218 \uc788\ub294 \uc18c\uc2a4 \ud30c\uc77c\uc774 \uc704\uce58\ud55c\ub2e4.\\n- static\\n  - \uc815\uc801\uc778 \ud30c\uc77c\uc774 \uc704\uce58\ud55c \uacf3\uc774\ub2e4.\\n\\n## Basic Configuration\\n\\nhttps://docusaurus.io/docs/configuration \uc744 \ucc38\uace0\ud558\uc5ec \ub2e4\uc74c\uacfc \uac19\uc774 `docusaurus.config.js` \ud30c\uc77c\uc744 \ub2e4\uc74c\uacfc \uac19\uc774 \uc218\uc815\ud558\uc600\ub2e4.\\n\\n```js\\n// @ts-check\\n// Note: type annotations allow type checking and IDEs autocompletion\\n\\nconst lightCodeTheme = require(\'prism-react-renderer/themes/github\');\\nconst darkCodeTheme = require(\'prism-react-renderer/themes/dracula\');\\n\\n// highlight-start\\nconst blogTitle = \'L.E.T\';\\nconst myGitHubUrl = \'https://github.com/gloriajun\';\\n// highlight-end\\n\\n/** @type {import(\'@docusaurus/types\').Config} */\\nconst config = {\\n  // highlight-start\\n  title: blogTitle,\\n  tagline: \'Learn! Experience! Think!\',\\n  url: \'https://gloriajun.github.io\',\\n  baseUrl: \'/gloria-tilog/\',\\n  // highlight-end\\n  onBrokenLinks: \'throw\',\\n  onBrokenMarkdownLinks: \'warn\',\\n  favicon: \'img/favicon.ico\',\\n  // highlight-start\\n  organizationName: \'gloriajun\', // Usually your GitHub org/user name.\\n  projectName: \'gloria-tilog\', // Usually your repo name.\\n  // highlight-end\\n\\n  presets: [\\n    [\\n      \'classic\',\\n      /** @type {import(\'@docusaurus/preset-classic\').Options} */\\n      ({\\n        // highlight-next-line\\n        docs: false,\\n        blog: {\\n          routeBasePath: \'/\',\\n          showReadingTime: true,\\n        },\\n        theme: {\\n          customCss: require.resolve(\'./src/css/custom.css\'),\\n        },\\n      }),\\n    ],\\n  ],\\n\\n  themeConfig:\\n    /** @type {import(\'@docusaurus/preset-classic\').ThemeConfig} */\\n    ({\\n      navbar: {\\n        // highlight-next-line\\n        title: blogTitle,\\n        logo: {\\n          alt: \'My Site Logo\',\\n          src: \'img/docusaurus.png\',\\n        },\\n        items: [\\n          {\\n            // highlight-next-line\\n            href: myGitHubUrl,\\n            label: \'GitHub\',\\n            position: \'right\',\\n          },\\n        ],\\n      },\\n      footer: {\\n        style: \'dark\',\\n        copyright: `Copyright \xa9 ${new Date().getFullYear()} My Project, Inc. Built with Docusaurus.`,\\n      },\\n      prism: {\\n        theme: lightCodeTheme,\\n        darkTheme: darkCodeTheme,\\n      },\\n    }),\\n};\\n\\nmodule.exports = config;\\n```\\n\\n\uadf8\ub9ac\uace0 \uc791\uc131\ud55c \ube14\ub85c\uadf8\ub97c \ubc14\ub85c \ub178\ucd9c\ud558\uae30 \uc704\ud574 `src/pages/index.tsx`\uac00 \uc704\uce58\ud55c **src/pages** \ud3f4\ub354\ub97c \uc77c\ub2e8 \uc81c\uac70\ud558\uc600\ub2e4.\\n\uc774 \ubd80\ubd84\uc740 \ucc28\ud6c4\uc5d0 \uc5b4\ub5a0\ud55c \ud615\ud0dc\ub85c \uad6c\uc131\ud560 \uc9c0 \uace0\ubbfc\uc744 \ud558\uc5ec \uc801\uc6a9\ud574\ubcf4\uc544\uc57c\ud560 \uac83 \uac19\ub2e4.\\n(\uc660\uc9c0 \uc9c0\uae08\ucc98\ub7fc \ucd5c\uadfc blog \ud3ec\uc2a4\ud2b8\ub4e4\uc774 \ubcf4\uc5ec\uc9c0\ub294 \ud615\ud0dc\ub97c \uac1c\uc778\uc801\uc73c\ub85c \uc120\ud638\ud558\uace0 \uc788\uc9c0 \uc54a\uae30\ub3c4 \ud574\uc11c....)\\n\\n## CI/CD\\n\\n- https://docusaurus.io/docs/deployment#deploying-to-github-pages\\n\\n\ud574\ub2f9 Repo\uc758 GitHub Page\ub85c \ubc30\ud3ec\ud558\uae30 \uc704\ud574\uc11c \ub2e4\uc74c\uacfc \uac19\uc740 \uc124\uc815\uc774 `docusaurus.config.js`\uc5d0 \uc815\uc758\ub418\uc5b4\uc788\uc5b4\uc57c\ud55c\ub2e4.\\n\\n```javascript\\nconst config = {\\n  // ...(SKIP)....\\n  organizationName: \'gloriajun\', // Usually your GitHub org/user name.\\n  projectName: \'gloria-tilog\', // Usually your repo name\\n  // ...(SKIP)....\\n```\\n\\n\uadf8\ub9ac\uace0 Git Repository\uc758 [Settings > Pages](https://github.com/gloriaJun/gloria-tilog/settings/pages)\uc5d0\uc11c `Build and deployment` \ubd80\ubd84\uc744 \ub2e4\uc74c\uacfc \uac19\uc774 \uc124\uc815\ud574\uc900\ub2e4.\\n\\n- Source : Deploy from a branch\\n- Branch : gh-pages\\n\\n\ub2e4\uc74c\uc73c\ub85c\ub294 Github Action\uc744 \uc774\uc6a9\ud558\uc5ec \ubc30\ud3ec \uc2a4\ud06c\ub9bd\ud2b8\ub97c \uc791\uc131\ud55c\ub2e4.\\n\\n```yaml\\nname: deploy-github-actions\\non:\\n  push:\\n    branches: [main]\\n    paths-ignore:\\n      - \'.husky/**\'\\n      - \'.vscode/**\'\\n\\n# Allow one concurrent deployment\\nconcurrency:\\n  group: ${{ github.workflow }}-${{ github.ref }}\\n  cancel-in-progress: true\\n\\njobs:\\n  build:\\n    runs-on: ubuntu-latest\\n    steps:\\n      - name: Checkout source code\\n        uses: actions/checkout@v3\\n\\n      - name: Setup node\\n        uses: actions/setup-node@v3\\n        with:\\n          node-version-file: \'.nvmrc\'\\n\\n      - name: Cache yarn dependencies\\n        uses: actions/cache@v1\\n        id: yarn-cache\\n        with:\\n          path: node_modules\\n          key: ${{ runner.os }}-yarn-${{ hashFiles(\'**/yarn.lock\') }}\\n          restore-keys: |\\n            ${{ runner.os }}-yarn-\\n\\n      - name: Install Dependencies\\n        run: yarn install\\n\\n      - name: Lint\\n        run: yarn run lint:all\\n\\n      - name: Build Website\\n        run: yarn run build doc\\n\\n      # Popular action to deploy to GitHub Pages:\\n      # Docs: https://github.com/peaceiris/actions-gh-pages#%EF%B8%8F-docusaurus\\n      - name: Deploy to GitHub Pages\\n        uses: peaceiris/actions-gh-pages@v3\\n        with:\\n          github_token: ${{ secrets.GITHUB_TOKEN }}\\n          # Build output to publish to the `gh-pages` branch:\\n          publish_dir: ./build\\n          # The following lines assign commit authorship to the official\\n          # GH-Actions bot for deploys to `gh-pages` branch:\\n          # https://github.com/actions/checkout/issues/13#issuecomment-724415212\\n          # The GH actions bot is used by default if you didn\'t specify the two fields.\\n          # You can swap them out with your own user credentials.\\n          user_name: github-actions[bot]\\n          user_email: 41898282+github-actions[bot]@users.noreply.github.com\\n```"},{"id":"/2023/05/01/side-project/docusaurus/lint","metadata":{"permalink":"/gloria-tilog/2023/05/01/side-project/docusaurus/lint","source":"@site/blog/side-project/docusaurus/2023-05-01-lint.mdx","title":"[docusaurus] Configure lint","description":"\uc774\ubc88\uc5d0\ub294 \ube14\ub85c\uadf8 \ub808\ud3ec\uc5d0 lint\uc640 cspeel \uadf8\ub9ac\uace0 husky \uc124\uc815\uc744 \uc801\uc6a9\ud558\uc600\ub2e4.","date":"2023-05-01T21:03:00.000Z","formattedDate":"May 1, 2023","tags":[{"label":"devlog","permalink":"/gloria-tilog/tags/devlog"},{"label":"nx","permalink":"/gloria-tilog/tags/nx"},{"label":"lint","permalink":"/gloria-tilog/tags/lint"},{"label":"docusaurus","permalink":"/gloria-tilog/tags/docusaurus"}],"readingTime":5.855,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[docusaurus] Configure lint","tags":["devlog","nx","lint","docusaurus"],"date":"2023-05-01T21:03"},"prevItem":{"title":"[docusaurus] Configure docusaurus","permalink":"/gloria-tilog/2023/05/14/side-project/docusaurus/docusaurus"},"nextItem":{"title":"[docusaurus] Create Blog with NX and docusaurus","permalink":"/gloria-tilog/2023/04/30/side-project/docusaurus/init"}},"content":"\uc774\ubc88\uc5d0\ub294 \ube14\ub85c\uadf8 \ub808\ud3ec\uc5d0 lint\uc640 cspeel \uadf8\ub9ac\uace0 husky \uc124\uc815\uc744 \uc801\uc6a9\ud558\uc600\ub2e4.\\n\\n\x3c!--truncate--\x3e\\n\\n## eslint\\n\\n\uae30\ubcf8\uc801\uc73c\ub85c \uc55e\uc5d0\uc11c \uc124\uc815\ud558\uba74\uc11c \uc801\uc6a9\uc774 \ub418\uc5b4\uc788\uc5b4\uc11c, \ud544\uc694\ud55c \ubd80\ubd84\ub9cc \ucd94\uac00\ub85c \ucee4\uc2a4\ud140\ud574\uc8fc\uc5c8\ub2e4.\\n\ucd94\uac00\ub85c \uc124\uc815\ud558\uace0\uc790 \ud558\ub294 \ud50c\ub7ec\uadf8\uc778\ub4e4\uc744 \uc124\uce58\ud55c\ub2e4.\\n\\n```bash\\nyarn add -D eslint-plugin-prettier\\n```\\n\\n\uadf8\ub9ac\uace0 \ub2e4\uc74c\uacfc \uac19\uc774 \uc124\uc815 \ud30c\uc77c\uc5d0 parserOptions.project\uc640 \uc704\uc5d0\uc11c \uc124\uce58\ud55c \ud50c\ub7ec\uadf8\uc778\ub4e4\uc5d0 \ub300\ud55c \uc124\uc815\uc744 \ucd94\uac00\ud574\uc8fc\uc5c8\ub2e4.\\n\\n```javascript\\nmodule.exports = {\\n  root: true,\\n  ignorePatterns: [\'**/*\'],\\n  plugins: [\'@nx\'],\\n  extends: [\'plugin:prettier/recommended\'],\\n  rules: {\\n    \'prettier/prettier\': [\'error\'],\\n  },\\n  overrides: [\\n    {\\n      files: [\'*.ts\', \'*.tsx\', \'*.js\', \'*.jsx\'],\\n      rules: {\\n        \'@nx/enforce-module-boundaries\': [\\n          \'error\',\\n          {\\n            enforceBuildableLibDependency: true,\\n            allow: [],\\n            depConstraints: [\\n              {\\n                sourceTag: \'*\',\\n                onlyDependOnLibsWithTags: [\'*\'],\\n              },\\n            ],\\n          },\\n        ],\\n      },\\n    },\\n    {\\n      files: [\'*.ts\', \'*.tsx\'],\\n      extends: [\\n        \'plugin:@typescript-eslint/recommended\',\\n        \'plugin:@typescript-eslint/recommended-requiring-type-checking\',\\n        \'plugin:@nx/typescript\',\\n      ],\\n      parserOptions: {\\n        project: [\\n          \'./tsconfig.base.json\',\\n          \'./lib/*/tsconfig.json\',\\n          \'./apps/doc/tsconfig.json\',\\n        ],\\n      },\\n      rules: {},\\n    },\\n    {\\n      files: [\'*.js\', \'*.jsx\'],\\n      extends: [\'plugin:@nx/javascript\'],\\n      rules: {},\\n    },\\n    {\\n      files: [\'*.spec.ts\', \'*.spec.tsx\', \'*.spec.js\', \'*.spec.jsx\'],\\n      env: {\\n        jest: true,\\n      },\\n      rules: {},\\n    },\\n  ],\\n};\\n```\\n\\n\uadf8\ub9ac\uace0 `project.json` \ud30c\uc77c\uc758 **target** \uc124\uc815\uc5d0 lint\uc640 type check\ub97c \uc704\ud574\uc11c \ub2e4\uc74c\uacfc \uac19\uc774 \uc124\uc815\uc744 \ucd94\uac00\ud558\uc600\ub2e4.\\n\\n```json\\n\\"targets\\": {\\n   \\"lint\\": {\\n     \\"executor\\": \\"@nx/linter:eslint\\",\\n     \\"outputs\\": [\\"{options.outputFile}\\"],\\n     \\"options\\": {\\n       \\"lintFilePatterns\\": [\\"apps/doc/**/*.{ts,tsx,js,jsx}\\"]\\n     }\\n   },\\n    \\"type-check\\": {\\n      \\"executor\\": \\"nx:run-commands\\",\\n      \\"options\\": {\\n        \\"commands\\": [\\n          {\\n            \\"command\\": \\"tsc --noEmit -p ./libs/ui/tsconfig.eslint.json\\"\\n          }\\n        ]\\n      }\\n    },\\n ....(SKIP)\\n},\\n```\\n\\nnx\uc5d0\uc11c \uae30\ubcf8\uc73c\ub85c \uc124\uc815\ub418\uc5b4\uc788\ub294 `tsconfig.json` \ud30c\uc77c\uc5d0 \uc815\uc758\ub41c **reference** \uc124\uc815\uc73c\ub85c \uc778\ud574 type check\uac00 \uc758\ub3c4\ub41c\ub370\ub85c \ub3d9\uc791\ud558\uc9c0 \uc54a\uc544\uc11c **tsconfig.eslint.json** \ud30c\uc77c\uc744 \ub2e4\uc74c\uacfc \uac19\uc774 \ucd94\uac00\ud558\uc5ec \uc124\uc815\ud574\uc8fc\uc5c8\ub2e4.\\n\\n```json\\n// tsconfig.eslint.json\\n{\\n  \\"compilerOptions\\": {\\n    \\"jsx\\": \\"react-jsx\\",\\n    \\"allowJs\\": false,\\n    \\"esModuleInterop\\": false,\\n    \\"allowSyntheticDefaultImports\\": true,\\n    \\"strict\\": true,\\n  },\\n  \\"extends\\": \\"../../tsconfig.base.json\\"\\n}\\n\\n// tsconfig.json\\n{\\n  \\"references\\": [\\n    {\\n      \\"path\\": \\"./tsconfig.lib.json\\"\\n    },\\n    {\\n      \\"path\\": \\"./tsconfig.spec.json\\"\\n    }\\n  ],\\n  \\"extends\\": \\"./tsconfig.eslint.json\\"\\n}\\n```\\n\\n\uadf8\ub9ac\uace0 **ui.tsx** \ud30c\uc77c\uc5d0 \ub2e4\uc74c\uacfc \uac19\uc774 \uc77c\ubd80\ub7ec \ud0c0\uc785 \uc5d0\ub7ec\ub97c \uc720\ubc1c\uc2dc\ucf30\ub2e4.\\n\\n```javascript\\nconst a = 5;\\na = \'ssss\';\\n```\\n\\n`package.json`\uc5d0 \ucd94\uac00\ud55c \ub9b0\ud2b8 \uccb4\ud06c \uba85\ub839\uc5b4\ub97c \uc2a4\ud06c\ub9bd\ud2b8\uc5d0 \uc815\uc758\ud574\uc8fc\uc5c8\ub2e4.\\n\\n```json\\n\\"type-check\\": \\"nx type-check\\",\\n\\"type-check:many\\": \\"nx run-many --target=type-check\\",\\n\\"lint\\": \\"nx lint\\",\\n\\"lint:many\\": \\"nx run-many --target=lint\\",\\n\\"lint:all\\": \\"npm-run-all type-check:many lint:many\\",\\n```\\n\\n\ucd94\uac00\ud55c \uba85\ub839\uc5b4\ub97c \uc218\ud589\ud558\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 \ud0c0\uc785\uccb4\ud06c\uc640 \ub9b0\ud2b8\uac00 \ub3d9\uc791\ud558\ub294 \uac83\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n```bash\\n\u276f yarn run type-check ui\\n> nx run ui:type-check\\n\\nlibs/ui/src/lib/ui.tsx(16,5): error TS2588: Cannot assign to \'a\' because it is a constant.\\nWarning: run-commands command \\"tsc --noEmit -p ./libs/ui/tsconfig.eslint.json\\" exited with non-zero status code\\n\\n \u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\u2014\\n\\n >  NX   Ran target type-check for project ui (1s)\\n\\n    \u2716    1/1 failed\\n    \u2714    0/1 succeeded [0 read from cache]\\n\\n```\\n\\n## cspell\\n\\n\ucf54\ub4dc \uc791\uc131 \uc911\uc5d0 \uc624\ud0c0\ub97c \uc785\ub825\ud558\uac8c \ub418\ub294 \uacbd\uc6b0\ub97c \uccb4\ud06c\ud558\uae30 \uc704\ud574 [`cspell`](https://cspell.org/docs/getting-started/)\uc744 \uc124\uc815\ud558\uc600\ub2e4.\\n\\n```bash\\nyarn add -D cspell\\n```\\n\\nignore\ud560 \ub2e8\uc5b4\ub4e4\uc744 \uc815\uc758\ud558\uae30\uc704\ud55c \uc124\uc815\ud30c\uc77c\uc744 \ucd94\uac00\ud55c\ub2e4.\\n\\n```yaml\\n// cspell.config.yaml\\n---\\n$schema: https://raw.githubusercontent.com/streetsidesoftware/cspell/main/cspell.schema.json\\nversion: \'0.2\'\\n\\nuseGitignore: true\\n\\nlanguage: en,eo,typescript,javqscript\\n\\nignoreWords:\\n  # styled-component\\n  - clsx\\n```\\n\\npackage.json\uc5d0 \ub2e4\uc74c\uacfc \uac19\uc774 \uc2a4\ud06c\ub9bd\ud2b8\ub97c \uc815\uc758\ud55c\ub2e4.\\n\\n```json\\n\\"cspell\\": \\"cspell --config cspell.config.yaml \\\\\\"**/*.{ts,js,tsx,jsx}\\\\\\" --no-progress --show-suggestions\\",\\n```\\n\\n## commitlint\\n\\n\ucee4\ubc0b \uba54\uc2dc\uc9c0 \uc815\uc758 \uc2dc\uc758 \uae30\ubcf8\uc801\uc778 \uaddc\uce59 \uccb4\ud06c\ub97c \uc704\ud55c \ub9b0\ud2b8 \uc124\uc815\uc774\ub2e4.\\n\\n```bash\\nyarn add -D commitlint @commitlint/config-conventional\\n```\\n\\ncommit lint \uc124\uc815 \ud30c\uc77c\uc744 \ucd94\uac00\ud574\uc900\ub2e4.\\n\\n```javascript\\n// .commitlintrc.js\\nmodule.exports = {\\n  extends: [\'@commitlint/config-conventional\'],\\n  rules: {\\n    \'type-enum\': [\\n      2,\\n      \'always\',\\n      [\\n        \'build\',\\n        \'ci\',\\n        \'chore\',\\n        \'docs\',\\n        \'feat\',\\n        \'fix\',\\n        \'perf\',\\n        \'refactor\',\\n        \'revert\',\\n        \'style\',\\n        \'test\',\\n        \'post\',\\n      ],\\n    ],\\n    \'type-case\': [2, \'always\', \'lowerCase\'],\\n    \'type-empty\': [2, \'never\'],\\n    \'subject-empty\': [2, \'never\'],\\n    \'header-max-length\': [2, \'always\', 100],\\n  },\\n};\\n```\\n\\n## lint-staged & husky\\n\\ngit commit\uacfc push\ub97c \ud560 \ub54c\uc5d0 husky + lint-staged\ub97c \uc774\uc6a9\ud558\uc5ec git hook\uc744 \uc124\uc815\ud55c\ub2e4.\\n\\n\ub2e4\uc74c\uacfc \uac19\uc774 \ud50c\ub7ec\uadf8\uc778\uc744 \uc124\uce58\ud558\uace0..\\n\\n```bash\\nnpx husky-init && yarn\\nyarn add -D lint-staged\\n```\\n\\n\ub2e4\uc74c\uacfc \uac19\uc774 package script\uc5d0 \ucd94\uac00\ub97c \ud574\uc900\ub2e4.\\n\\n```json\\n\\"prepare\\": \\"husky install\\",\\n```\\n\\n\uadf8\ub9ac\uace0 husky\ub97c \uc124\uce58\ud574\uc900\ub2e4.\\n\\n```bash\\nyarn install\\n```\\n\\nlint-staged\uc5d0\uc11c \uc218\ud589\ud558\uace0\uc790 \ud558\ub294 \ubd80\ubd84\ub4e4\uc744 `.lintstagedrc.js` \ud30c\uc77c\uc744 \uc0dd\uc131\ud558\uc5ec \uc815\uc758\ud574\uc900\ub2e4.\\n\\n```javascript\\nmodule.exports = {\\n  \'*.{js,jsx,ts,tsx,json,md,mdx}\': [\'prettier --write\', \'git add\'],\\n  \'*.{js,jsx,ts,tsx}\': [\\n    () => \'yarn run lint:all\',\\n    \'yarn run cspell\',\\n    \'git add\',\\n  ],\\n};\\n```\\n\\n\uadf8\ub7ec\uace0 \ub098\uc11c \ub9c8\uc9c0\ub9c9\uc73c\ub85c \ub2e4\uc74c\uacfc \uac19\uc774 husky\uc5d0 `pre-commit` \ub2e8\uacc4\uc5d0\uc11c \uc815\uc758\ud55c lint-staged\uac00 \ub3d9\uc791\ud558\ub3c4\ub85d \uc124\uc815\ud574\uc8fc\uc5c8\ub2e4.\\n\\n```bash\\nnpx husky add .husky/pre-commit \\"yarn run lint-staged\\"\\n```\\n\\n\uadf8\ub9ac\uace0 git commit\uc744 \ud574\ubcf4\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 \ud655\uc778\ud574\ubcfc \uc218 \uc788\ub2e4.\\n\\n```bash\\n\u26a0 Some of your tasks use `git add` command. Please remove it from the config since all modifications made by tasks will be automatically added to the git commit index.\\n\\n[STARTED] Preparing lint-staged...\\n[SUCCESS] Preparing lint-staged...\\n[STARTED] Running tasks for staged files...\\n[STARTED] .lintstagedrc.js \u2014 5 files\\n[STARTED] *.{js,jsx,ts,tsx,json,md,mdx} \u2014 4 files\\n[STARTED] *.{js,jsx,ts,tsx} \u2014 2 files\\n[STARTED] prettier --write\\n[STARTED] yarn run lint:all\\n[SUCCESS] prettier --write\\n[STARTED] git add\\n[SUCCESS] git add\\n[SUCCESS] *.{js,jsx,ts,tsx,json,md,mdx} \u2014 4 files\\n[SUCCESS] yarn run lint:all\\n[STARTED] yarn run cspell\\n[SUCCESS] yarn run cspell\\n[STARTED] git add\\n[SUCCESS] git add\\n[SUCCESS] *.{js,jsx,ts,tsx} \u2014 2 files\\n[SUCCESS] .lintstagedrc.js \u2014 5 files\\n[SUCCESS] Running tasks for staged files...\\n[STARTED] Applying modifications from tasks...\\n[SUCCESS] Applying modifications from tasks...\\n[STARTED] Cleaning up temporary files...\\n[SUCCESS] Cleaning up temporary files...\\n[chore/lint 540987f] chore: configure lint-staged\\n 5 files changed, 327 insertions(+), 36 deletions(-)\\n rewrite .lintstagedrc.js (62%)\\n```\\n\\n\uc774\uc81c \ub2e4\uc74c\uc5d0\ub294 docusaurus \uc124\uc815\uc744 \ud574\ubd10\uc57c\uaca0\ub2e4.\\n\\n## References\\n\\n- [Using ESLint in Nx Workspaces](https://nx.dev/recipes/other/eslint)\\n- [lint-staged + husky \u3067\u30b3\u30df\u30c3\u30c8\u3059\u308b\u30d5\u30a1\u30a4\u30eb\u3060\u3051 cspell \u3092\u8d70\u3089\u305b\u308b](https://zenn.dev/luvmini511/articles/ade1f0e4b64770)\\n- [Linting with Type Information](https://typescript-eslint.io/linting/typed-linting/)\\n- [4 Simple Steps to Streamline Your Development: Creating a Monorepo Setup with Nx & Yarn Workspaces.](https://karthickragavendran.medium.com/streamline-your-development-with-nx-and-yarn-workspaces-building-a-monorepo-setup-with-nestjs-and-e3d0d560decf)"},{"id":"/2023/04/30/side-project/docusaurus/init","metadata":{"permalink":"/gloria-tilog/2023/04/30/side-project/docusaurus/init","source":"@site/blog/side-project/docusaurus/2023-04-30-init.mdx","title":"[docusaurus] Create Blog with NX and docusaurus","description":"docusaurus\ub97c \uc774\uc6a9\ud55c \uac1c\uc778 \uac1c\ubc1c \ube14\ub85c\uadf8 \ub9cc\ub4e4\uae30 Step 1","date":"2023-04-30T18:53:00.000Z","formattedDate":"April 30, 2023","tags":[{"label":"devlog","permalink":"/gloria-tilog/tags/devlog"},{"label":"nx","permalink":"/gloria-tilog/tags/nx"},{"label":"docusaurus","permalink":"/gloria-tilog/tags/docusaurus"}],"readingTime":5.815,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[docusaurus] Create Blog with NX and docusaurus","tags":["devlog","nx","docusaurus"],"date":"2023-04-30T18:53"},"prevItem":{"title":"[docusaurus] Configure lint","permalink":"/gloria-tilog/2023/05/01/side-project/docusaurus/lint"},"nextItem":{"title":"react component test with mocking child component","permalink":"/gloria-tilog/2023/03/27/frontend/2023/react-test-mocking-child"}},"content":"docusaurus\ub97c \uc774\uc6a9\ud55c \uac1c\uc778 \uac1c\ubc1c \ube14\ub85c\uadf8 \ub9cc\ub4e4\uae30 Step 1\\n\\n\x3c!--truncate--\x3e\\n\\njekyll, gatsby\uc640 \uac19\uc740 \ub3c4\uad6c\ub97c \uc774\uc6a9\ud558\uc5ec github repo\ub97c \uc774\uc6a9\ud558\uc5ec \uac1c\uc778 \uac1c\ubc1c \ube14\ub85c\uadf8\ub97c \ub4ec\uc131 \ub4ec\uc131 \uad00\ub9ac\ub97c \ud574\uc624\ub2e4\uac00 \uac70\uc758 \ubc29\uce58\ub97c \ud588\uc5c8\ub2e4.\\n\uc0ac\uc2e4 \ub108\ubb34 \uadc0\ucc2e\uae30\ub3c4 \ud558\uace0...\ud574\ubcf4\uace0 \uc2f6\uc740 \uac83\ub4e4\uc740 \ub9ce\uc740\ub370, \ud68c\uc0ac\uc77c\uacfc \uac1c\uc778\uc77c \ub4e4\uc5d0 \ubc00\ub824\uc11c...\uc8fc\uc5b4\uc9c4 \uc2dc\uac04 \ub300\ube44 \ub108\ubb34 \uba4b\ub4dc\ub7ec\uc9c0\uac8c \ud574\ubcf4\uace0 \uc2f6\ub2e4\ub294 \uc0dd\uac01\uc5d0...\ubaa9\ud45c\uac00 \ub108\ubb34 \ud06c\ub2e4\ubcf4\ub2c8 \uc190\uc744 \ub193\uc544\ubc84\ub9ac\uac8c \ub41c \uac83\uc740 \uc544\ub2cc\uac00 \uc2f6\uae30\ub3c4 \ud558\ub2e4.\\n\uc774\uc81c \uadf8\ub9cc \uc9c0\ub09c \ub0a0\uc740 \ubc18\uc131\ud558\uace0...\uc791\ub354\ub77c\ub3c4 \ud558\ub098\uc529 \uc774\ub8e8\uc5b4\uac00\ub294 \uc131\ucde8\uac10\uc744 \ub290\ub07c\uba70 \ub098 \uc790\uc2e0\uc758 \uacbd\ud5d8\uc744 \ub0a8\uae30\uace0....\ubbf8\ub798\uc758 \ub0b4\uac00 \ud544\uc694\ud560 \ub54c \ucc38\uace0\ud558\uae30 \uc704\ud55c \uc790\ub8cc\ub97c \ub0a8\uae30\uae30 \uc704\ud55c \uacf5\uac04\uc744 \ub2e4\uc2dc \ub9cc\ub4e4\uc5b4\uc57c\uaca0\ub2e4.\\n(\ub204\uad70\uac00 \uc774 \uae00\uc744 \ubcf4\ub294 \uc0ac\ub78c\uc740 \ub098\uc640 \uac19\uc740 \uacfc\uc624\ub97c \ubc94\ud558\uc9c0 \uc54a\uc558\uc73c\uba74 \ud55c\ub2e4..)\\n\\n\uc0ac\uc124\uc740 \uc5ec\uae30\uae4c\uc9c0 \ud558\uace0...\\n\uc774\ubc88\uc5d0\ub294 [`docusaurus`](https://docusaurus.io/)\ub77c\ub294 \ubb38\uc11c \uc0dd\uc131 \ub3c4\uad6c\ub97c \uc774\uc6a9\ud558\uc5ec MonoRepo \uad6c\uc870\uc5d0 \uc801\uc6a9\ud558\uc5ec \ube14\ub85c\uadf8\ub97c \uad6c\uc131\ud574\ubcf4\uace0\uc790 \ud55c\ub2e4.\\n\ubaa8\ub178\ub808\ud3ec\ub294 [`NX`](https://nx.dev/)\ub77c\ub294 \ub3c4\uad6c\ub97c \uc774\uc6a9\ud558\uc5ec \uad6c\uc131\ud560 \uacc4\ud68d\uc774\ub2e4.\\n\\n\uadf8\ub9ac\uace0 \ud574\ub2f9 \uae00\uc5d0\ub294 \ub098\uc758 \uac1c\ubc1c \ube14\ub85c\uadf8\ub97c \ub9cc\ub4e4\uc5b4\uac00\uae30 \uc704\ud55c \uacfc\uc815 \uc911 \ud504\ub85c\uc81d\ud2b8 \ud658\uacbd\uc744 \uad6c\uc131\ud558\uae30 \uc704\ud55c \uacfc\uc815\uc5d0 \ub300\ud55c \uae30\ub85d\uc744 \uc815\ub9ac\ud558\ub824\uace0 \ud55c\ub2e4.\\n\\n## Create MonoRepo Project with NX\\n\\n**create-nx-workspace**\ub97c \uc774\uc6a9\ud558\uc5ec \ub808\ud30c\uc9c0\ud1a0\ub9ac\ub97c \uc0dd\uc131\ud55c\ub2e4.\\n\uae30\ubcf8\uc801\uc778 \ud3f4\ub354\ub9cc \uad6c\uc131\ub41c \ud504\ub85c\uc81d\ud2b8\ub97c \uc0dd\uc131\ud558\uae30 \uc704\ud574 `--preset=apps`\ub97c \uba85\uc2dc\ud558\uc5ec \uc0dd\uc131\ud558\uc600\ub2e4.\\n\\n```bash\\nnpx create-nx-workspace gloria-tilog --preset=apps\\n```\\n\\n\uadf8\ub7fc \ub2e4\uc74c\uacfc \uac19\uc740 \uad6c\uc870\ub85c \ud504\ub85c\uc81d\ud2b8\uac00 \uc0dd\uc131\ub41c\ub2e4.\\n\\n```bash\\n\u251c\u2500\u2500 README.md\\n\u251c\u2500\u2500 apps\\n\u251c\u2500\u2500 libs\\n\u251c\u2500\u2500 nx.json\\n\u251c\u2500\u2500 node_modules\\n\u251c\u2500\u2500 package-lock.json\\n\u251c\u2500\u2500 package.json\\n\u2514\u2500\u2500 tools\\n    \u251c\u2500\u2500 generators\\n    \u2514\u2500\u2500 tsconfig.tools.json\\n```\\n\\n### Configure yarn berry (yarn 3.0)\\n\\nyarn 3.0\uc744 \uc774\uc6a9\ud558\uae30 \uc704\ud574 \ub2e4\ub978 \uc124\uc815\uc744 \uc9c4\ud589\ud558\uae30 \uc804\uc5d0 yarn \uc124\uc815\uc744 \uba3c\uc800 \uc9c4\ud589\ud558\uc600\ub2e4.\\n\\n```bash\\n# yarn \ucd5c\uc2e0\ubc84\uc804\uc73c\ub85c \uc5c5\ub370\uc774\ud2b8\ud558\uae30 \uc704\ud568\\nyarn set version stable\\n```\\n\\n\uc5c5\ub370\uc774\ud2b8\ub41c yarn\uc744 \uc774\uc6a9\ud574\uc11c \ub2e4\uc2dc \ud328\ud0a4\uc9c0 \ubaa8\ub4c8\uc744 \uc124\uce58\ud55c\ub2e4.\\n\\n```bash\\n# re-install package modules\\nyarn install\\n```\\n\\n> yarn document\\n>\\n> - https://yarnpkg.com/getting-started/install#updating-to-the-latest-versions\\n> - https://yarnpkg.com/getting-started/editor-sdks\\n\\n### Setting Up React\\n\\nReact\ub97c \uc774\uc6a9\ud558\uc5ec \ube14\ub85c\uadf8\uc5d0\uc11c \uc0ac\uc6a9\ud560 \ucef4\ud3ec\ub10c\ud2b8\ub97c \uac1c\ubc1c\ud560 \uacc4\ud68d\uc774\ubbc0\ub85c [`@nrwl/react`](https://nx.dev/packages/react)\uc744 \uc124\uce58\ud574\uc8fc\uc5c8\ub2e4.\\n\\n```bash\\nyarn add -D @nx/react\\n```\\n\\n\uadf8\ub9ac\uace0 \ube14\ub85c\uadf8\uc5d0\uc11c \ub77c\uc774\ube0c\ub7ec\ub9ac \ud615\ud0dc\ub85c \uc0ac\uc6a9\ud560 \uac83\uc774\ubbc0\ub85c \ub2e4\uc74c\uacfc \uac19\uc774 library\ub97c \uc0dd\uc131\ud574\uc8fc\uc5c8\ub2e4.\\n\\n```bash\\nnpx nx g @nx/react:lib ui\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uc2e4\ud589\ud558\uace0 \ub098\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 **libs** \ud3f4\ub354 \ud558\uc704\uc5d0 generator \uc2e4\ud589 \uc2dc \uba85\uc2dc\ud55c \ud3f4\ub354\uba85\uc778 **ui**\uac00 \uc0dd\uc131\ub418\uc5b4\uc788\ub2e4.\\n\\n```bash\\nlibs\\n\u2514\u2500\u2500 ui\\n    \u251c\u2500\u2500 README.md\\n    \u251c\u2500\u2500 jest.config.ts\\n    \u251c\u2500\u2500 project.json\\n    \u251c\u2500\u2500 src\\n    \u2502   \u251c\u2500\u2500 index.ts\\n    \u2502   \u2514\u2500\u2500 lib\\n    \u2502     \u251c\u2500\u2500 ui.spec.tsx\\n    \u2502     \u2514\u2500\u2500 ui.tsx\\n    \u251c\u2500\u2500 tsconfig.json\\n    \u251c\u2500\u2500 tsconfig.lib.json\\n    \u2514\u2500\u2500 tsconfig.spec.json\\n```\\n\\n\ub9cc\uc57d, \uc704\uc758 \uacfc\uc815\uc5d0\uc11c \ub2e4\uc74c\uacfc \uac19\uc740 \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud55c\ub2e4\uba74....\\n\\n```bash\\n> npx nx g @nx/react:lib ui\\nNeed to install the following packages:\\n  nx\\nOk to proceed? (y) y\\n\\n >  NX   Could not find Nx modules in this workspace.\\n\\n   Have you run npm/yarn install?\\n```\\n\\n\ub2e4\uc74c\uacfc \uac19\uc740 \uacfc\uc815\uc73c\ub85c \uc218\uc815\ud558\uc5ec \ud574\uacb0\ud558\uc600\ub2e4. (ref: https://github.com/nrwl/nx/issues/2386#issuecomment-890019994)\\n\\n1. Add `nodeLinker: node-modules` from `.yarnrc.yml` (if you define `pnpMode: loose`, please remove it)\\n2. Run `yarn install`\\n3. Run `npx nx g @nx/react:lib ui` Again\\n4. Remove `nodeLinker: node-modules` from `.yarnrc.yml`\\n5. Run `yarn install` again to remove the `node_modules` directory and add back the .pnp.cjs file\\n\\n## Create MonoRepo Project with NX\\n\\n[`@nx-plus/docusaurus`](https://www.npmjs.com/package/@nx-plus/docusaurus) \ud50c\ub7ec\uadf8\uc778\uc744 \uc774\uc6a9\ud558\uc5ec docusaurus\ub97c \uad6c\uc131\ud55c\ub2e4.\\n\\n```bash\\nyarn add @nx-plus/docusaurus --dev\\n```\\n\\ndocusaurus application\uc744 \uc0dd\uc131\ud574\uc900\ub2e4.\\n\\n```bash\\nnpx nx g @nx-plus/docusaurus:app doc\\n```\\n\\n\uc774\uc81c docusaurus CLI\ub97c \uc774\uc6a9\ud558\uc5ec docusaurus application\uc744 **apps** \ud3f4\ub354 \ud558\uc704\uc5d0 \ucd94\uac00\ud574\uc900\ub2e4.\\n\\n```bash\\nnpx create-docusaurus docs classic apps/ --typescript\\nyarn add -D typescript @docusaurus/module-type-aliases @tsconfig/docusaurus\\n```\\n\\n\uc124\uce58\uac00 \ub418\uace0\ub098\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n```bash\\napps\\n\u2514\u2500\u2500 doc\\n    \u251c\u2500\u2500 babel.config.js\\n    \u251c\u2500\u2500 blog\\n    \u251c\u2500\u2500 docs\\n    \u251c\u2500\u2500 docusaurus.config.js\\n    \u251c\u2500\u2500 project.json\\n    \u251c\u2500\u2500 sidebars.js\\n    \u251c\u2500\u2500 src\\n    \u251c\u2500\u2500 static\\n    \u2514\u2500\u2500 tsconfig.json\\n```\\n\\n## Run Serve\\n\\n`package.json` \ud30c\uc77c\uc5d0 \ub2e4\uc74c\uacfc \uac19\uc774 \uc2a4\ud06c\ub9bd\ud2b8\ub97c \ucd94\uac00\ud574\uc900\ub2e4.\\n\\n```json\\n\\"scripts\\": {\\n  \\"start\\": \\"nx serve\\",\\n  \\"build\\": \\"nx build\\",\\n  \\"deploy\\": \\"nx deploy\\",\\n  \\"test\\": \\"nx test\\",\\n},\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uad6c\uc131 \ud6c4 \ub2e4\uc74c\uacfc \uac19\uc774 \uc2e4\ud589\uc744 \ud558\uba74 \uc11c\ubc84\uac00 \uc815\uc0c1\uc801\uc73c\ub85c \uae30\ub3d9\ub41c \uac83\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub530.\\n\\n```bash\\n\u276f yarn start doc\\n\\n> nx run doc:serve\\n\\n[INFO] Starting the development server...\\n[SUCCESS] Docusaurus website is running at: http://localhost:3000/\\n\\n\u2714 Client\\n  Compiled successfully in 6.23s\\n\\nclient (webpack 5.81.0) compiled successfully\\n\\n\u2714 Client\\n  Compiled successfully in 83.25ms\\n\\nclient (webpack 5.81.0) compiled successfully\\n```\\n\\n\uc774\uc81c \ub2e4\uc74c\uc5d0\ub294 \ub2e4\uc74c\uacfc \uac19\uc740 \uc124\uc815\ub4e4\uc744 \ubcf4\uc644\ud574\ubd10\uaca0\ub2e4.\\n\\n- husky\\n- lint-staged\\n- eslint\\n- commitlint\\n- cspell\\n\\n## References\\n\\n- [Easy documentation with Docusaurus and Nx](https://blog.nrwl.io/easy-documentation-with-docusaurus-and-nx-4b932d8ad0e4)\\n- [Docusaurus the happy documentation dino](https://sylhare.github.io/2022/05/07/Docusaurus-the-happy-documentation-dino.html)\\n- [Nx build system \ub9db\ubcf4\uae30](https://code-logs.github.io/nx-build-system-%EB%A7%9B%EB%B3%B4%EA%B8%B0)\\n- [\ubaa8\ub178\ub808\ud3ec \uc801\uc6a9\ubd80\ud130 yarn berry\uae4c\uc9c0](https://blog.hwahae.co.kr/all/tech/11962)"},{"id":"/2023/03/27/frontend/2023/react-test-mocking-child","metadata":{"permalink":"/gloria-tilog/2023/03/27/frontend/2023/react-test-mocking-child","source":"@site/blog/frontend/2023/2023-03-27-react-test-mocking-child.mdx","title":"react component test with mocking child component","description":"\ub9ac\uc561\ud2b8 \ucef4\ud3ec\ub10c\ud2b8\ub97c \ud14c\uc2a4\ud2b8 \ud558\ub294 \uacfc\uc815\uc5d0\uc11c child component mocking \ud558\uae30","date":"2023-03-27T21:38:00.000Z","formattedDate":"March 27, 2023","tags":[{"label":"react","permalink":"/gloria-tilog/tags/react"},{"label":"unit-test","permalink":"/gloria-tilog/tags/unit-test"}],"readingTime":1.185,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"react component test with mocking child component","tags":["react","unit-test"],"date":"2023-03-27T21:38"},"prevItem":{"title":"[docusaurus] Create Blog with NX and docusaurus","permalink":"/gloria-tilog/2023/04/30/side-project/docusaurus/init"},"nextItem":{"title":"[CI/CD] GitHub Actions\uc744 \uc774\uc6a9\ud558\uc5ec gh-pages \ubc30\ud3ec\ud558\uae30","permalink":"/gloria-tilog/2022/10/07/ci/github-actions"}},"content":"\ub9ac\uc561\ud2b8 \ucef4\ud3ec\ub10c\ud2b8\ub97c \ud14c\uc2a4\ud2b8 \ud558\ub294 \uacfc\uc815\uc5d0\uc11c child component mocking \ud558\uae30\\n\\n\x3c!--truncate--\x3e\\n\\n## \uc784\uc758\uc758 \uc694\uc18c\ub85c \uc0dd\uc131\ud558\uc5ec mocking \ud558\uae30\\n\\n```javascript\\nconst ConsentTitleComponentMock = jest.fn();\\n\\njest.mock(\'../title\', () => ({\\n  ConsentTitle: (props: unknown) => {\\n    ConsentTitleComponentMock(props);\\n    return <div />;\\n  },\\n}));\\n\\n// \ucef4\ud3ec\ub10c\ud2b8\ub85c \uc804\ub2ec\ud558\ub294 props \uac80\uc99d\\nexpect(ConsentTitleComponentMock).toHaveBeenNthCalledWith(1, {\\n  title: \'title text\',\\n});\\n\\n// \ubb34\uc5b8\uac00 \uc804\ub2ec\ub418\ub294 \uc9c0\uc5d0 \ub300\ud55c \uac80\uc99d\\nexpect(ConsentTitleComponentMock).toHaveBeenNthCalledWith(1, expect.anything());\\n```\\n\\n## \uc2e4\uc81c \ucef4\ud3ec\ub10c\ud2b8 \uc0dd\uc131\ud558\uba70 mocking \ud558\uae30\\n\\n\uc2e4\uc81c \uc8fc\uc785\ubc1b\ub294 \ucef4\ud3ec\ub10c\ud2b8\uc758 \uc774\ubca4\ud2b8 \ud578\ub4e4\ub7ec\uc5d0 \ub300\ud55c \uac80\uc99d\uc774 \ud544\uc694\ud55c \uacbd\uc6b0 \ud65c\uc6a9\ud560 \uc218 \uc788\uc74c\\n\\n```javascript\\nconst ContentRadioGroupComponentMock = jest.fn();\\n\\njest.mock(\'./input\', () => {\\n  const { RadioGroup, ...originalModule } = jest.requireActual(\'./input\');\\n\\n  return {\\n    RadioGroup: (props: unknown) => {\\n      ContentRadioGroupComponentMock(props);\\n\\n      return <RadioGroup {...props} />;\\n    },\\n    ...originalModule,\\n  };\\n});\\n\\nit(`should be fire onChange by radio change value`, () => {\\n  const { onChangeMockCallback } = renderComponent({\\n    ...defaultProps,\\n    ...disagreeProps,\\n    radioInitValue: \'N\',\\n  });\\n\\n  // when mounted\\n  expect(onChangeMockCallback).toHaveBeenNthCalledWith(1, consentId, \'N\', {\\n    isInit: true,\\n  });\\n  onChangeMockCallback.mockClear();\\n\\n  // click agree button\\n  userEvent.click(screen.getByTestId(`input-radio-${agreeOption.id}`));\\n  expect(onChangeMockCallback).toHaveBeenNthCalledWith(1, consentId, \'Y\', {\\n    isInit: false,\\n  });\\n  onChangeMockCallback.mockClear();\\n\\n  // click disagree button\\n  userEvent.click(screen.getByTestId(`input-radio-${consentId}-disagree`));\\n  expect(onChangeMockCallback).toHaveBeenNthCalledWith(1, consentId, \'N\', {\\n    isInit: false,\\n  });\\n});\\n```\\n\\n### References\\n\\n- https://dev.to/d_ir/verifying-children-passed-to-react-mock-components-2mf9"},{"id":"/2022/10/07/ci/github-actions","metadata":{"permalink":"/gloria-tilog/2022/10/07/ci/github-actions","source":"@site/blog/ci/2022/10-07-github-actions.mdx","title":"[CI/CD] GitHub Actions\uc744 \uc774\uc6a9\ud558\uc5ec gh-pages \ubc30\ud3ec\ud558\uae30","description":"GitHub Action\uc744 \uc774\uc6a9\ud574\uc11c gh-pages\uc5d0 \ubc30\ud3ec\ub97c \ud558\uae30 \uc704\ud55c \uacfc\uc815","date":"2022-10-07T00:00:00.000Z","formattedDate":"October 7, 2022","tags":[{"label":"github","permalink":"/gloria-tilog/tags/github"},{"label":"github-action","permalink":"/gloria-tilog/tags/github-action"},{"label":"gh-pages","permalink":"/gloria-tilog/tags/gh-pages"},{"label":"example","permalink":"/gloria-tilog/tags/example"}],"readingTime":3.07,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[CI/CD] GitHub Actions\uc744 \uc774\uc6a9\ud558\uc5ec gh-pages \ubc30\ud3ec\ud558\uae30","tags":["github","github-action","gh-pages","example"],"date":"2022-10-07T00:00:00.000Z"},"prevItem":{"title":"react component test with mocking child component","permalink":"/gloria-tilog/2023/03/27/frontend/2023/react-test-mocking-child"},"nextItem":{"title":"address already in use","permalink":"/gloria-tilog/2022/10/07/trouble-shootings/2022/address-already-in-use"}},"content":"GitHub Action\uc744 \uc774\uc6a9\ud574\uc11c gh-pages\uc5d0 \ubc30\ud3ec\ub97c \ud558\uae30 \uc704\ud55c \uacfc\uc815\\n\\n\x3c!--truncate--\x3e\\n\\n\uae30\uc874\uc5d0 **Netlify**\ub97c \uc774\uc6a9\ud558\uc5ec CI/CD\ub97c \uc790\ub3d9\ud654\ud55c \ubd80\ubd84\uc744 \uae08\ubc88\uc5d0 *[docusaurus](https://docusaurus.io/)*\ub85c \ubcc0\uacbd\uc744 \ud558\uba74\uc11c **GitHub Actions**\ub97c \uc774\uc6a9\ud558\uc5ec `gh-pages`\uc5d0 \ubc30\ud3ec\ud558\ub294 \uac83\uc73c\ub85c \ubcc0\uacbd\ud558\uc600\ub2e4.\\n\\n## workflow \uc0dd\uc131\ud558\uae30\\n\\n\ub808\ud3ec\uc5d0 \uc544\uc9c1 \uc815\uc758\ub41c workflow\uac00 \uc5c6\ub2e4\uba74, `Actions` \ud0ed\uc744 \ud074\ub9ad\ud558\uba74, GitHub\uc5d0\uc11c \ud574\ub2f9 \ub808\ud3ec\ub97c \ubd84\uc11d\ud558\uc5ec \ucd94\ucc9c\ud558\ub294 workflow\ub97c \uc120\ud0dd\ud558\uc5ec \uc0dd\uc131\ud560 \uc218 \uc788\ub2e4.\\n\ub610\ub294 `.github/workflows/<filename>.yml`\uacfc \uac19\uc774 \uc9c1\uc811 \ud30c\uc77c\uc744 \uc0dd\uc131\ud558\uc5ec \uc544\ub798 \uc608\uc2dc\uc640 \uac19\uc774 \uc815\uc758\ud558\uc5ec `main \ube0c\ub79c\uce58`\uc5d0 \ubc18\uc601\ud558\uba74 workflow\uc758 `on` \uc5d0 \uc815\uc758\ub41c \uc870\uac74\uc5d0 \ud574\ub2f9\ud558\ub294 \uacbd\uc6b0 \uc815\uc758\ud55c action\uc774 \uc218\ud589\ub41c\ub2e4.\\n\\n```yml\\nname: deploy-github-actions\\non:\\n  push:\\n    branches: [main]\\n  pull_request:\\n    types:\\n      - opened\\n    # branches: [main]\\n    paths-ignore:\\n      - \'docs/**\'\\n      - \'devlogs/**\'\\n      - \'trouble-shootings/**\'\\n      - \'.husky/**\'\\n      - \'.vscode/**\'\\njobs:\\n  build:\\n    runs-on: ubuntu-latest\\n    steps:\\n      - name: Checkout source code\\n        uses: actions/checkout@v3\\n\\n      - name: Setup node\\n        uses: actions/setup-node@v3\\n        with:\\n          node-version-file: \'.nvmrc\'\\n\\n      - name: Cache yarn dependencies\\n        uses: actions/cache@v1\\n        id: yarn-cache\\n        with:\\n          path: node_modules\\n          key: ${{ runner.os }}-yarn-${{ hashFiles(\'**/yarn.lock\') }}\\n          restore-keys: |\\n            ${{ runner.os }}-yarn-\\n\\n      - name: Install Dependencies\\n        run: yarn install\\n\\n      - name: Lint\\n        run: yarn run lint\\n\\n      # - name: Unit Test\\n      #   run: |\\n      #     yarn run test\\n      #     yarn run coverage\\n\\n      - name: Build\\n        run: yarn run build\\n```\\n\\n### using node version from `.nvmrc`\\n\\n\ud504\ub85c\uc81d\ud2b8\uc5d0 \uc815\uc758\ub41c `.nvmrc`\uc758 \ud30c\uc77c\uc744 \uc77d\uc5b4\uc11c node \ubc84\uc804\uc744 \uc124\uce58\ud558\uace0\uc790 \ud558\ub294 \uacbd\uc6b0 \uc544\ub798\uc640 \uac19\uc774 workflow\ub97c \uc815\uc758\ud574\uc900\ub2e4.\\n\\n```yml\\njobs:\\n  build:\\n    runs-on: ubuntu-latest\\n    steps:\\n      - name: Checkout source code\\n        uses: actions/checkout@v3\\n\\n      - name: Setup node\\n        uses: actions/setup-node@v3\\n        with:\\n          node-version-file: \'.nvmrc\'\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uc815\uc758\ud558\uba74 github action\uc774 \uc218\ud589\ub420 \ub54c\uc5d0 \uc544\ub798\uc640 \uac19\uc774 `.nvmrc`\uc758 \ud30c\uc77c\uc5d0 \uc815\uc758\ub41c \ubc84\uc804\uc758 node\ub97c \uc124\uce58\ud558\uc5ec job\uc774 \uc218\ud589\ub418\ub294 \uac83\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n```bash\\nRun actions/setup-node@v3\\n  with:\\n    node-version-file: .nvmrc\\n    always-auth: false\\n    check-latest: false\\n    token: ***\\n\\nNode version file is not JSON file\\nResolved .nvmrc as 16.15.0\\nAttempting to download 16.15.0...\\nAcquiring 16.15.0 - x64 from https://github.com/actions/node-versions/releases/download/16.15.0-2233943534/node-16.15.0-linux-x64.tar.gz\\nExtracting ...\\n/usr/bin/tar xz --strip 1 --warning=no-unknown-keyword -C /home/runner/work/_temp/becdc76f-1e88-4edc-bc18-4fd3ce04c15e -f /home/runner/work/_temp/070949ef-1124-4206-b790-a3ac92b70b51\\nAdding to the cache ...\\nDone\\n```\\n\\n## Conclusion\\n\\n\uc57d 1\uc77c \uc815\ub3c4\ub97c \uc870\uc0ac\ud574\ubcf4\uace0 \uc801\uc6a9 \ud6c4\uc5d0 \ub0b4\uac00 \uc0dd\uac01\ud558\ub294 ...\\n\\n- \uc7a5\uc810\uc740...\\n  - \ubcc4\ub3c4\ub85c Netlify, TravisCI \ub4f1\uacfc \uac19\uc740 \ub3c4\uad6c\ub97c \uc5f0\ub3d9\ud558\ub294 \uac83\ubcf4\ub2e4 GitHub\uacfc \ub9c8\uce58 \ud558\ub098\uc758 flow\ub85c \ubb36\uc5ec \uc788\ub294 \ub290\ub08c\uc774\ub2e4.\\n  - GitHub \ub0b4\uc5d0\uc11c Actions \ud0ed\uc744 \uc774\uc6a9\ud558\uc5ec \ud655\uc778\uc774 \uac00\ub2a5\ud558\ub2c8 \uc811\uadfc\uc131\uc774 \ub354 \uc88b\uc740 \uac83 \uac19\ub2e4.\\n- \ub2e8\uc810\uc740...\\n  - \uc0c8\ub85c\uc6b4 \ub7ec\ub2dd \ucee4\ube0c!!!!\\n\\n## References\\n\\n- [Github Action\uc5d0 \ub300\ud55c \uc18c\uac1c\uc640 \uc0ac\uc6a9\ubc95](https://velog.io/@ggong/Github-Action%EC%97%90-%EB%8C%80%ED%95%9C-%EC%86%8C%EA%B0%9C%EC%99%80-%EC%82%AC%EC%9A%A9%EB%B2%95)\\n- [Github pages\ub97c github actions\ub85c \uc790\ub3d9 \ubc30\ud3ec\ud558\uae30](https://ohseunghyeon.github.io/blogging/deploying-github-pages-with-github-actions/)\\n- [job, needs, if \uc0ac\uc6a9 \ucf54\ub4dc](https://gist.github.com/seye2/1c4b35af99cb991fadd47ec2f48d6499)\\n- [Github Actions\ub85c PR \uc2dc \ud14c\uc2a4\ud2b8\ub97c \ub3cc\ub824\ubcf4\uc790](https://devs0n.tistory.com/25)"},{"id":"/2022/10/07/trouble-shootings/2022/address-already-in-use","metadata":{"permalink":"/gloria-tilog/2022/10/07/trouble-shootings/2022/address-already-in-use","source":"@site/blog/trouble-shootings/2022/2022-10-07-address-already-in-use.mdx","title":"address already in use","description":"\uc6f9 \uc11c\ubc84\ub97c \uae30\ub3d9 \uc2dc\uc5d0 \ud3ec\ud2b8\uac00 \uc774\ubbf8 \uc0ac\uc6a9 \uc911\uc774\ub77c\uace0 \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud558\ub294 \uacbd\uc6b0","date":"2022-10-07T00:00:00.000Z","formattedDate":"October 7, 2022","tags":[{"label":"trouble-shooting","permalink":"/gloria-tilog/tags/trouble-shooting"},{"label":"linux","permalink":"/gloria-tilog/tags/linux"},{"label":"process","permalink":"/gloria-tilog/tags/process"},{"label":"lsof","permalink":"/gloria-tilog/tags/lsof"}],"readingTime":0.965,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"address already in use","tags":["trouble-shooting","linux","process","lsof"],"date":"2022-10-07T00:00:00.000Z"},"prevItem":{"title":"[CI/CD] GitHub Actions\uc744 \uc774\uc6a9\ud558\uc5ec gh-pages \ubc30\ud3ec\ud558\uae30","permalink":"/gloria-tilog/2022/10/07/ci/github-actions"},"nextItem":{"title":"update java version on linux","permalink":"/gloria-tilog/2022/09/15/server/2022/update-java-linux"}},"content":"\uc6f9 \uc11c\ubc84\ub97c \uae30\ub3d9 \uc2dc\uc5d0 \ud3ec\ud2b8\uac00 \uc774\ubbf8 \uc0ac\uc6a9 \uc911\uc774\ub77c\uace0 \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud558\ub294 \uacbd\uc6b0\\n\\n\x3c!--truncate--\x3e\\n\\n## What happened ...\ud83d\ude31\\n\\n```bash\\nError: listen EADDRINUSE: address already in use 127.0.0.1:3000\\n```\\n\\n## How to Solve ...\ud83d\udea7\\n\\nMacOS\uc640 \uac19\uc774 \ub9ac\ub205\uc2a4 \uae30\ubc18\uc758 \uc7a5\ube44\uc5d0\uc11c\ub294 `lsof` \uba85\ub839\uc5b4\ub97c \uc774\uc6a9\ud558\uc5ec \ud65c\uc131\ud654\ub41c \ud504\ub85c\uc138\uc2a4\ub97c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\uc544\ub798\uc640 \uac19\uc774 \ud130\ubbf8\ub110\uc5d0 \uba85\ub839\uc5b4\ub97c \uc785\ub825\ud558\uc5ec \ud655\uc778\ud55c\ub2e4.\\n\\n```bash\\nlsof -i TCP:3000\\n```\\n\\n\uadf8\ub7ec\uba74 \ub2e4\uc74c\uacfc \uac19\uc740 \ud615\ud0dc\ub85c \ud604\uc7ac \ud574\ub2f9 \ud3ec\ud2b8\ub97c \uc0ac\uc6a9 \uc911\uc778 \ud504\ub85c\uc138\uc2a4\uac00 \ud655\uc778\ub41c\ub2e4.\\n\\n```bash\\nCOMMAND   PID USER   FD   TYPE            DEVICE SIZE/OFF NODE NAME\\nnode    13784 user   33u  IPv4 0xee1545daa19a981      0t0  TCP localhost:hbci (LISTEN)\\n```\\n\\n\uadf8\ub7ec\uba74 `pid`\ub97c \uc774\uc6a9\ud558\uc5ec \uac15\uc81c\ub85c \ud574\ub2f9 \ud504\ub85c\uc138\uc2a4\ub97c \uc885\ub8cc\ud55c\ub2e4.\\n\\n```bash\\nkill -9 13784\\n```"},{"id":"/2022/09/15/server/2022/update-java-linux","metadata":{"permalink":"/gloria-tilog/2022/09/15/server/2022/update-java-linux","source":"@site/blog/server/2022/2022-09-15-update-java-linux.mdx","title":"update java version on linux","description":"\uc124\uce58 \uac00\ub2a5\ud55c java \ubc84\uc804 \ud655\uc778","date":"2022-08-15T11:53:00.000Z","formattedDate":"August 15, 2022","tags":[{"label":"linux","permalink":"/gloria-tilog/tags/linux"},{"label":"java","permalink":"/gloria-tilog/tags/java"}],"readingTime":0.24,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"update java version on linux","tags":["linux","java"],"date":"2022-08-15T11:53"},"prevItem":{"title":"address already in use","permalink":"/gloria-tilog/2022/10/07/trouble-shootings/2022/address-already-in-use"},"nextItem":{"title":"[CI/CD] Configuration CI (2) - Install Jenkins (master-slave) Plugins","permalink":"/gloria-tilog/2021/05/14/ci/configuration-ci-jenkins"}},"content":"\uc124\uce58 \uac00\ub2a5\ud55c java \ubc84\uc804 \ud655\uc778\\n\\n\x3c!--truncate--\x3e\\n\\n```bash\\nyum list java*jdk-devel\\n```\\n\\n\uc124\uce58\ud558\uae30\\n\\n```bash\\nyum install -y java-11-openjdk-devel.x86_64\\n```\\n\\n\uc124\uce58\ud55c \uc790\ubc14 \ubc84\uc804\uc73c\ub85c \ubcc0\uacbd\ud558\uae30\\n\\n```bash\\n/usr/sbin/alternatives --config java\\n```\\n\\n- https://hye0-log.tistory.com/32\\n- https://www.infracody.com/2022/05/centos-7-yum-install-java-openjdk-11.html"},{"id":"/2021/05/14/ci/configuration-ci-jenkins","metadata":{"permalink":"/gloria-tilog/2021/05/14/ci/configuration-ci-jenkins","source":"@site/blog/ci/2021/05-14-configuration-ci-jenkins/index.mdx","title":"[CI/CD] Configuration CI (2) - Install Jenkins (master-slave) Plugins","description":"\uc820\ud0a8\uc2a4 CI \ud50c\ub7ec\uadf8\uc778 \uc124\uce58 \ud558\uae30","date":"2021-05-14T09:31:00.000Z","formattedDate":"May 14, 2021","tags":[{"label":"jenkins","permalink":"/gloria-tilog/tags/jenkins"},{"label":"sonarQube","permalink":"/gloria-tilog/tags/sonar-qube"},{"label":"coverage","permalink":"/gloria-tilog/tags/coverage"}],"readingTime":3.125,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[CI/CD] Configuration CI (2) - Install Jenkins (master-slave) Plugins","tags":["jenkins","sonarQube","coverage"],"date":"2021-05-14T09:31"},"prevItem":{"title":"update java version on linux","permalink":"/gloria-tilog/2022/09/15/server/2022/update-java-linux"},"nextItem":{"title":"[CI/CD] Configuration CI (1) - Install Jenkins (master-slave) with nginx proxy","permalink":"/gloria-tilog/2021/05/13/ci/install-ci-jenkins"}},"content":"\uc820\ud0a8\uc2a4 CI \ud50c\ub7ec\uadf8\uc778 \uc124\uce58 \ud558\uae30\\n\\n\x3c!--truncate--\x3e\\n\\n## Configuration Jenkins\\n\\n\uc0ac\uc6a9\uc790\uac00 \uc124\uc815\ud55c \uc0ac\uc6a9\uc790\ub85c \ub85c\uadf8\uc778\uc744 \ud558\uace0 \ub098\uba74 \uc774\uc81c \uc820\ud0a8\uc2a4 CI \uad6c\uc131\uc5d0 \ud544\uc694\ud55c \ud50c\ub7ec\uadf8\uc778\uc744 \uc124\uce58\ud55c\ub2e4.\\n\ud50c\ub7ec\uadf8\uc778\uc740 **\uc820\ud0a8\uc2a4 \uad00\ub9ac \u2192 \ud50c\ub7ec\uadf8\uc778 \uad00\ub9ac** \ub9e4\ub274\ub85c \uc811\uadfc\ud558\uc5ec **\uc124\uce58\uac00\ub2a5** \ud0ed\uc744 \ud074\ub9ad\ud558\uc5ec \uc6d0\ud558\ub294 \ud50c\ub7ec\uadf8\uc778\uc744 \uc120\ud0dd\ud558\uc5ec \uc124\uce58\ud558\uba74 \ub41c\ub2e4.\\n![plugin](./jenkins-install-plugin.png)\\n![plugin-avaliable](./jenkins-install-plugin-avaliable.png)\\n\\n\ub098\ub294 CI \ud658\uacbd \uad6c\uc131\uc744 \uc704\ud574 \uc544\ub798\uc640 \uac19\uc740 \ud50c\ub7ec\uadf8\uc778\ub4e4\uc744 \uc124\uce58\ud558\uc600\ub2e4.\\n\\n- Warnings Next Generation\\n  ![checkstyle](./jenkins-checkstyle.png)\\n  - ESLint\uc640 \uac19\uc740 \uc815\uc801 \ubd84\uc11d \ub3c4\uad6c\uc5d0 \ub300\ud55c \ub9ac\ud3ec\ud2b8\ub97c \uc0dd\uc131\ud558\uae30 \uc704\ud574 \uc124\uce58\\n  - https://plugins.jenkins.io/warnings-ng/\\n- GitHub Authentication\\n  - \uc0ac\ub0b4 GitHub \uacc4\uc815\uc744 \uc774\uc6a9\ud558\uc5ec \ub85c\uadf8\uc778\uc744 \ud560 \uc218 \uc788\ub3c4\ub85d \uc124\uc815\ud558\uae30 \uc704\ud574 \uc124\uce58 (\uc989, GitHub AOuth \uc774\uc6a9\uc744 \uc704\ud568)\\n  - https://plugins.jenkins.io/github-oauth/https://plugins.jenkins.io/github-oauth/\\n- GitHub Integration\\n  - https://plugins.jenkins.io/github-pullrequest/\\n- Blue Ocean\\n  - jenkinsfiles \ub97c \uc774\uc6a9\ud558\uc5ec \uc2a4\ud06c\ub9bd\ud2b8\ub97c \uc815\uc758\ud560 \uc218 \uc788\uace0, \uc880 \ub354 \uc774\uc05c \ud30c\uc774\ud504\ub77c\uc778 \uadf8\ub798\ud504\ub97c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n  - https://plugins.jenkins.io/blueocean/\\n- docker pipeline\\n  - https://plugins.jenkins.io/docker-workflow/\\n- SSH Pipeline Steps\\n  - pipeline \ub0b4\uc5d0\uc11c ssh \uba85\ub839\uc5b4\ub97c \uc0ac\uc6a9\ud558\uae30 \uc704\ud568\\n  - https://plugins.jenkins.io/ssh-steps/\\n- Embeddable Build Status\\n  - \ube4c\ub4dc \uc0c1\ud0dc\uc5d0 \ub300\ud574 README\uc5d0 \ubc43\uc9c0\ub97c \ub4f1\ub85d\ud558\uae30 \uc704\ud568\\n  - https://plugins.jenkins.io/embeddable-build-status/\\n- Slack Notification Plugin\\n  - slack\uc73c\ub85c \uc54c\ub9bc \uc804\uc1a1\uc744 \uc704\ud568\\n  - https://plugins.jenkins.io/slack/\\n- Merics\\n  - \uac01 \ube4c\ub4dc stage \uac04\uc758 \uc2dc\uac04 \ub4f1\uc744 \uae30\ub85d\ud558\uae30 \uc704\ud568\\n  - https://plugins.jenkins.io/metrics/\\n\\n### System Configuration\\n\\n**Jenkins \uad00\ub9ac -> \uc2dc\uc2a4\ud15c \uc124\uc815**\uc5d0\uc11c \ub2e4\uc74c\uacfc \uac19\uc740 \uc124\uc815\uc744 \ud558\uc600\ub2e4.\\n\\n#### Github OAuth \uc124\uc815\\n\\nGitHub \uacc4\uc815\uc744 \uc774\uc6a9\ud558\uc5ec \ub85c\uadf8\uc778\uc744 \ud558\uae30 \uc704\ud574 **Configure Global Security**\uc5d0\uc11c \uc124\uc815\uc744 \ud574\uc8fc\uc5b4\uc57c \ud55c\ub2e4.\\n![jenkins-oauth](./jenkins-oauth.png)\\n\\n\uc820\ud0a8\uc2a4 \uc11c\ubc84\uc5d0 \ub300\ud55c \uc815\ubcf4\ub97c GitHub\uc5d0 \ub85c\uadf8\uc778 \ud6c4, **Settings - Developer Settings - OAuth Apps**\uc5d0\uc11c OAuth App\uc744 \uc0dd\uc131\ud558\uc5ec \ub4f1\ub85d\ud574\uc900\ub2e4.\\n![github-oauth-app](./github-oauth-app.png)\\n\\n- Homepage URL : jenkins domain\\n- Authorization callback URL : [jenkins domain]/securityRealm/finishLogin\\n\\n#### Github Server \uc124\uc815\\n\\n**GitHub Sever** \uc124\uc815\uc744 \ud55c\ub2e4.\\n![jenkins-github-server](./jenkins-github-server.png)\\n\\nGitHub\uc5d0 \ub85c\uadf8\uc778\uc744 \uc704\ud574 \uc0ac\uc6a9\ud558\ub294 Token \uc815\ubcf4\ub294 \ud574\ub2f9 \ub9e4\ub274\uc758 **\uace0\uae09** \ubc84\ud2bc\uc744 \ud074\ub9ad\ud574\uc11c \ucd9c\ub825\ub418\ub294 \ub9e4\ub274\uc5d0\uc11c \ub2e4\uc74c\uacfc \uac19\uc740 \ub9e4\ub274\ub97c \ud1b5\ud574 \uc0dd\uc131\ud560 \uc218 \uc788\ub2e4.\\n![jenkins-git-token](./jenkins-git-token.png)\\n\\n\uc704\uc640 \uac19\uc774 GitHub Token\uc744 \uc0dd\uc131\ud558\uba74, GitHub\uc5d0 \ub85c\uadf8\uc778 \ud6c4 **Settings - Developer Settings - Personal Access Token** \ub9e4\ub274\uc5d0\uc11c \uc0dd\uc131\ub41c \ud1a0\ud070\uc744 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n#### Github API \uc124\uc815\\n\\n\uc5d4\ud130\ud504\ub77c\uc774\uc988 GitHub\uc744 \uc0ac\uc6a9\ud558\ub294 \uacbd\uc6b0, \ud574\ub2f9 \ub9e4\ub274\ub97c \ud1b5\ud574 \ub4f1\ub85d\uc744 \ud574\uc8fc\uc5b4\uc57c\ud55c\ub2e4.\\n![jenkins-git-api](./jenkins-git-api.png)\\n\\n\uc77c\ub2e8 \uc774\ub807\uac8c \uae30\ubcf8\uc801\uc778 \uc124\uc815\uc744 \uc644\ub8cc\ud558\uc600\ub2e4.\\n\ube4c\ub4dc Job \uc0dd\uc131\uc5d0 \ub300\ud55c \uacfc\uc815\uc740 \ub2e4\uc74c\uc5d0...."},{"id":"/2021/05/13/ci/install-ci-jenkins","metadata":{"permalink":"/gloria-tilog/2021/05/13/ci/install-ci-jenkins","source":"@site/blog/ci/2021/05-13-install-ci-jenkins/index.mdx","title":"[CI/CD] Configuration CI (1) - Install Jenkins (master-slave) with nginx proxy","description":"\uc820\ud0a8\uc2a4 CI \ud658\uacbd \uad6c\uc131 \ud558\uae30","date":"2021-05-13T09:31:00.000Z","formattedDate":"May 13, 2021","tags":[{"label":"jenkins","permalink":"/gloria-tilog/tags/jenkins"},{"label":"sonarQube","permalink":"/gloria-tilog/tags/sonar-qube"},{"label":"coverage","permalink":"/gloria-tilog/tags/coverage"}],"readingTime":8.76,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[CI/CD] Configuration CI (1) - Install Jenkins (master-slave) with nginx proxy","tags":["jenkins","sonarQube","coverage"],"date":"2021-05-13T09:31"},"prevItem":{"title":"[CI/CD] Configuration CI (2) - Install Jenkins (master-slave) Plugins","permalink":"/gloria-tilog/2021/05/14/ci/configuration-ci-jenkins"},"nextItem":{"title":"[Nginx] Reverse Proxy","permalink":"/gloria-tilog/2021/01/20/server/nginx-proxy"}},"content":"\uc820\ud0a8\uc2a4 CI \ud658\uacbd \uad6c\uc131 \ud558\uae30\\n\\n\x3c!--truncate--\x3e\\n\\n\ud68c\uc0ac\uc5d0\uc11c \uac1c\ubc1c \ud658\uacbd\uc5d0 \ub300\ud55c CI \ud658\uacbd \uad6c\uc131\uc744 \ud558\uba70 \uc815\ub9ac\ud588\ub358 \uae30\ub85d\uc774\ub2e4.\\n\\n\uad6c\uc131\ud55c \ud658\uacbd\uc740 \uc544\ub798\uc640 \uac19\ub2e4.\\n\\n> Server: CentOS 7.9 8cpu 32ram 100G SSD\\n> Docker v20.10.7\\n> Docker Compose v1.28.6\\n> Jenkins v2.277.4\\n> SonarQube v7.9.4\\n\\n\uc820\ud0a8\uc2a4\ub97c \uc11c\ubc84\uc5d0 \uc124\uce58 \ubc0f \uc124\uc815\uc744 \ud558\ub294 \uacfc\uc815\uc774\ub2e4.\\n\uc820\ud0a8\uc2a4\uc758 \uc124\uce58 \ud658\uacbd \uad6c\uc131\uc740 \ub3c4\ucee4 \ud658\uacbd \uc704\uc5d0 Jenkins\uc640 SSL \uc801\uc6a9\uc744 \uc704\ud574 nginx\ub97c \uc124\uce58\ud558\uc5ec proxy \uad6c\uc131\uc744 \ud558\uc600\ub2e4.\\n\\n## Create the nginx config files\\n\\n### ./conf/nginx.conf\\n\\n```bash\\nuser nginx;\\nworker_processes 1;\\n\\nerror_log /var/log/nginx/error.log warn;\\npid /var/run/nginx.pid;\\n\\nevents {\\n    worker_connections 1024;\\n}\\n\\nhttp {\\n    include /etc/nginx/mime.types;\\n    default_type application/octet-stream;\\n\\n    # \uc6f9 \uc124\uc815\ud558\ub294 \ubd80\ubd84\\n    include /etc/nginx/conf.d/*.conf;\\n\\n    # \ub85c\uadf8 \ud30c\uc77c\uc5d0 \ub300\ud55c \ud3ec\ub9f7\uc744 \uc124\uc815\ud574\uc8fc\ub294 \ubd80\ubd84\\n    log_format main \'$remote_addr - $remote_user [$time_local] \\"$request\\" \'\\n      \'$status $body_bytes_sent \\"$http_referer\\" \'\\n      \'\\"$http_user_agent\\" \\"$http_x_forwarded_for\\"\';\\n    access_log /var/log/nginx/access.log main;\\n\\n    # https://www.lesstif.com/system-admin/nginx-http-413-client-intended-to-send-too-large-body-86311189.html\\n    client_max_body_size 8M;\\n\\n    # gzip configuration\\n    gzip on;\\n    gzip_disable \\"msie6\\";\\n    gzip_min_length 10240;\\n    gzip_buffers 32 32k;\\n    gzip_comp_level 9;\\n    gzip_proxied any;\\n    gzip_types text/plain application/javascript application/x-javascript text/javascript text/xml text/css;\\n    gzip_vary on;\\n\\n    sendfile on;\\n    keepalive_timeout 65;\\n}\\n\\n```\\n\\n### ./conf/jenkins.conf\\n\\n```bash\\nupstream jenkins {\\n    server jenkins-master:8080;\\n}\\n\\nserver {\\n    listen 80 default_server;\\n    listen [::]:80 default_server;\\n    server_name \\"_\\";\\n\\n    location / {\\n\\tproxy_set_header    X-Real-IP           $remote_addr;\\n\\tproxy_set_header    X-Forwarded-For     $proxy_add_x_forwarded_for;\\n\\tproxy_set_header    X-Forwarded-Proto   $scheme;\\n\\tproxy_set_header    Host                $host;\\n\\tproxy_set_header    X-Forwarded-Host    $host;\\n\\tproxy_set_header    X-Forwarded-Port    $server_port;\\n\\tproxy_set_header    X-NginX-Proxy       true;\\n\\tproxy_pass_header   Set-Cookie;\\n\\tproxy_http_version  1.1;\\n\\tproxy_cache_bypass  $http_upgrade;\\n\\tproxy_pass http://jenkins/;\\n   }\\n}\\n```\\n\\n## Create docker compose files\\n\\n\uba3c\uc800 jenkins master node\ub97c \uc704\ud55c \ucee8\ud14c\uc774\ub108\uc640 nginx \ucee8\ud14c\uc774\ub108\ub97c \uc815\uc758\ud55c\ub2e4.\\n\\n```bash\\nversion: \\"3\\"\\nservices:\\n  nginx:\\n    image: nginx:latest\\n    container_name: nginx\\n    hostname: nginx\\n    privileged: true\\n    restart: always\\n    volumes:\\n      - ./conf/jenkins.conf:/etc/nginx/conf.d/jenkins.conf\\n      - ./conf/nginx.conf:/etc/nginx/nginx.conf\\n    ports:\\n      - 80:80\\n    environment:\\n      - TZ=Asia/Seoul\\n    depends_on:\\n      - jenkins-master\\n\\n  jenkins-master:\\n    image: jenkins/jenkins:lts\\n    container_name: jenkins-master\\n    hostname: jenkins-master\\n    privileged: true\\n    restart: always\\n    volumes:\\n      - /var/run/docker.sock:/var/run/docker.sock\\n      - /usr/bin/docker:/usr/bin/docker\\n      - $HOME/jenkins_master:/var/jenkins_home\\n    environment:\\n      - TZ=Asia/Seoul\\n```\\n\\n### jenkins \uc720\uc800 \uc0dd\uc131 \ubc0f jenkin home \ud3f4\ub354 \uc0dd\uc131\\n\\n**jenkins_home** \ud3f4\ub354\ub97c \uc0dd\uc131\ud558\uc5ec \uc820\ud0a8\uc2a4 \uc0ac\uc6a9\uc790\uc5d0\uac8c \uc18c\uc720\uad8c\uc744 \ub118\uae30\uae30 \uc704\ud55c \uacfc\uc815\uc774\ub2e4.\\n\\n\uc820\ud0a8\uc2a4 \ub0b4\ubd80\uc5d0\uc11c \uc0dd\uc131\ub418\ub294 jenkins \uc720\uc800\uc758 id\ub294 \uae30\ubcf8\uc801\uc73c\ub85c 1000\uc778\ub370, \ud574\ub2f9 \uc720\uc800\ub97c \uc0dd\uc131\ud558\uc9c0 \uc54a\uc73c\uba74 \uad8c\ud55c \ubd80\uc5ec \uc2dc \uc544\uc774\ub514\ub85c \uc8fc\uba74\ub418\ubbc0\ub85c \uc0ac\uc6a9\uc790 \uc0dd\uc131 \ubd80\ubd84\uc740 \uc0dd\ub7b5\ud574\ub3c4 \ub41c\ub2e4.\\n\ud558\uc9c0\ub9cc, \ub098\ub294 \uc774\uc655\uc774\uba74 \uc544\uc774\ub514\ubcf4\ub2e4 \uc0ac\uc6a9\uc790\uba85\uc73c\ub85c \ubcf4\uc774\ub294 \uac8c \uc88b\uc740 \uac83 \uac19\uc544\uc11c \ub3d9\uc77c\ud55c \uc544\uc774\ub514\ub85c \ub85c\uceec \uc11c\ubc84\uc5d0 jenkins \uc720\uc800\ub97c \uc0dd\uc131\ud558\uace0, docker \uadf8\ub8f9\uc5d0 \ud3ec\ud568\uc2dc\ucf30\ub2e4.\\n(docker \uadf8\ub8f9\uc740 docker \uc124\uce58 \uc2dc\uc5d0 \uc0dd\uc131\ub418\ub294 group \uc774\ub2e4.)\\n\\n```bash\\nsudo /usr/sbin/useradd jenkins -u 1000\\nsudo /usr/sbin/usermod -aG docker jenkins\\n```\\n\\n\ub3c4\ucee4 \ucee8\ud14c\uc774\ub108 \uc2e4\ud589 \uc804\uc5d0 \uc820\ud0a8\uc2a4 \ud30c\uc77c\uc774 \uc704\uce58\ud560 \ud3f4\ub354 \uc0dd\uc131\ub97c \uc0dd\uc131\ud574\uc8fc\uace0, jenkins \uc720\uc800\uc5d0\uac8c \uc18c\uc720\uad8c\uc744 \ub118\uaca8\uc900\ub2e4.\\n\\n```bash\\nmkdir -p /home1/irteam/jenkins_home\\nsudo chown -R jenkins:docker /home1/irteam/jenkins_home\\n```\\n\\n### docker container \uae30\ub3d9\\n\\n\uc774\uc81c \uc704\uc5d0\uc11c \uc0dd\uc131\ud55c docker compose \ud30c\uc77c\uc744 \uc774\uc6a9\ud558\uc5ec \ub3c4\ucee4 \ucee8\ud14c\uc774\ub108\ub97c \ub744\uc6b4\ub2e4.\\n\\n```bash\\ndocker-compose up -d\\n```\\n\\n\ucee8\ud14c\uc774\ub108 \uc2e4\ud589 \ud6c4\uc5d0 \uc544\ub798\uc640 \uac19\uc740 \uba85\ub839\uc5b4\ub97c \uc774\uc6a9\ud558\uc5ec \uc815\uc0c1\uc801\uc73c\ub85c \uae30\ub3d9 \ubc0f \uc2e4\ud589 \uc911\uc778\uc9c0 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n```bash\\n$ docker ps\\nCONTAINER ID   IMAGE                      COMMAND                  CREATED          STATUS                  PORTS                                NAMES\\n7b527bf37770   nginx:latest               \\"/docker-entrypoint.\u2026\\"   41 minutes ago   Up 24 minutes           0.0.0.0:80->80/tcp                   nginx\\n66c7edd6be59   jenkins/jenkins:lts        \\"/sbin/tini -- /usr/\u2026\\"   41 minutes ago   Up 24 minutes           8080/tcp, 0.0.0.0:50000->50000/tcp   jenkins-master\\n```\\n\\n\ub9cc\uc57d, \ub3c4\ucee4 \ucee8\ud14c\uc774\ub108 \uc2e4\ud589 \uc2dc \ud6c4\uc5d0 \uc5d0\ub7ec\uac00 \ubc1c\uc0dd\ud558\uc600\ub2e4\uac70\ub098, \uc2e4\ud589 \ub85c\uadf8\ub97c \ud655\uc778\ud558\uace0 \uc2f6\uc73c\uba74 \ub2e4\uc74c\uacfc \uac19\uc774 \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n```bash\\ndocker container logs <container_name>\\n\\n# ex) docker container logs jenkins\\n```\\n\\n\uc815\uc0c1\uc801\uc73c\ub85c \uc820\ud0a8\uc2a4\uac00 \uc2e4\ud589\uc774 \ub418\uc5c8\ub2e4\uba74...nginx\uc5d0\uc11c \uc820\ud0a8\uc2a4\uc758 8080 \ud3ec\ud2b8\ub97c nginx\ub97c \ud1b5\ud558\uc5ec 80 \ud3ec\ud2b8\ub85c \ud3ec\ud2b8\ud3ec\uc6cc\ub529 \ucc98\ub9ac\ub97c \ud558\uc600\uc73c\ubbc0\ub85c \uc6f9\ube0c\ub77c\uc6b0\uc800\ub97c \ud1b5\ud558\uc5ec **http://<server_ip>** \uc8fc\uc18c\ub85c \uc820\ud0a8\uc2a4 \uad00\ub9ac\uc790 \ud654\uba74\uc5d0 \uc811\uadfc\ud560 \uc218 \uc788\ub2e4.\\n\\n## Getting Started Jenkins\\n\\n\uc820\ud0a8\uc2a4\uc5d0 \uc124\uce58 \ud6c4 \uc6f9 \ube0c\ub77c\uc6b0\uc800\ub97c \uc774\uc6a9\ud558\uc5ec \ucd5c\ucd08\ub85c \uc811\uc18d\ud558\ub294 \uacbd\uc6b0\uc5d0\ub294 \uc124\uce58 \uc2dc \uc124\uc815\ub41c \ucd08\uae30 \ud328\uc2a4\uc6cc\ub4dc\ub97c \ud655\uc778\ud558\uc5ec \uc811\uc18d\ud574\uc57c\ud55c\ub2e4.\\n\ucd08\uae30 \ud328\uc2a4\uc6cc\ub4dc\ub294 \ub2e4\uc74c\uacfc \uac19\uc740 \ubc29\ubc95\uc73c\ub85c \ud655\uc778\ud560 \uc218 \uc788\ub2e4.\\n\\n```bash\\ndocker exec jenkins cat /var/jenkins_home/secrets/initialAdminPassword\\n```\\n\\n\ud574\ub2f9 \ud328\uc2a4\uc6cc\ub4dc\ub97c \uc774\uc6a9\ud558\uc5ec \ub85c\uadf8\uc778\uc744 \ud558\uace0 \ub098\uba74 \uc544\ub798\uc640 \uac19\uc774 \ud50c\ub7ec\uadf8\uc778\uc744 \uc124\uce58\ud558\ub77c\ub294 \ub9e4\ub274\uac00 \ub098\uc628\ub2e4.\\n\ub300\ubd80\ubd84 \uae30\ubcf8\uc801\uc73c\ub85c \uc820\ud0a8\uc2a4\uc5d0\uc11c \uc81c\uc548\ud558\ub294 \ud50c\ub7ec\uadf8\uc778\uc744 \uc124\uce58\ud558\uc9c0\ub9cc, \uc6d0\ud558\uba74 \uac01\uac01 \ubcc4\ub3c4\ub85c \ud50c\ub7ec\uadf8\uc778\uc744 \uace8\ub77c\uc11c \uc124\uce58\ud560 \uc218\ub3c4 \uc788\ub2e4.\\n![getting-started-plugins](./jenkins-getting-started-plugins.png)\\n\\n\ud50c\ub7ec\uadf8\uc778 \uc124\uce58\uac00 \uc644\ub8cc\uac00 \ub418\uba74, \ucd08\uae30 \ub85c\uadf8\uc778 \uc0ac\uc6a9\uc790\uc5d0 \ub300\ud55c \uc124\uc815\uc744 \ud558\ub294 \ud654\uba74\uc774 \ub098\uc624\uac8c \ub41c\ub2e4.\\n\\n\uadf8\ub7ec\uba74 \uc77c\ub2e8 \uc820\ud0a8\uc2a4 \uc124\uce58\ub294 \uc644\ub8cc!!!\\n\\n## Add jenkins slave node\\n\\n\uc774\uc81c \uae30\ubcf8\uc801\uc778 \uc820\ud0a8\uc2a4 \uc124\uce58\ub294 \ub9c8\ucce4\uc73c\ubbc0\ub85c slave node \ucd94\uac00\ub97c \uc704\ud55c \uc124\uc815\uc744 \ud55c\ub2e4.\\n\uc544\ub798\uc640 \uac19\uc774 master container\uc5d0 \uc811\uadfc\ud558\uc5ec ssh key\ub97c \uc0dd\uc131\ud55c\ub2e4.\\n\\n```bash\\n$ docker container exec -it jenkins-master /bin/bash\\njenkins@jenkins-master:/$  ssh-keygen -t rsa -C \\"jenkins-master\\"\\nGenerating public/private rsa key pair.\\nEnter file in which to save the key (/var/jenkins_home/.ssh/id_rsa):\\nCreated directory \'/var/jenkins_home/.ssh\'.\\nEnter passphrase (empty for no passphrase):\\nEnter same passphrase again:\\nYour identification has been saved in /var/jenkins_home/.ssh/id_rsa.\\nYour public key has been saved in /var/jenkins_home/.ssh/id_rsa.pub.\\nThe key fingerprint is:\\nSHA256:wmChG3ToFUv4hCSzvhAai2Rx/aRVHv63cDeaqjxehnM jenkins-master\\nThe key\'s randomart image is:\\n+---[RSA 2048]----+\\n|ooo=*.  .o       |\\n| =*+o+ oo .      |\\n|++o++ =  o       |\\n|*+.+.+ .  .      |\\n|=..   o S  o o o |\\n|. .    .  . + = .|\\n| .       o E +   |\\n|        ..= .    |\\n|        .+o.     |\\n+----[SHA256]-----+\\n```\\n\\n\uadf8\ub9ac\uace0 **~/.ssh** \ud3f4\ub354\ub85c \uc774\ub3d9\ud558\uc5ec `id_rsa.pub` \ud0a4\ub97c \ud074\ub9bd\ubcf4\ub4dc\ub85c \ubcf5\uc0ac\ud574\ub454\ub2e4.\\n\\n```bash\\njenkins@jenkins-master:/$ cat ~/.ssh/id_rsa.pub\\nssh-rsa AAAAB3NzaC1yc.....\\n```\\n\\n### docker compose\uc5d0 slave \ub178\ub4dc \uc815\uc758 \ucd94\uac00\\n\\n\uc55e\uc5d0\uc11c \uc815\uc758\ud55c docker-compose.yml \ud30c\uc77c\uc5d0 slave node\uc5d0 \ub300\ud55c \uc815\uc758\ub97c \ucd94\uac00\ud574\uc900\ub2e4.\\n\\n```bash\\n  jenkins-master:\\n    image: jenkins/jenkins:lts\\n    container_name: jenkins-master\\n    hostname: jenkins-master\\n    privileged: true\\n    restart: always\\n    volumes:\\n      - /var/run/docker.sock:/var/run/docker.sock\\n      - /usr/bin/docker:/usr/bin/docker\\n      - $HOME/jenkins_master:/var/jenkins_home\\n    environment:\\n      - TZ=Asia/Seoul\\n    links:\\n      - jenkins-agent01\\n\\n  jenkins-agent01:\\n    image: jenkins/ssh-agent:latest\\n    container_name: jenkins-agent01\\n    hostname: jenkins-agent01\\n    privileged: true\\n    restart: always\\n    volumes:\\n      - /var/run/docker.sock:/var/run/docker.sock\\n      - /usr/bin/docker:/usr/bin/docker\\n      - $HOME/jenkins_agent:/var/jenkins_home\\n    environment:\\n      - JENKINS_AGENT_SSH_PUBKEY=ssh-rsa AAAAB3NzaC1yc2EAAAADAQABAAABAQDLT3ZHpTr...\\n      - TZ=Asia/Seoul\\n```\\n\\n\ucee8\ud14c\uc774\ub108\ub97c \uc7ac\uae30\ub3d9\ud55c\ub2e4.\\n\\n```bash\\ndocker container stop jenkins-master\\ndocker container stop nginx\\ndocker-compose up -d\\n```\\n\\n### \ub178\ub4dc \ucd94\uac00\\n\\n\uc820\ud0a8\uc2a4 \uc6f9\ud398\uc774\uc9c0\uc5d0 \uc811\uc18d\ud558\uc5ec \ub178\ub4dc \ucd94\uac00 \ud558\uae30 \uc804\uc5d0 **Jenkins\uad00\ub9ac > Manage Credentials** \uc5d0\uc11c ssh key\ub97c \ub4f1\ub85d\ud55c\ub2e4.\\n\\n![credential](./jenkins-slave-credential.png)\\n\\ncredential \ud0a4\ub97c \ub4f1\ub85d\ud55c \ub4a4\uc5d0 **Jenkins\uad00\ub9ac > \ub178\ub4dc\uad00\ub9ac > \uc2e0\uaddc \ub178\ub4dc** \ub9e4\ub274\ub85c \uc811\uadfc\ud558\uc5ec agent\ub97c \ub4f1\ub85d\ud55c\ub2e4.\\n![add-node](./jenkins-add-node.png)\\n\\n## Trouble Shooting\\n\\n### java.io.IOException: Java not found on hudson.slaves.SlaveComputer@63a0ae53. Install Java 8 or Java 11 on the Agent.\\n\\nagent \ub178\ub4dc \ucd94\uac00 \ud6c4\uc5d0 launch \uc2dc\uc5d0 \uc544\ub798\uc640 \uac19\uc740 \uc5d0\ub7ec \ub85c\uadf8\uac00 \ub178\ucd9c\uc774 \ub418\uba74 **Jenkins\uad00\ub9ac > \ub178\ub4dc\uad00\ub9ac**\uc5d0\uc11c \ud574\ub2f9 agent \ub178\ub4dc\uc758 java path\ub97c \uc124\uc815\ud574\uc900\ub2e4.\\n\\n```bash\\njava.io.IOException: Java not found on hudson.slaves.SlaveComputer@63a0ae53. Install Java 8 or Java 11 on the Agent.\\n\\tat hudson.plugins.sshslaves.JavaVersionChecker.resolveJava(JavaVersionChecker.java:84)\\n\\tat hudson.plugins.sshslaves.SSHLauncher$1.call(SSHLauncher.java:453)\\n\\tat hudson.plugins.sshslaves.SSHLauncher$1.call(SSHLauncher.java:421)\\n\\tat java.util.concurrent.FutureTask.run(FutureTask.java:266)\\n\\tat java.util.concurrent.ThreadPoolExecutor.runWorker(ThreadPoolExecutor.java:1149)\\n\\tat java.util.concurrent.ThreadPoolExecutor$Worker.run(ThreadPoolExecutor.java:624)\\n\\tat java.lang.Thread.run(Thread.java:748)\\n[07/05/21 17:26:56] Launch failed - cleaning up connection\\n```\\n\\n\uc544\ub798\uc640 \uac19\uc774 \ud574\ub2f9 agent \ub178\ub4dc\uc5d0 \uc811\uc18d\ud558\uc5ec java path\ub97c \ud655\uc778\ud558\uace0 \uc124\uc815\\n\\n```bash\\n$ docker container exec -it jenkins-agent01 /bin/bash\\nroot@jenkins-agent01:/home/jenkins# which java\\n/usr/local/openjdk-8/bin/java\\n```\\n\\n### java.io.IOException: Could not copy remoting.jar into \'/var/jenkins_home \' on agent\\n\\n```bash\\n[07/05/21 17:35:37] [SSH] Remote file system root /var/jenkins_home  does not exist. Will try to create it...\\njava.io.IOException: Could not copy remoting.jar into \'/var/jenkins_home \' on agent\\n\\tat hudson.plugins.sshslaves.SSHLauncher.copyAgentJar(SSHLauncher.java:738)\\n\\tat hudson.plugins.sshslaves.SSHLauncher.access$400(SSHLauncher.java:111)\\n\\tat hudson.plugins.sshslaves.SSHLauncher$1.call(SSHLauncher.java:456)\\n\\tat hudson.plugins.sshslaves.SSHLauncher$1.call(SSHLauncher.java:421)\\n\\tat java.util.concurrent.FutureTask.run(FutureTask.java:266)\\n\\tat java.util.concurrent.ThreadPoolExecutor.runWorker(ThreadPoolExecutor.java:1149)\\n\\tat java.util.concurrent.ThreadPoolExecutor$Worker.run(ThreadPoolExecutor.java:624)\\n\\tat java.lang.Thread.run(Thread.java:748)\\nCaused by: java.io.IOException: Failed to mkdir /var/jenkins_home\\n\\tat com.trilead.ssh2.jenkins.SFTPClient.mkdirs(SFTPClient.java:91)\\n\\tat hudson.plugins.sshslaves.SSHLauncher.copyAgentJar(SSHLauncher.java:695)\\n\\t... 7 more\\nCaused by: com.trilead.ssh2.SFTPException: Permission denied (SSH_FX_PERMISSION_DENIED: The user does not have sufficient permissions to perform the operation.)\\n\\tat com.trilead.ssh2.SFTPv3Client.expectStatusOKMessage(SFTPv3Client.java:555)\\n\\tat com.trilead.ssh2.SFTPv3Client.mkdir(SFTPv3Client.java:955)\\n\\tat com.trilead.ssh2.jenkins.SFTPClient.mkdirs(SFTPClient.java:89)\\n\\t... 8 more\\n```\\n\\n## References\\n\\n- [(Nginx) \uae30\ubcf8 \uc124\uc815 \ubc29\ubc95](https://architectophile.tistory.com/12)\\n- [\uc2e4\uc81c\ub85c \uc0ac\uc6a9 \uac00\ub2a5\ud55c nginx \ud504\ub85d\uc2dc \uc11c\ubc84 \ub9cc\ub4e4\uae30 (docker-compose)](https://elvanov.com/2312)\\n- [\uc820\ud0a8\uc2a4 Master/Slave \ubd84\uc0b0 \ube4c\ub4dc \ud658\uacbd \ub3c4\ucee4\ub85c \uad6c\ucd95\ud558\uae30](https://cornswrold.tistory.com/510)"},{"id":"/2021/01/20/server/nginx-proxy","metadata":{"permalink":"/gloria-tilog/2021/01/20/server/nginx-proxy","source":"@site/blog/server/2021/01-20-nginx-proxy/index.mdx","title":"[Nginx] Reverse Proxy","description":"\uac1c\ubc1c \uc0b0\ucd9c\ubb3c\uc5d0 \ub300\ud558\uc5ec \ud558\ub098\uc758 \uc11c\ube44\uc2a4 \ud3ec\ud2b8\uc5d0\uc11c \uac1c\ubc1c \ube0c\ub79c\uce58\uc5d0 \ub530\ub77c \ub77c\uc6b0\ud305 \ucc98\ub9ac\ub97c \ud558\uc5ec \uc811\uc18d\uc774 \uac00\ub2a5\ud558\ub3c4\ub85d \uad6c\uc131\uc744 \ud560 \ud544\uc694\uac00 \uc788\uc5b4\uc11c Proxy \uc124\uc815\uc744 Nginx\uc5d0 \uc801\uc6a9\ud574\ubcf4\uc558\ub2e4.","date":"2021-01-20T14:31:00.000Z","formattedDate":"January 20, 2021","tags":[{"label":"nginx","permalink":"/gloria-tilog/tags/nginx"},{"label":"proxy","permalink":"/gloria-tilog/tags/proxy"}],"readingTime":1.53,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"[Nginx] Reverse Proxy","tags":["nginx","proxy"],"date":"2021-01-20T14:31"},"prevItem":{"title":"[CI/CD] Configuration CI (1) - Install Jenkins (master-slave) with nginx proxy","permalink":"/gloria-tilog/2021/05/13/ci/install-ci-jenkins"},"nextItem":{"title":"\uc2a4\ud0dd/\ud050 - \uc1e0\ub9c9\ub300\uae30","permalink":"/gloria-tilog/2018/10/09/etc/algorithm/solve-stack-lv2"}},"content":"\uac1c\ubc1c \uc0b0\ucd9c\ubb3c\uc5d0 \ub300\ud558\uc5ec \ud558\ub098\uc758 \uc11c\ube44\uc2a4 \ud3ec\ud2b8\uc5d0\uc11c \uac1c\ubc1c \ube0c\ub79c\uce58\uc5d0 \ub530\ub77c \ub77c\uc6b0\ud305 \ucc98\ub9ac\ub97c \ud558\uc5ec \uc811\uc18d\uc774 \uac00\ub2a5\ud558\ub3c4\ub85d \uad6c\uc131\uc744 \ud560 \ud544\uc694\uac00 \uc788\uc5b4\uc11c Proxy \uc124\uc815\uc744 Nginx\uc5d0 \uc801\uc6a9\ud574\ubcf4\uc558\ub2e4.\\nnginx\uc758 `reverse proxy`\ub97c \ud65c\uc6a9\ud558\uc5ec \uc124\uc815\ud55c \uae30\ub85d\\n\\n\x3c!--truncate--\x3e\\n\\n## nginx.conf\\n\\n[StackOverflow](https://superuser.com/questions/330194/how-to-i-get-variables-from-location-in-nginx)\uc758 \uae00\uc744 \ucc38\uace0\ud558\uc5ec\\n`location`\uc758 \uc124\uc815\uc744 \uc815\uaddc\uc2dd \ud328\ud134\uc744 \uc774\uc6a9\ud558\uc5ec \uc815\uc758\ud55c \ud6c4\uc5d0 \uc77d\uc5b4\ub4e4\uc778 \ubcc0\uc218\ub97c \uae30\ubc18\uc73c\ub85c \uacbd\ub85c\ub97c \ucc3e\uc544\uc11c static \ud398\uc774\uc9c0\ub97c \ubcf4\uc5ec\uc8fc\ub3c4\ub85d \ucc98\ub9ac\ud558\uc600\ub2e4.\\n\\n```bash\\nserver {\\n    listen       10080;\\n    server_name _;\\n\\n   \\troot\\t\\t /home1/irteam/deploy/storybook;\\n\\tindex        index.html;\\n\\n\\tlocation ~* ^/(?<branch>(\\\\w+))/(.*) {\\n    \\troot\\t\\t /home1/irteam/deploy/storybook;\\n\\t}\\n\\n\\tlocation / {\\n\\t\\tif ($arg_branch) {\\n\\t\\t\\trewrite ^ /$arg_branch break;\\n\\t\\t}\\n\\n\\t\\trewrite ^ /master break;\\n    }\\n}\\n```\\n\\n\uc704\uc640 \uac19\uc774 \uc124\uc815 \ud6c4\uc5d0, nginx\ub97c \uc7ac\uae30\ub3d9 \ud6c4 \ud14c\uc2a4\ud2b8\ub97c \ud574\ubcf4\uba74..\\n\\n`\ub3c4\uba54\uc778 \uc8fc\uc18c`\ub85c \uc811\uadfc\uc744 \ud558\uac8c \ub418\uba74 \uc544\ub798\uc640 \uac19\uc774 \ube4c\ub4dc\ud558\uc5ec \ubc30\ud3ec\ud574\ub454 \uc2a4\ud1a0\ub9ac\ubd81 \ud654\uba74\uc73c\ub85c \ub9ac\ub2e4\uc774\ub809\ud2b8 \ub418\uc5b4 \ubcf4\uc5ec\uc9c4\ub2e4.\\n![master](./master.png)\\n\\n\uadf8\ub9ac\uace0 `{\ub3c4\uba54\uc778 \uc8fc\uc18c}?branch=dev`\ub97c \uc694\uccad\uc744 \ud558\uba74 `**location ~_ ^/(?<branch>(\\\\w+))/(._)**` \uc5d0 \uc815\uc758\ud55c\\nroot \uacbd\ub85c \ud558\uc704\uc5d0\uc11c \ud574\ub2f9 \ud30c\uc77c\uc744 \ucc3e\uc544\uc11c \ub178\ucd9c\ud574\uc900\ub2e4.\\n![dev](./dev.png)\\n\\n## Reference\\n\\n- [Nginx-\ubcc0\uc218](https://opentutorials.org/module/384/4508)\\n- [NGINX\uc5d0 \ub300\ud55c \uc815\ub9ac #Upstream #Reverse Proxy #Proxy_pass](https://developer88.tistory.com/299/)"},{"id":"/2018/10/09/etc/algorithm/solve-stack-lv2","metadata":{"permalink":"/gloria-tilog/2018/10/09/etc/algorithm/solve-stack-lv2","source":"@site/blog/etc/algorithm/2018-10-09-solve-stack-lv2.mdx","title":"\uc2a4\ud0dd/\ud050 - \uc1e0\ub9c9\ub300\uae30","description":"\ubb38\uc81c \uc124\uba85","date":"2018-10-09T21:53:00.000Z","formattedDate":"October 9, 2018","tags":[{"label":"algorithm","permalink":"/gloria-tilog/tags/algorithm"},{"label":"stack","permalink":"/gloria-tilog/tags/stack"},{"label":"java","permalink":"/gloria-tilog/tags/java"},{"label":"javascript","permalink":"/gloria-tilog/tags/javascript"}],"readingTime":3.615,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\uc2a4\ud0dd/\ud050 - \uc1e0\ub9c9\ub300\uae30","tags":["algorithm","stack","java","javascript"],"date":"2018-10-09 21:53"},"prevItem":{"title":"[Nginx] Reverse Proxy","permalink":"/gloria-tilog/2021/01/20/server/nginx-proxy"},"nextItem":{"title":"\uc815\ub82c - K\ubc88\uc9f8\uc218","permalink":"/gloria-tilog/2018/10/09/etc/algorithm/solve-sort-lv1"}},"content":"\x3c!--truncate--\x3e\\n\\n## \ubb38\uc81c \uc124\uba85\\n\\n\uc5ec\ub7ec \uac1c\uc758 \uc1e0\ub9c9\ub300\uae30\ub97c \ub808\uc774\uc800\ub85c \uc808\ub2e8\ud558\ub824\uace0 \ud569\ub2c8\ub2e4. \ud6a8\uc728\uc801\uc778 \uc791\uc5c5\uc744 \uc704\ud574\uc11c \uc1e0\ub9c9\ub300\uae30\ub97c \uc544\ub798\uc5d0\uc11c \uc704\ub85c \uacb9\uccd0 \ub193\uace0, \ub808\uc774\uc800\ub97c \uc704\uc5d0\uc11c \uc218\uc9c1\uc73c\ub85c \ubc1c\uc0ac\ud558\uc5ec \uc1e0\ub9c9\ub300\uae30\ub4e4\uc744 \uc790\ub985\ub2c8\ub2e4. \uc1e0\ub9c9\ub300\uae30\uc640 \ub808\uc774\uc800\uc758 \ubc30\uce58\ub294 \ub2e4\uc74c \uc870\uac74\uc744 \ub9cc\uc871\ud569\ub2c8\ub2e4.\\n\\n```\\n- \uc1e0\ub9c9\ub300\uae30\ub294 \uc790\uc2e0\ubcf4\ub2e4 \uae34 \uc1e0\ub9c9\ub300\uae30 \uc704\uc5d0\ub9cc \ub193\uc77c \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n- \uc1e0\ub9c9\ub300\uae30\ub97c \ub2e4\ub978 \uc1e0\ub9c9\ub300\uae30 \uc704\uc5d0 \ub193\ub294 \uacbd\uc6b0 \uc644\uc804\ud788 \ud3ec\ud568\ub418\ub3c4\ub85d \ub193\ub418, \ub05d\uc810\uc740 \uacb9\uce58\uc9c0 \uc54a\ub3c4\ub85d \ub193\uc2b5\ub2c8\ub2e4.\\n- \uac01 \uc1e0\ub9c9\ub300\uae30\ub97c \uc790\ub974\ub294 \ub808\uc774\uc800\ub294 \uc801\uc5b4\ub3c4 \ud558\ub098 \uc874\uc7ac\ud569\ub2c8\ub2e4.\\n- \ub808\uc774\uc800\ub294 \uc5b4\ub5a4 \uc1e0\ub9c9\ub300\uae30\uc758 \uc591 \ub05d\uc810\uacfc\ub3c4 \uacb9\uce58\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\\n```\\n\\n\uc544\ub798 \uadf8\ub9bc\uc740 \uc704 \uc870\uac74\uc744 \ub9cc\uc871\ud558\ub294 \uc608\ub97c \ubcf4\uc5ec\uc90d\ub2c8\ub2e4. \uc218\ud3c9\uc73c\ub85c \uadf8\ub824\uc9c4 \uad75\uc740 \uc2e4\uc120\uc740 \uc1e0\ub9c9\ub300\uae30\uc774\uace0, \uc810\uc740 \ub808\uc774\uc800\uc758 \uc704\uce58, \uc218\uc9c1\uc73c\ub85c \uadf8\ub824\uc9c4 \uc810\uc120 \ud654\uc0b4\ud45c\ub294 \ub808\uc774\uc800\uc758 \ubc1c\uc0ac \ubc29\ud5a5\uc785\ub2c8\ub2e4.\\n\\n![image0.png](https://grepp-programmers.s3.amazonaws.com/files/ybm/dbd166625b/d3ae656b-bb7b-421c-9f74-fa9ea800b860.png)\\n\\n\uc774\ub7ec\ud55c \ub808\uc774\uc800\uc640 \uc1e0\ub9c9\ub300\uae30\uc758 \ubc30\uce58\ub294 \ub2e4\uc74c\uacfc \uac19\uc774 \uad04\ud638\ub97c \uc774\uc6a9\ud558\uc5ec \uc67c\ucabd\ubd80\ud130 \uc21c\uc11c\ub300\ub85c \ud45c\ud604\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n```\\n(a) \ub808\uc774\uc800\ub294 \uc5ec\ub294 \uad04\ud638\uc640 \ub2eb\ub294 \uad04\ud638\uc758 \uc778\uc811\ud55c \uc30d \'()\'\uc73c\ub85c \ud45c\ud604\ud569\ub2c8\ub2e4. \ub610\ud55c \ubaa8\ub4e0 \'()\'\ub294 \ubc18\ub4dc\uc2dc \ub808\uc774\uc800\ub97c \ud45c\ud604\ud569\ub2c8\ub2e4.\\n(b) \uc1e0\ub9c9\ub300\uae30\uc758 \uc67c\ucabd \ub05d\uc740 \uc5ec\ub294 \uad04\ud638 \'(\'\ub85c, \uc624\ub978\ucabd \ub05d\uc740 \ub2eb\ud78c \uad04\ud638 \')\'\ub85c \ud45c\ud604\ub429\ub2c8\ub2e4.\\n```\\n\\n\uc704 \uc608\uc758 \uad04\ud638 \ud45c\ud604\uc740 \uadf8\ub9bc \uc704\uc5d0 \uc8fc\uc5b4\uc838 \uc788\uc2b5\ub2c8\ub2e4.\\n\uc1e0\ub9c9\ub300\uae30\ub294 \ub808\uc774\uc800\uc5d0 \uc758\ud574 \uba87 \uac1c\uc758 \uc870\uac01\uc73c\ub85c \uc798\ub9ac\ub294\ub370, \uc704 \uc608\uc5d0\uc11c \uac00\uc7a5 \uc704\uc5d0 \uc788\ub294 \ub450 \uac1c\uc758 \uc1e0\ub9c9\ub300\uae30\ub294 \uac01\uac01 3\uac1c\uc640 2\uac1c\uc758 \uc870\uac01\uc73c\ub85c \uc798\ub9ac\uace0, \uc774\uc640 \uac19\uc740 \ubc29\uc2dd\uc73c\ub85c \uc8fc\uc5b4\uc9c4 \uc1e0\ub9c9\ub300\uae30\ub4e4\uc740 \ucd1d 17\uac1c\uc758 \uc870\uac01\uc73c\ub85c \uc798\ub9bd\ub2c8\ub2e4.\\n\\n\uc1e0\ub9c9\ub300\uae30\uc640 \ub808\uc774\uc800\uc758 \ubc30\uce58\ub97c \ud45c\ud604\ud55c \ubb38\uc790\uc5f4 arrangement\uac00 \ub9e4\uac1c\ubcc0\uc218\ub85c \uc8fc\uc5b4\uc9c8 \ub54c, \uc798\ub9b0 \uc1e0\ub9c9\ub300\uae30 \uc870\uac01\uc758 \ucd1d \uac1c\uc218\ub97c return \ud558\ub3c4\ub85d solution \ud568\uc218\ub97c \uc791\uc131\ud574\uc8fc\uc138\uc694.\\n\\n### \uc81c\ud55c\uc0ac\ud56d\\n\\n- arrangement\uc758 \uae38\uc774\ub294 \ucd5c\ub300 100,000\uc785\ub2c8\ub2e4.\\n- arrangement\uc758 \uc5ec\ub294 \uad04\ud638\uc640 \ub2eb\ub294 \uad04\ud638\ub294 \ud56d\uc0c1 \uc30d\uc744 \uc774\ub8f9\ub2c8\ub2e4.\\n\\n### \uc785\ucd9c\ub825 \uc608\\n\\n| arrangement            | return |\\n| ---------------------- | ------ |\\n| ()(((()())(())()))(()) | 17     |\\n\\n## \ud480\uc774 \uacb0\uacfc\\n\\n### javascript\\n\\n```javascript\\nfunction solution(arrangement) {\\n  var answer = 0;\\n  let stack = [];\\n  let arr = arrangement.split(\'\');\\n\\n  arr.map((v, i) => {\\n    if (v === \'(\') {\\n      stack.push(v);\\n    } else {\\n      stack.pop();\\n      answer += arr[i - 1] === \'(\' ? stack.length : 1;\\n    }\\n  });\\n  return answer;\\n}\\n```\\n\\n### java\\n\\n```java\\nimport java.util.Stack;\\n\\nclass Solution {\\n    public int solution(String arrangement) {\\n        int answer = 0;\\n        Stack<Integer> stack = new Stack<>();\\n\\n        for (int i=0; i < arrangement.length(); i++) {\\n            if (arrangement.charAt(i) == \'(\') {\\n                stack.push(i);\\n            } else {\\n                stack.pop();\\n                if (arrangement.charAt(i-1) == \'(\') {\\n                    answer += stack.size();\\n                } else {\\n                    answer += 1;\\n                }\\n            }\\n        }\\n        return answer;\\n    }\\n}\\n```"},{"id":"/2018/10/09/etc/algorithm/solve-sort-lv1","metadata":{"permalink":"/gloria-tilog/2018/10/09/etc/algorithm/solve-sort-lv1","source":"@site/blog/etc/algorithm/2018-10-09-solve-sort-lv1.mdx","title":"\uc815\ub82c - K\ubc88\uc9f8\uc218","description":"\ubb38\uc81c \uc124\uba85","date":"2018-10-09T00:38:23.000Z","formattedDate":"October 9, 2018","tags":[{"label":"algorithm","permalink":"/gloria-tilog/tags/algorithm"},{"label":"sort","permalink":"/gloria-tilog/tags/sort"},{"label":"java","permalink":"/gloria-tilog/tags/java"},{"label":"javascript","permalink":"/gloria-tilog/tags/javascript"}],"readingTime":2.025,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\uc815\ub82c - K\ubc88\uc9f8\uc218","tags":["algorithm","sort","java","javascript"],"date":"2018-10-09 00:38:23"},"prevItem":{"title":"\uc2a4\ud0dd/\ud050 - \uc1e0\ub9c9\ub300\uae30","permalink":"/gloria-tilog/2018/10/09/etc/algorithm/solve-stack-lv2"},"nextItem":{"title":"\uc815\ub82c \uc54c\uace0\ub9ac\uc998","permalink":"/gloria-tilog/2018/10/08/etc/algorithm/sort"}},"content":"\x3c!--truncate--\x3e\\n\\n## \ubb38\uc81c \uc124\uba85\\n\\n\ubc30\uc5f4 array\uc758 i\ubc88\uc9f8 \uc22b\uc790\ubd80\ud130 j\ubc88\uc9f8 \uc22b\uc790\uae4c\uc9c0 \uc790\ub974\uace0 \uc815\ub82c\ud588\uc744 \ub54c, k\ubc88\uc9f8\uc5d0 \uc788\ub294 \uc218\ub97c \uad6c\ud558\ub824 \ud569\ub2c8\ub2e4.\\n\\n\uc608\ub97c \ub4e4\uc5b4 array\uac00 [1, 5, 2, 6, 3, 7, 4], i = 2, j = 5, k = 3\uc774\ub77c\uba74\\n\\n1. array\uc758 2\ubc88\uc9f8\ubd80\ud130 5\ubc88\uc9f8\uae4c\uc9c0 \uc790\ub974\uba74 [5, 2, 6, 3]\uc785\ub2c8\ub2e4.\\n2. 1\uc5d0\uc11c \ub098\uc628 \ubc30\uc5f4\uc744 \uc815\ub82c\ud558\uba74 [2, 3, 5, 6]\uc785\ub2c8\ub2e4.\\n3. 2\uc5d0\uc11c \ub098\uc628 \ubc30\uc5f4\uc758 3\ubc88\uc9f8 \uc22b\uc790\ub294 5\uc785\ub2c8\ub2e4.\\n\\n\ubc30\uc5f4 array, [i, j, k]\ub97c \uc6d0\uc18c\ub85c \uac00\uc9c4 2\ucc28\uc6d0 \ubc30\uc5f4 commands\uac00 \ub9e4\uac1c\ubcc0\uc218\ub85c \uc8fc\uc5b4\uc9c8 \ub54c, commands\uc758 \ubaa8\ub4e0 \uc6d0\uc18c\uc5d0 \ub300\ud574 \uc55e\uc11c \uc124\uba85\ud55c \uc5f0\uc0b0\uc744 \uc801\uc6a9\ud588\uc744 \ub54c \ub098\uc628 \uacb0\uacfc\ub97c \ubc30\uc5f4\uc5d0 \ub2f4\uc544 return \ud558\ub3c4\ub85d solution \ud568\uc218\ub97c \uc791\uc131\ud574\uc8fc\uc138\uc694.\\n\\n### \uc81c\ud55c\uc0ac\ud56d\\n\\n- array\uc758 \uae38\uc774\ub294 1 \uc774\uc0c1 100 \uc774\ud558\uc785\ub2c8\ub2e4.\\n- array\uc758 \uac01 \uc6d0\uc18c\ub294 1 \uc774\uc0c1 100 \uc774\ud558\uc785\ub2c8\ub2e4.\\n- commands\uc758 \uae38\uc774\ub294 1 \uc774\uc0c1 50 \uc774\ud558\uc785\ub2c8\ub2e4.\\n- commands\uc758 \uac01 \uc6d0\uc18c\ub294 \uae38\uc774\uac00 3\uc785\ub2c8\ub2e4.\\n\\n### \uc785\ucd9c\ub825 \uc608\\n\\n| array                 | commands                          | return    |\\n| --------------------- | --------------------------------- | --------- |\\n| [1, 5, 2, 6, 3, 7, 4] | [[2, 5, 3], [4, 4, 1], [1, 7, 3]] | [5, 6, 3] |\\n\\n## \ud480\uc774 \uacb0\uacfc\\n\\n### javascript\\n\\n```javascript\\nfunction solution(array, commands) {\\n  return commands.map((v) => {\\n    return array\\n      .slice(v[0] - 1, v[1])\\n      .sort((a, b) => a - b)\\n      .slice(v[2] - 1, v[2])[0];\\n  });\\n}\\n```\\n\\n### java\\n\\n```java\\nimport java.util.*;\\n\\nclass Solution {\\n    public int[] solution(int[] array, int[][] commands) {\\n        int[] answer = new int[commands.length];\\n\\n        for (int i = 0; i < commands.length; i++) {\\n            int start = commands[i][0] - 1;\\n            int end = commands[i][1];\\n            int idx = commands[i][2] - 1;\\n            int[] temp = Arrays.copyOfRange(array, start, end);\\n            Arrays.sort(temp);\\n            // System.out.println(temp[idx]);\\n            answer[i] = temp[idx];\\n        }\\n\\n        return answer;\\n    }\\n}\\n```"},{"id":"/2018/10/08/etc/algorithm/sort","metadata":{"permalink":"/gloria-tilog/2018/10/08/etc/algorithm/sort","source":"@site/blog/etc/algorithm/2018-10-08-sort.mdx","title":"\uc815\ub82c \uc54c\uace0\ub9ac\uc998","description":"\uc544\ub798\uc758 \uc54c\uace0\ub9ac\uc998\uc740 \uc798 \uc774\ud574\uac00 \uac00\uc9c0 \uc54a\ub294\ub2e4..\u3160\u3160","date":"2018-10-08T21:53:00.000Z","formattedDate":"October 8, 2018","tags":[{"label":"algorithm","permalink":"/gloria-tilog/tags/algorithm"},{"label":"sort","permalink":"/gloria-tilog/tags/sort"},{"label":"javascript","permalink":"/gloria-tilog/tags/javascript"}],"readingTime":5.165,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\uc815\ub82c \uc54c\uace0\ub9ac\uc998","tags":["algorithm","sort","javascript"],"date":"2018-10-08 21:53:00"},"prevItem":{"title":"\uc815\ub82c - K\ubc88\uc9f8\uc218","permalink":"/gloria-tilog/2018/10/09/etc/algorithm/solve-sort-lv1"},"nextItem":{"title":"\ud574\uc2dc - \uc804\ud654\ubc88\ud638 \ubaa9\ub85d","permalink":"/gloria-tilog/2018/10/06/etc/algorithm/solve-hash-lv2-2"}},"content":"\x3c!--truncate--\x3e\\n\\n> \uc544\ub798\uc758 \uc54c\uace0\ub9ac\uc998\uc740 \uc798 \uc774\ud574\uac00 \uac00\uc9c0 \uc54a\ub294\ub2e4..\u3160\u3160\\n>\\n> - merge sort\\n>\\n> \uadf8\ub9ac\uace0 \uc2dc\uac04\ubcf5\uc7a1\ub3c4?? \uc131\ub2a5\uc5d0 \uc88b\uc9c0 \uc54a\ub2e4\ub294 \uc758\ubbf8\ub85c \uc774\ud574\uac00 \ub418\ub294\ub370..\\n>\\n> \ub108\ubb34 \uc624\ub7ab\ub9cc\uc5d0 \uc774\ub860\uc801\uc778 \ubd80\ubd84\uc744 \uc774\ud574\ud558\ub824\ub2c8 \uc5b4\ub835\ub2e4..\u3160\u3160\\n>\\n> \ub2e4\uc2dc \ubcf4\uc790 \ub610 \ubcf4\uc790\u2026!! \uc774\ud574\ud560 \ub54c\uae4c\uc9c0\u2026\u3160\u3161\u3160\\n\\n## \ubc84\ube14 \uc815\ub82c (Bubble Sort)\\n\\n- \uc11c\ub85c \uc778\uc811\ud55c \ub450 \uc6d0\uc18c\ub97c \uac80\uc0ac\ud558\uc5ec \uc815\ub82c\ud558\ub294 \uc54c\uace0\ub9ac\uc998\\n\\n## \uc120\ud0dd \uc815\ub82c(Selection Sort)\\n\\n- [\uc81c\uc790\ub9ac \uc815\ub82c](https://ko.wikipedia.org/w/index.php?title=%EC%A0%9C%EC%9E%90%EB%A6%AC_%EC%95%8C%EA%B3%A0%EB%A6%AC%EC%A6%98&action=edit&redlink=1) \uc54c\uace0\ub9ac\uc998 \uc911\uc758 \ud558\ub098\uc774\ub2e4.\\n- \uc8fc\uc5b4\uc9c4 \ubc30\uc5f4\uc5d0\uc11c \ucd5c\uc19f\uac12\uc744 \ucc3e\ub294\ub2e4.\\n- \ucd5c\uc19f\uac12\uc744 \ub9e8 \uc55e\uc758 \uac12\uacfc \uad50\uccb4\ud55c\ub2e4\\n\\n\ud574\ub2f9 \uacfc\uc815\uc744 \ud45c\ud604\ud558\uba74 \uc544\ub798\uc640 \uac19\ub2e4.\\n\\n| \ud328\uc2a4 | \ud14c\uc774\ube14                | \ucd5c\uc19f\uac12 |\\n| ---- | --------------------- | ------ |\\n| 0    | [**9,1,6,8,4,3,2,0**] | 0      |\\n| 1    | [0,**1,6,8,4,3,2,9**] | 1      |\\n| 2    | [0,1,**6,8,4,3,2,9**] | 2      |\\n| 3    | [0,1,2,**8,4,3,6,9**] | 3      |\\n| 4    | [0,1,2,3,**4,8,6,9**] | 4      |\\n| 5    | [0,1,2,3,4,**8,6,9**] | 6      |\\n| 6    | [0,1,2,3,4,6,**8,9**] | 8      |\\n\\n### \uad6c\ud604 \ucf54\ub4dc\\n\\n#### Javascript\\n\\n```javascript\\nfunction selectionSort(arr) {\\n  console.log(\'input: \' + arr);\\n  for (let i = 0; i < arr.length; i++) {\\n    let minIdx = i;\\n\\n    // \ucd5c\uc19f\uac12\uc774 \uc704\uce58\ud55c \uc778\ub371\uc2a4\ub97c \ucc3e\ub294\ub2e4\\n    for (let j = i + 1; j < arr.length; j++) {\\n      if (arr[j] < arr[minIdx]) minIdx = j;\\n    }\\n\\n    // \ucd5c\uc19f\uac12\uacfc \ud604\uc7ac\uc758 \uc778\ub371\uc2a4\uc5d0 \uc704\uce58\ud55c \uac12\uc744 \ubc14\uafd4\uce58\uae30 \ud55c\ub2e4\\n    let temp = arr[minIdx];\\n    arr[minIdx] = arr[i];\\n    arr[i] = temp;\\n  }\\n  console.log(\'output: \' + arr);\\n}\\n\\nselectionSort([8, 5, 6, 2, 4]);\\nselectionSort([3, 7, 2, 5, 1, 4]);\\n```\\n\\n## \uc0bd\uc785 \uc815\ub82c(Insertion Sort)\\n\\n- \uc190\uc5d0 \ub4e4\uace0 \uc788\ub294 \uce74\ub4dc\uc758 \uc21c\uc11c\ub97c \uc815\ub82c\ud558\ub294 \ubc29\ubc95\uacfc \uc720\uc0ac\ud558\ub2e4.\\n- \uc790\ub8cc \ubc30\uc5f4\uc758 \ubaa8\ub4e0 \uc694\uc18c\ub97c \uc55e\uc5d0\uc11c\ubd80\ud130 \ucc28\ub840\ub300\ub85c \uc774\ubbf8 \uc815\ub82c\ub41c \ubc30\uc5f4 \ubd80\ubd84\uacfc \ube44\uad50\ud558\uc5ec \uc790\uc2e0\uc758 \uc704\uce58\ub97c \ucc3e\uc544 \uc0bd\uc785\ud558\ub294 \uc815\ub82c \uc54c\uace0\ub9ac\uc998\\n- \ub450 \ubc88\uc9f8 \uc694\uc18c\ubd80\ud130 \ud06c\uae30\uc758 \ube44\uad50\ub97c \uc2dc\uc791\ud55c\ub2e4.\\n\\n![img](https://upload.wikimedia.org/wikipedia/commons/e/ea/Insertion_sort_001.PNG)\\n\\n### \ud2b9\uc9d5\\n\\n- \uc7a5\uc810\\n  - \uad6c\ud604\uc774 \ub2e8\uc21c\ud558\ub2e4\\n- \ub2e8\uc810\\n  - \ubc30\uc5f4\uc774 \uae38\uc218\ub85d \ud6a8\uc728\uc774 \ub5a8\uc5b4\uc9c4\ub2e4\\n\\n### \uad6c\ud604 \ucf54\ub4dc\\n\\n#### Javascript\\n\\n```javascript\\nfunction insertionSort(arr) {\\n  console.log(\'input: \' + arr);\\n  for (let i = 1; i < arr.length; i++) {\\n    // \ud604\uc7ac \ube44\uad50\ud560 \uac12\uc744 \uc800\uc7a5\\n    let key = arr[i];\\n    let j = i - 1;\\n\\n    // key \uac12\uc758 \uc704\uce58\ubd80\ud130 \uc5ed\uc21c\uc73c\ub85c \uc870\uc0ac\ud558\uba70, key \uac12\ubcf4\ub2e4 \ud070 \uacbd\uc6b0 \ud55c \uce78 \ub4a4\ub85c \uc774\ub3d9\uc2dc\ud0a8\ub2e4\\n    for (; j >= 0 && key < arr[j]; j--) {\\n      arr[j + 1] = arr[j];\\n    }\\n\\n    arr[j + 1] = key;\\n  }\\n  console.log(\'output: \' + arr);\\n}\\n\\ninsertionSort([8, 5, 6, 2, 4]);\\ninsertionSort([3, 7, 2, 5, 1, 4]);\\n```\\n\\n## \ud569\ubcd1 or \ubcd1\ud569 \uc815\ub82c (Merge Sort)\\n\\n- \ube44\uad50 \uae30\ubc18 \uc815\ub82c \uc54c\uace0\ub9ac\uc998\uc73c\ub85c [\ubd84\ud560 \uc815\ubcf5 \uc54c\uace0\ub9ac\uc998](https://ko.wikipedia.org/wiki/%EB%B6%84%ED%95%A0_%EC%A0%95%EB%B3%B5_%EC%95%8C%EA%B3%A0%EB%A6%AC%EC%A6%98) \uc758 \ud558\ub098\uc774\ub2e4\\n- \ub2e4\uc74c\uacfc \uac19\uc774 \ub3d9\uc791\ud55c\ub2e4.\\n  1. \ub9ac\uc2a4\ud2b8\uc758 \uae38\uc774\uac00 0 \ub610\ub294 1\uc774\uba74 \uc774\ubbf8 \uc815\ub82c\ub41c \uac83\uc73c\ub85c \ubcf8\ub2e4. \uadf8\ub807\uc9c0 \uc54a\uc740 \uacbd\uc6b0\uc5d0\ub294\\n  2. \uc815\ub82c\ub418\uc9c0 \uc54a\uc740 \ub9ac\uc2a4\ud2b8\ub97c \uc808\ubc18\uc73c\ub85c \uc798\ub77c \ube44\uc2b7\ud55c \ud06c\uae30\uc758 \ub450 \ubd80\ubd84 \ub9ac\uc2a4\ud2b8\ub85c \ub098\ub208\ub2e4.\\n  3. \uac01 \ubd80\ubd84 \ub9ac\uc2a4\ud2b8\ub97c [\uc7ac\uadc0](https://ko.wikipedia.org/wiki/%EC%9E%AC%EA%B7%80%ED%95%A8%EC%88%98)\uc801\uc73c\ub85c \ud569\ubcd1 \uc815\ub82c\uc744 \uc774\uc6a9\ud574 \uc815\ub82c\ud55c\ub2e4.\\n  4. \ub450 \ubd80\ubd84 \ub9ac\uc2a4\ud2b8\ub97c \ub2e4\uc2dc \ud558\ub098\uc758 \uc815\ub82c\ub41c \ub9ac\uc2a4\ud2b8\ub85c [\ud569\ubcd1](https://ko.wikipedia.org/w/index.php?title=%ED%95%A9%EB%B3%91_%EC%95%8C%EA%B3%A0%EB%A6%AC%EC%A6%98&action=edit&redlink=1)\ud55c\ub2e4.\\n\\n![img](https://cdn-images-1.medium.com/max/1600/1*aJ1YiME33o0dBZTCmid7iw.png)\\n\\n## \ud035 \uc815\ub82c (Quick Sort)\\n\\n- [\ubd84\ud560 \uc815\ubcf5 \uc54c\uace0\ub9ac\uc998](https://ko.wikipedia.org/wiki/%EB%B6%84%ED%95%A0_%EC%A0%95%EB%B3%B5_%EC%95%8C%EA%B3%A0%EB%A6%AC%EC%A6%98) \uc758 \ud558\ub098\uc774\ub2e4\\n- \ub2e4\uc74c\uacfc \uac19\uc774 \ub3d9\uc791\ud55c\ub2e4.\\n\\n  1. \ub9ac\uc2a4\ud2b8 \uac00\uc6b4\ub370\uc11c \ud558\ub098\uc758 \uc6d0\uc18c\ub97c \uace0\ub978\ub2e4. \uc774\ub807\uac8c \uace0\ub978 \uc6d0\uc18c\ub97c **\ud53c\ubc97**\uc774\ub77c\uace0 \ud55c\ub2e4.\\n  2. \ud53c\ubc97 \uc55e\uc5d0\ub294 \ud53c\ubc97\ubcf4\ub2e4 \uac12\uc774 \uc791\uc740 \ubaa8\ub4e0 \uc6d0\uc18c\ub4e4\uc774 \uc624\uace0, \ud53c\ubc97 \ub4a4\uc5d0\ub294 \ud53c\ubc97\ubcf4\ub2e4 \uac12\uc774 \ud070 \ubaa8\ub4e0 \uc6d0\uc18c\ub4e4\uc774 \uc624\ub3c4\ub85d \ud53c\ubc97\uc744 \uae30\uc900\uc73c\ub85c \ub9ac\uc2a4\ud2b8\ub97c \ub458\ub85c \ub098\ub208\ub2e4. \uc774\ub807\uac8c \ub9ac\uc2a4\ud2b8\ub97c \ub458\ub85c \ub098\ub204\ub294 \uac83\uc744 **\ubd84\ud560**\uc774\ub77c\uace0 \ud55c\ub2e4. \ubd84\ud560\uc744 \ub9c8\uce5c \ub4a4\uc5d0 \ud53c\ubc97\uc740 \ub354 \uc774\uc0c1 \uc6c0\uc9c1\uc774\uc9c0 \uc54a\ub294\ub2e4.\\n  3. \ubd84\ud560\ub41c \ub450 \uac1c\uc758 \uc791\uc740 \ub9ac\uc2a4\ud2b8\uc5d0 \ub300\ud574 [\uc7ac\uadc0(Recursion)](https://ko.wikipedia.org/wiki/%EC%9E%AC%EA%B7%80%ED%95%A8%EC%88%98)\uc801\uc73c\ub85c \uc774 \uacfc\uc815\uc744 \ubc18\ubcf5\ud55c\ub2e4. \uc7ac\uadc0\ub294 \ub9ac\uc2a4\ud2b8\uc758 \ud06c\uae30\uac00 0\uc774\ub098 1\uc774 \ub420 \ub54c\uae4c\uc9c0 \ubc18\ubcf5\ub41c\ub2e4.\\n\\n- \uc7ac\uadc0 \ud638\ucd9c\uc774 \ud55c\ubc88 \uc9c4\ud589\ub420 \ub54c\ub9c8\ub2e4 \ucd5c\uc18c\ud55c \ud558\ub098\uc758 \uc6d0\uc18c\ub294 \ucd5c\uc885\uc801\uc73c\ub85c \uc704\uce58\uac00 \uc815\ud574\uc9c0\ubbc0\ub85c, \uc774 \uc54c\uace0\ub9ac\uc998\uc740 \ubc18\ub4dc\uc2dc \ub05d\ub09c\ub2e4\ub294 \uac83\uc744 \ubcf4\uc7a5\ud560 \uc218 \uc788\ub2e4.\\n\\n![img](https://image.slidesharecdn.com/3-150507101206-lva1-app6892/95/38-quicksort-5-1024.jpg?cb=1430993563)"},{"id":"/2018/10/06/etc/algorithm/solve-hash-lv2-2","metadata":{"permalink":"/gloria-tilog/2018/10/06/etc/algorithm/solve-hash-lv2-2","source":"@site/blog/etc/algorithm/2018-10-06-solve-hash-lv2-2.mdx","title":"\ud574\uc2dc - \uc804\ud654\ubc88\ud638 \ubaa9\ub85d","description":"\ubb38\uc81c \uc124\uba85","date":"2018-10-06T10:58:00.000Z","formattedDate":"October 6, 2018","tags":[{"label":"algorithm","permalink":"/gloria-tilog/tags/algorithm"},{"label":"hash","permalink":"/gloria-tilog/tags/hash"},{"label":"java","permalink":"/gloria-tilog/tags/java"}],"readingTime":1.69,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\ud574\uc2dc - \uc804\ud654\ubc88\ud638 \ubaa9\ub85d","tags":["algorithm","hash","java"],"date":"2018-10-06T10:58"},"prevItem":{"title":"\uc815\ub82c \uc54c\uace0\ub9ac\uc998","permalink":"/gloria-tilog/2018/10/08/etc/algorithm/sort"},"nextItem":{"title":"\ud574\uc2dc - \uc704\uc7a5","permalink":"/gloria-tilog/2018/10/06/etc/algorithm/solve-hash-lv2-1"}},"content":"\x3c!--truncate--\x3e\\n\\n## \ubb38\uc81c \uc124\uba85\\n\\n\uc804\ud654\ubc88\ud638\ubd80\uc5d0 \uc801\ud78c \uc804\ud654\ubc88\ud638 \uc911, \ud55c \ubc88\ud638\uac00 \ub2e4\ub978 \ubc88\ud638\uc758 \uc811\ub450\uc5b4\uc778 \uacbd\uc6b0\uac00 \uc788\ub294\uc9c0 \ud655\uc778\ud558\ub824 \ud569\ub2c8\ub2e4.\\n\uc804\ud654\ubc88\ud638\uac00 \ub2e4\uc74c\uacfc \uac19\uc744 \uacbd\uc6b0, \uad6c\uc870\ub300 \uc804\ud654\ubc88\ud638\ub294 \uc601\uc11d\uc774\uc758 \uc804\ud654\ubc88\ud638\uc758 \uc811\ub450\uc0ac\uc785\ub2c8\ub2e4.\\n\\n- \uad6c\uc870\ub300 : 119\\n- \ubc15\uc900\uc601 : 97 674 223\\n- \uc9c0\uc601\uc11d : 11 9552 4421\\n\\n\uc804\ud654\ubc88\ud638\ubd80\uc5d0 \uc801\ud78c \uc804\ud654\ubc88\ud638\ub97c \ub2f4\uc740 \ubc30\uc5f4 phone_book \uc774 solution \ud568\uc218\uc758 \ub9e4\uac1c\ubcc0\uc218\ub85c \uc8fc\uc5b4\uc9c8 \ub54c, \uc5b4\ub5a4 \ubc88\ud638\uac00 \ub2e4\ub978 \ubc88\ud638\uc758 \uc811\ub450\uc5b4\uc778 \uacbd\uc6b0\uac00 \uc788\uc73c\uba74 false\ub97c \uadf8\ub807\uc9c0 \uc54a\uc73c\uba74 true\ub97c return \ud558\ub3c4\ub85d solution \ud568\uc218\ub97c \uc791\uc131\ud574\uc8fc\uc138\uc694.\\n\\n### \uc81c\ud55c\uc0ac\ud56d\\n\\n- phone_book\uc758 \uae38\uc774\ub294 1 \uc774\uc0c1 1,000,000 \uc774\ud558\uc785\ub2c8\ub2e4.\\n- \uac01 \uc804\ud654\ubc88\ud638\uc758 \uae38\uc774\ub294 1 \uc774\uc0c1 20 \uc774\ud558\uc785\ub2c8\ub2e4.\\n\\n### \uc785\ucd9c\ub825 \uc608\uc81c\\n\\n| phone_book                  | return |\\n| --------------------------- | ------ |\\n| [119, 97674223, 1195524421] | false  |\\n| [123,456,789]               | true   |\\n| [12,123,1235,567,88]        | false  |\\n\\n## \ud480\uc774 \uacb0\uacfc\\n\\n### java\\n\\n```java\\nclass Solution {\\n    public boolean solution(String[] phone_book) {\\n        boolean answer = true;\\n\\n        for (int i = 0; i < phone_book.length-1; i++) {\\n            for (int j = i+1; j < phone_book.length; j++) {\\n                if (phone_book[i].startsWith(phone_book[j]) ||\\n                   phone_book[j].startsWith(phone_book[i])) {\\n                    answer = false;\\n                    break;\\n                }\\n            }\\n            if (!answer) break;\\n        }\\n\\n        return answer;\\n    }\\n}\\n```\\n\\n## \ubb38\uc81c\ub97c \ud480\uace0 \ub09c \ub4a4\uc5d0...\\n\\n- \uc804\ub2ec\ubc1b\uc740 \ubc30\uc5f4\uc744 \uc815\ub82c\uc744 \ud558\uace0 \ub09c \ub4a4\uc5d0 \ube44\uad50\ud558\ub294 \uac8c \uc880\ub354 \ud6a8\uc728\uc801\uc77c \uac83 \uac19\ub2e4."},{"id":"/2018/10/06/etc/algorithm/solve-hash-lv2-1","metadata":{"permalink":"/gloria-tilog/2018/10/06/etc/algorithm/solve-hash-lv2-1","source":"@site/blog/etc/algorithm/2018-10-06-solve-hash-lv2-1.mdx","title":"\ud574\uc2dc - \uc704\uc7a5","description":"\ubb38\uc81c \uc124\uba85","date":"2018-10-05T22:55:30.000Z","formattedDate":"October 5, 2018","tags":[{"label":"algorithm","permalink":"/gloria-tilog/tags/algorithm"},{"label":"hash","permalink":"/gloria-tilog/tags/hash"},{"label":"java","permalink":"/gloria-tilog/tags/java"},{"label":"javascript","permalink":"/gloria-tilog/tags/javascript"}],"readingTime":3.81,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\ud574\uc2dc - \uc704\uc7a5","tags":["algorithm","hash","java","javascript"],"date":"2018-10-05T22:55:30.000Z"},"prevItem":{"title":"\ud574\uc2dc - \uc804\ud654\ubc88\ud638 \ubaa9\ub85d","permalink":"/gloria-tilog/2018/10/06/etc/algorithm/solve-hash-lv2-2"},"nextItem":{"title":"\ud574\uc2dc - \uc644\uc8fc\ud558\uc9c0 \ubabb\ud55c \uc120\uc218","permalink":"/gloria-tilog/2018/10/05/etc/algorithm/solve-hash-lv1"}},"content":"\x3c!--truncate--\x3e\\n\\n## \ubb38\uc81c \uc124\uba85\\n\\n\uc2a4\ud30c\uc774\ub4e4\uc740 \ub9e4\uc77c \ub2e4\ub978 \uc637\uc744 \uc870\ud569\ud558\uc5ec \uc785\uc5b4 \uc790\uc2e0\uc744 \uc704\uc7a5\ud569\ub2c8\ub2e4.\\n\\n\uc608\ub97c \ub4e4\uc5b4 \uc2a4\ud30c\uc774\uac00 \uac00\uc9c4 \uc637\uc774 \uc544\ub798\uc640 \uac19\uace0 \uc624\ub298 \uc2a4\ud30c\uc774\uac00 \ub3d9\uadf8\ub780 \uc548\uacbd, \uae34 \ucf54\ud2b8, \ud30c\ub780\uc0c9 \ud2f0\uc154\uce20\ub97c \uc785\uc5c8\ub2e4\uba74 \ub2e4\uc74c\ub0a0\uc740 \uccad\ubc14\uc9c0\ub97c \ucd94\uac00\ub85c \uc785\uac70\ub098 \ub3d9\uadf8\ub780 \uc548\uacbd \ub300\uc2e0 \uac80\uc815 \uc120\uae00\ub77c\uc2a4\ub97c \ucc29\uc6a9\ud558\uac70\ub098 \ud574\uc57c \ud569\ub2c8\ub2e4.\\n\\n| \uc885\ub958 | \uc774\ub984                       |\\n| ---- | -------------------------- |\\n| \uc5bc\uad74 | \ub3d9\uadf8\ub780 \uc548\uacbd, \uac80\uc815 \uc120\uae00\ub77c\uc2a4 |\\n| \uc0c1\uc758 | \ud30c\ub780\uc0c9 \ud2f0\uc154\uce20              |\\n| \ud558\uc758 | \uccad\ubc14\uc9c0                     |\\n| \uac89\uc637 | \uae34 \ucf54\ud2b8                    |\\n\\n\uc2a4\ud30c\uc774\uac00 \uac00\uc9c4 \uc758\uc0c1\ub4e4\uc774 \ub2f4\uae34 2\ucc28\uc6d0 \ubc30\uc5f4 clothes\uac00 \uc8fc\uc5b4\uc9c8 \ub54c \uc11c\ub85c \ub2e4\ub978 \uc637\uc758 \uc870\ud569\uc758 \uc218\ub97c return \ud558\ub3c4\ub85d solution \ud568\uc218\ub97c \uc791\uc131\ud574\uc8fc\uc138\uc694.\\n\\n### \uc81c\ud55c\uc0ac\ud56d\\n\\n- clothes\uc758 \uac01 \ud589\uc740 [\uc758\uc0c1\uc758 \uc774\ub984, \uc758\uc0c1\uc758 \uc885\ub958]\ub85c \uc774\ub8e8\uc5b4\uc838 \uc788\uc2b5\ub2c8\ub2e4.\\n- \uc2a4\ud30c\uc774\uac00 \uac00\uc9c4 \uc758\uc0c1\uc758 \uc218\ub294 1\uac1c \uc774\uc0c1 30\uac1c \uc774\ud558\uc785\ub2c8\ub2e4.\\n- \uac19\uc740 \uc774\ub984\uc744 \uac00\uc9c4 \uc758\uc0c1\uc740 \uc874\uc7ac\ud558\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\\n- clothes\uc758 \ubaa8\ub4e0 \uc6d0\uc18c\ub294 \ubb38\uc790\uc5f4\ub85c \uc774\ub8e8\uc5b4\uc838 \uc788\uc2b5\ub2c8\ub2e4.\\n- \ubaa8\ub4e0 \ubb38\uc790\uc5f4\uc758 \uae38\uc774\ub294 1 \uc774\uc0c1 20 \uc774\ud558\uc778 \uc790\uc5f0\uc218\uc774\uace0 \uc54c\ud30c\ubcb3 \uc18c\ubb38\uc790 \ub610\ub294 \'\\\\_\' \ub85c\ub9cc \uc774\ub8e8\uc5b4\uc838 \uc788\uc2b5\ub2c8\ub2e4.\\n- \uc2a4\ud30c\uc774\ub294 \ud558\ub8e8\uc5d0 \ucd5c\uc18c \ud55c \uac1c\uc758 \uc758\uc0c1\uc740 \uc785\uc2b5\ub2c8\ub2e4.\\n\\n### \uc785\ucd9c\ub825 \uc608\\n\\n| clothes                                                                        | return |\\n| ------------------------------------------------------------------------------ | ------ |\\n| [[yellow_hat, headgear], [blue_sunglasses, eyewear], [green_turban, headgear]] | 5      |\\n| [[crow_mask, face], [blue_sunglasses, face], [smoky_makeup, face]]             | 3      |\\n\\n## \ud480\uc774 \uacb0\uacfc\\n\\n> \ud574\ub2f9 \ubb38\uc81c\uc758 \uacbd\uc6b0, _\ub3d9\uc2dc\uc5d0_ \uc637\uc744 \uc120\ud0dd\ud558\ub294 \uacbd\uc6b0\uc774\ubbc0\ub85c,\\n>\\n> \uacbd\uc6b0\uc758 \uc218 **\uacf1\uc758 \ubc95\uce59**\uc744 \uc774\uc6a9\ud558\uc5ec \ud574\ub2f9 \uacfc\uc815\uc744 \ud480\uc774\ud560 \uc218 \uc788\uc74c.\\n>\\n> - **\uacf1\uc758 \ubc95\uce59**: \uacbd\uc6b0\uc758 \uc218\ub97c \uad6c\ud574\uc57c \ud560 \uc5ec\ub7ec \uc0ac\uac74\ub4e4\uc774 \uc11c\ub85c **\uc601\ud5a5\uc744 \uc8fc\uc9c0 \uc54a\uac70\ub098** \uc77c\uc5b4\ub098\ub294 \uc0c1\ud669\uc774 **\uad6c\uc870\uac00 \ub2ee\uc740** \uacbd\uc6b0, \uacbd\uc6b0\uc758 \uc218\ub97c \ubb49\uccd0\uc11c \uacc4\uc0b0\ud558\uac8c \ub41c\ub2e4. and\uac00 \uacf1\uc758 \ubc95\uce59\uc774\ub2e4.\\n>   \ub450 \uc0ac\uac74 A, B\uc758 \uacbd\uc6b0\uc758 \uc218\ub97c \ub530\uc9c4\ub2e4\uba74, \uc0ac\uac74 A\uac00 \uc77c\uc5b4\ub098\ub294 \uacbd\uc6b0\uc758 \uc218\uac00 m\uac00\uc9c0, \uc0ac\uac74 B\uac00 \uc77c\uc5b4\ub098\ub294 \uacbd\uc6b0\uc758 \uc218\ub294 n\uac00\uc9c0\ub77c\uba74 A\uc640 B\uac00 \ub3d9\uc2dc\uc5d0 \uc77c\uc5b4\ub098\ub294 \uacbd\uc6b0\uc758 \uc218\ub294 m\\\\*n \uac00\uc9c0\ub2e4.\\n\\n\ub2e4\uc74c\uacfc \uac19\uc740 \uc21c\uc11c\ub85c \ud480\uc5b4\ub098\uac10.\\n\\n- \uc885\ub958\ubcc4\ub85c \uad6c\ubd84\ud558\uae30\\n- \uacbd\uc6b0\uc758 \uc218 \uad6c\ud558\uae30\\n  - \uac01 \uc885\ub958 \ubcc4\ub85c \ud55c \ubc88\ub3c4 \uc120\ud0dd\ud558\uc9c0 \uc54a\ub294 \uacbd\uc6b0\ub3c4 \uc788\uc73c\ubbc0\ub85c \uad6c\ud55c \uacbd\uc6b0\uc758 \uc218\uc5d0 *1*\uc529 \ub354\ud574\uc900\ub2e4.\\n  - \ucd5c\uc885\uc801\uc73c\ub85c \uad6c\ud574\uc9c4 \uc218\uc5d0\uc11c \uc801\uc5b4\ub3c4 \ud55c \uac00\uc9c0 \uc637\uc740 \uc120\ud0dd\ud558\ubbc0\ub85c *1*\uc744 \ube7c\uc900\ub2e4. (\uc989, \ubaa8\ub4e0 \uc637\uc744 \uc120\ud0dd\ud558\uc9c0 \uc54a\uc744 \uacbd\uc6b0\uc758 \uc218\ub97c \ube80\ub2e4.)\\n\\n### javascript\\n\\n```javascript\\nfunction solution(clothes) {\\n  let answer = 1;\\n  let clothesObj = new Object();\\n\\n  clothes.map((arr) => {\\n    if (!clothesObj[arr[1]]) clothesObj[arr[1]] = [];\\n    clothesObj[arr[1]].push(arr[0]);\\n  });\\n\\n  Object.keys(clothesObj).map((key) => {\\n    answer = answer * (clothesObj[key].length + 1);\\n  });\\n\\n  return answer - 1;\\n}\\n```\\n\\n### java\\n\\n```java\\nimport java.util.*;\\n\\nclass Solution {\\n    public int solution(String[][] clothes) {\\n        int answer = 1;\\n        HashMap<String, Integer> map = new HashMap<>();\\n        for (String[] cloth : clothes) {\\n            map.put(cloth[1], map.getOrDefault(cloth[1], 0) + 1);\\n        }\\n\\n        for (Map.Entry<String, Integer> entry : map.entrySet()) {\\n            answer = answer * (entry.getValue() + 1);\\n        }\\n        return answer - 1;\\n    }\\n}\\n```"},{"id":"/2018/10/05/etc/algorithm/solve-hash-lv1","metadata":{"permalink":"/gloria-tilog/2018/10/05/etc/algorithm/solve-hash-lv1","source":"@site/blog/etc/algorithm/2018-10-05-solve-hash-lv1.mdx","title":"\ud574\uc2dc - \uc644\uc8fc\ud558\uc9c0 \ubabb\ud55c \uc120\uc218","description":"\ubb38\uc81c \uc124\uba85","date":"2018-10-05T22:53:00.000Z","formattedDate":"October 5, 2018","tags":[{"label":"algorithm","permalink":"/gloria-tilog/tags/algorithm"},{"label":"hash","permalink":"/gloria-tilog/tags/hash"},{"label":"java","permalink":"/gloria-tilog/tags/java"},{"label":"javascript","permalink":"/gloria-tilog/tags/javascript"}],"readingTime":1.94,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\ud574\uc2dc - \uc644\uc8fc\ud558\uc9c0 \ubabb\ud55c \uc120\uc218","tags":["algorithm","hash","java","javascript"],"date":"2018-10-05T22:53"},"prevItem":{"title":"\ud574\uc2dc - \uc704\uc7a5","permalink":"/gloria-tilog/2018/10/06/etc/algorithm/solve-hash-lv2-1"},"nextItem":{"title":"\ud53c\ubcf4\ub098\uce58 \uc218\uc5f4","permalink":"/gloria-tilog/2017/05/26/etc/algorithm/fibonacci"}},"content":"\x3c!--truncate--\x3e\\n\\n## \ubb38\uc81c \uc124\uba85\\n\\n\uc218\ub9ce\uc740 \ub9c8\ub77c\ud1a4 \uc120\uc218\ub4e4\uc774 \ub9c8\ub77c\ud1a4\uc5d0 \ucc38\uc5ec\ud558\uc600\uc2b5\ub2c8\ub2e4. \ub2e8 \ud55c \uba85\uc758 \uc120\uc218\ub97c \uc81c\uc678\ud558\uace0\ub294 \ubaa8\ub4e0 \uc120\uc218\uac00 \ub9c8\ub77c\ud1a4\uc744 \uc644\uc8fc\ud558\uc600\uc2b5\ub2c8\ub2e4.\\n\\n\ub9c8\ub77c\ud1a4\uc5d0 \ucc38\uc5ec\ud55c \uc120\uc218\ub4e4\uc758 \uc774\ub984\uc774 \ub2f4\uae34 \ubc30\uc5f4 participant\uc640 \uc644\uc8fc\ud55c \uc120\uc218\ub4e4\uc758 \uc774\ub984\uc774 \ub2f4\uae34 \ubc30\uc5f4 completion\uc774 \uc8fc\uc5b4\uc9c8 \ub54c, \uc644\uc8fc\ud558\uc9c0 \ubabb\ud55c \uc120\uc218\uc758 \uc774\ub984\uc744 return \ud558\ub3c4\ub85d solution \ud568\uc218\ub97c \uc791\uc131\ud574\uc8fc\uc138\uc694.\\n\\n### \uc81c\ud55c\uc0ac\ud56d\\n\\n- \ub9c8\ub77c\ud1a4 \uacbd\uae30\uc5d0 \ucc38\uc5ec\ud55c \uc120\uc218\uc758 \uc218\ub294 1\uba85 \uc774\uc0c1 100,000\uba85 \uc774\ud558\uc785\ub2c8\ub2e4.\\n- completion\uc758 \uae38\uc774\ub294 participant\uc758 \uae38\uc774\ubcf4\ub2e4 1 \uc791\uc2b5\ub2c8\ub2e4.\\n- \ucc38\uac00\uc790\uc758 \uc774\ub984\uc740 1\uac1c \uc774\uc0c1 20\uac1c \uc774\ud558\uc758 \uc54c\ud30c\ubcb3 \uc18c\ubb38\uc790\ub85c \uc774\ub8e8\uc5b4\uc838 \uc788\uc2b5\ub2c8\ub2e4.\\n- \ucc38\uac00\uc790 \uc911\uc5d0\ub294 \ub3d9\uba85\uc774\uc778\uc774 \uc788\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n### \uc785\ucd9c\ub825 \uc608\\n\\n| participant                             | completion                       | return |\\n| --------------------------------------- | -------------------------------- | ------ |\\n| [leo, kiki, eden]                       | [eden, kiki]                     | leo    |\\n| [marina, josipa, nikola, vinko, filipa] | [josipa, filipa, marina, nikola] | vinko  |\\n| [mislav, stanko, mislav, ana]           | [stanko, ana, mislav]            | mislav |\\n\\n## \ud480\uc774 \uacb0\uacfc\\n\\n### javascript\\n\\n```javascript\\nfunction solution(participant, completion) {\\n  var answer = \'\';\\n\\n  participant = participant.sort();\\n  completion = completion.sort();\\n\\n  for (let i = 0; i < participant.length; i++) {\\n    if (completion[i] === null || completion[i] !== participant[i]) {\\n      return participant[i];\\n    }\\n  }\\n\\n  return answer;\\n}\\n```\\n\\n### java\\n\\n```java\\nimport java.util.*;\\n\\nclass Solution {\\n    public String solution(String[] participant, String[] completion) {\\n        String answer = \\"\\";\\n        HashMap<String, Integer> map = new HashMap<>();\\n\\n        for (String person : participant) {\\n            map.put(person, map.getOrDefault(person, 0) + 1);\\n        }\\n        for (String person : completion) {\\n            map.put(person, map.getOrDefault(person, 0) - 1);\\n        }\\n\\n        for (Map.Entry<String, Integer> entry : map.entrySet()) {\\n            if (entry.getValue() > 0) {\\n                answer = entry.getKey();\\n                break;\\n            }\\n        }\\n\\n        return answer;\\n    }\\n}\\n```"},{"id":"/2017/05/26/etc/algorithm/fibonacci","metadata":{"permalink":"/gloria-tilog/2017/05/26/etc/algorithm/fibonacci","source":"@site/blog/etc/algorithm/2017-05-26-fibonacci.mdx","title":"\ud53c\ubcf4\ub098\uce58 \uc218\uc5f4","description":"\ud53c\ubcf4\ub098\uce58\ub294 \uc218\ud559\uc5d0\uc11c \uc810\ud654\uc2dd\uc73c\ub85c \uc815\uc758\ub418\ub294 \uc218\uc5f4.","date":"2017-05-26T09:53:00.000Z","formattedDate":"May 26, 2017","tags":[{"label":"algorithm","permalink":"/gloria-tilog/tags/algorithm"},{"label":"fibonacci","permalink":"/gloria-tilog/tags/fibonacci"},{"label":"java","permalink":"/gloria-tilog/tags/java"}],"readingTime":1.18,"hasTruncateMarker":true,"authors":[],"frontMatter":{"title":"\ud53c\ubcf4\ub098\uce58 \uc218\uc5f4","tags":["algorithm","fibonacci","java"],"date":"2017-05-26T09:53"},"prevItem":{"title":"\ud574\uc2dc - \uc644\uc8fc\ud558\uc9c0 \ubabb\ud55c \uc120\uc218","permalink":"/gloria-tilog/2018/10/05/etc/algorithm/solve-hash-lv1"}},"content":"\x3c!--truncate--\x3e\\n\\n\ud53c\ubcf4\ub098\uce58\ub294 \uc218\ud559\uc5d0\uc11c \uc810\ud654\uc2dd\uc73c\ub85c \uc815\uc758\ub418\ub294 \uc218\uc5f4.\\n0\uacfc 1\ub85c \uc2dc\uc791\ud558\uace0, \ub2e4\uc74c\uc5d0 \uc624\ub294 \ud53c\ubcf4\ub098\uce58 \uc218\ub294 \ubc14\ub85c \uc55e\uc5d0 \uc624\ub294 \ub450 \uc218\uc758 \ud569\uc774 \ub41c\ub2e4.\\n\uc989, \uc544\ub798\uc640 \uac19\uc740 \uc218\uc774\ub2e4..\\n\\n```\\n1, 2, 3, 5, 8, 13, 21, 34, ...\\n```\\n\\n\uc774\uac83\uc744 \uc7ac\uadc0\ud568\uc218\ub098 \ubc18\ubcf5\ubb38\uc73c\ub85c \ud45c\ud604\ud558\uba74 \uc544\ub798\uc640 \uac19\ub2e4.\\n\\n## \uc7ac\uadc0\ud568\uc218\\n\\n### Java\\n\\n```java\\npublic long fibonacci_recursion(int num) {\\n    long answer = 0;\\n\\n    if (num == 0) answer = 0;\\n    else if (num == 1) answer = 1;\\n    else answer = fibonacci_recursion(num - 1) + fibonacci_recursion(num - 2);\\n\\n    return answer;\\n}\\n```\\n\\n## \ubc18\ubcf5\ubb38\\n\\n### Java\\n\\n```java\\npublic long fibonacci_loop(int num) {\\n    long answer = 0;\\n\\n    long f0 = 0;\\n    long f1 = 1;\\n\\n    for (int i = 1; i < num; i++) {\\n        answer = f0 + f1;\\n        f0 = f1;\\n        f1 = answer;\\n    }\\n\\n    return answer;\\n}\\n```\\n\\n## Reference\\n\\n- [\ud53c\ubcf4\ub098\uce58 \uc218 - \uc704\ud0a4\ubc31\uacfc, \uc6b0\ub9ac \ubaa8\ub450\uc758 \ubc31\uacfc\uc0ac\uc804](https://ko.wikipedia.org/wiki/%ED%94%BC%EB%B3%B4%EB%82%98%EC%B9%98_%EC%88%98)\\n- [\uc790\uc5f0 \uc18d\uc5d0 \uc228\uc740 \ud53c\ubcf4\ub098\uce58 \uc218, \ud53c\ubcf4\ub098\uce58 \uc218\uc5f4 : \ub124\uc774\ubc84 \ube14\ub85c\uadf8](http://blog.naver.com/PostView.nhn?blogId=forfriend5&logNo=220472225501)"}]}')}}]);